INSERT INTO `event` (`id`,`created_at`,`updated_at`,`type`,`title`,`description`,`start_time`,`end_time`,`address`,`trail_difficulty`,`trail_notes`,`rally_address`,`members_only`,`max_attendees`,`max_rigs`,`host`,`featured_image`,`creator`,`change_disabled`) VALUES ('ckomdpbk2005ub4b7akk5ds67','2021-05-13 04:15:30.242','2021-06-14 21:32:37.039','RUN','Saxon Mtn / Cascade Creek (formerly Spring Creek) run','<p>Trails: <a href=\"https://www.trailsoffroad.com/trails/449-saxon-mountain\" rel=\"noopener noreferrer\" target=\"_blank\">Saxon Mountain</a> | <a href=\"https://www.trailsoffroad.com/trails/249-cascade-creek\" rel=\"noopener noreferrer\" target=\"_blank\">Cascade Creek</a></p><p>Spring Creek will be postponed to another time.</p><p>Both trails are intermediate level. We\'ll meet in Georgetown and travel up Saxon Mountain. This is a shelf road, so be prepared. Afterwards, we\'ll take Cascade Creek down and end up on CO 108 on the way to Idaho Springs.</p><p><strong>Please come prepared with water, snacks and lunch on the trail.</strong></p>','2021-06-19 15:00:00','2021-06-19 22:00:00','','INTERMEDIATE',NULL,'Behind the Circle K, 1501 Argentine St, Georgetown, CO 80444',0,-1,8,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl2icc5v500130704l11idh7v','2022-04-28 01:42:04.686','2022-07-13 04:39:18.898','CAMPING','Annual Moab runs/camping trip','<p>Our annual Moab camping trip!</p><p>Gold Bar Group Campsite B</p><p>Runs will be decided in advance closer to the event. We aim to have an easy and a moderate/difficult run for each day. If you have any ideas for trails you would like to run, or consider leading, email treasurer@4-playersofcolorado.org. Cost per member is $40 (<a href=\"https://buy.stripe.com/aEU3fLbGU6OE1xe28b\" rel=\"noopener noreferrer\" target=\"_blank\">pay here</a>), per guest is $50 (<a href=\"https://buy.stripe.com/dR6g2xaCQ0qg2Bi3cg\" rel=\"noopener noreferrer\" target=\"_blank\">pay here</a>).</p><p>Remember, this terrain is considered high desert, so please plan accordingly. Bring rain gear and plenty of water. This year the group camp site is mostly without shade so plan to bring sunscreen and cover as needed.</p><p><strong>Please plan on eating dinner with the club on Saturday. The club will provide food, just bring drinks, a chair, and your appetite.&nbsp;</strong>If you have any dietary restrictions, please email treasurer@4-playersofcolorado.org&nbsp;</p><p>We have a lot of tents/trailers/vehicles to fit into the camping space and this year is a different group site. Please work with each other to make sure that we can comfortably fit in the site, which may mean we need to be a little flexible with our arrangements and/or parking. For example, you may not be able to use your RV\'s side awning if the parking lot is full. If there are any issues, please talk to an officer.&nbsp;</p><p>If you arrive midday on Wednesday and leave on Sunday morning, there\'d be 7 meals to cook (not including Saturday dinner, which the club is providing). If you are interested in sharing meals and cooking with others, let Jason Dean know and a Google sign up sheet will be created later. BYO lunch foods and drinks.&nbsp;</p>','2022-09-28 18:00:00','2022-10-02 17:00:00','H9G8+J3 Moab, Utah','UNKNOWN',NULL,'',0,30,-1,'ckomap3ww005213b70kjhcoc4','cl33nvbmg00lv0745rw4eov8l','ckomap3ww005213b70kjhcoc4',0),('cl27p1mew00lv07282ouuqzqz','2022-04-20 14:52:20.023','2022-08-15 19:48:55.072','RUN','Breckenridge Peak 10','<p><span style=\"color: rgb(0, 0, 0);\">Peak 10 is a scenic easy-to-intermediate run that starts at the base of the ski resort and runs all the way to the communication tower on the ridge. The first half of the course is dirt road, followed by more typical rock road with some tight switchbacks at the top. </span></p><p><span style=\"color: rgb(0, 0, 0);\">Rally meet up will be at the Beaver Run Parking Lot in Breckenridge CO.</span></p>','2022-08-20 15:00:00','2022-08-20 21:00:00','','INTERMEDIATE',NULL,'Beaver Run Parking Lot (620 Village Rd, Breckenridge, CO)',0,-1,8,'ckomap3ww004y13b76fvy4564',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl0wtesyn00a40720k5vhvynl','2022-03-18 19:29:23.231','2022-04-20 15:10:31.389','RUN','Switzerland Trail w/ Pennsylvania Gulch','<p>This is an easy run to get out on the trails early in the year. Nearly the entire route is a shelf road offering spectacular views of the nearby foothills and the snow-capped peaks to the west. The trail follows an old railroad route from Sugarloaf Mountain to the community of Gold Hill. We will start the trail off Sugar loaf mountain road at the Sugarloaf mountain trailhead.&nbsp;&nbsp;Trails:&nbsp;<a href=\"https://www.trailsoffroad.com/trails/474-switzerland-trail\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44);\">Switzerland Trail</a>&nbsp;|&nbsp;<a href=\"https://www.trailsoffroad.com/trails/413-pennsylvania-gulch\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44);\">Pennsylvania Gulch</a>&nbsp;&nbsp;Date: Sat 5/8/21 Time:&nbsp;9:00 AM MDT. Depart 9:15 AM MDT sharp.&nbsp;Difficulty: Easy Rally Location:&nbsp;King Soopers 1650 30th St Boulder In Sunrise Center&nbsp;Trail Head: 40.024992 W, -105.42481 N&nbsp;Run Leader: Doug Tear&nbsp;Bring a lunch and a chair. Please check the weather in advance and wear the appropriate layers, bring drinks and snacks. If we finish early, we can get a late lunch in town&nbsp;&nbsp;Due to the popularity of the trail, we will leave early and the run is limited to 12 rigs. We will run the trail to the end and back.&nbsp;&nbsp;&nbsp;If there is interest, we will run Pennsylvania Gulch on the way back. It is a short intermediate trail and provides a some more challenging terrain.</p><h3><br></h3><h3>Switzerland Trail&nbsp;Information</h3><p>40° 1\' 4.17\"N 105° 30\' 33.66\"W From Lyons go 15.5 miles on CO HWY 7 to CO HWY 72 a.k.a. Peak to Peak HWY and turn left onto HWY 72. Go 15.9 miles to CR 120J and turn left, this is the start of the Switzerland Trail. From Boulder go 16 miles on CO HWY 119 / Boulder Canyon Drive to the first roundabout in the Town of Nederland. Take the 2nd exit from the roundabout which is W 2nd street / CO HWY 72. Continue 5.8 miles to CR 120J and turn right onto the trailhead.</p>','2022-05-07 15:00:00','2022-05-07 21:00:00','','EASY',NULL,'King Soopers in Boulder (30th St)',0,-1,20,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3ww004t13b7h7d0e136',0),('cl27nuang009r07285bblrjek','2022-04-20 14:18:38.541','2022-05-05 18:16:22.728','SOCIAL','4x4 Night at Denver Sweet','<p>4x4 Night at Denver Sweet is designed to come together as a club and show off our rigs to the public! Bring your rigs out and mingle with guests of Denver Sweet - this is a great community event to expand our reach.</p><p>Drink Special - BOGO wells and drafts!</p>','2022-05-12 23:00:00','2022-05-13 02:00:00','776 Lincoln St, Denver, CO 80203','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckomdpbk1005qb4b71cl9093s','2021-05-13 04:15:30.241','2021-06-11 15:23:11.427','RUN','Mad Creek run','<p>Bring a lunch</p><p><br></p><p><br></p><p>This is a shorter, easy trail just outside of Empire</p><p>If there\'s time and interest, we can go check out <a href=\"https://www.trailsoffroad.com/trails/219-bill-moore-lake\" rel=\"noopener noreferrer\" target=\"_blank\">Bill Moore Lake</a> (intermediate)</p>','2021-06-12 15:00:00','2021-06-12 22:00:00','','EASY',NULL,'Sinclair Gas Station, 1039 Co Rd 308, Dumont, CO 80436',0,-1,10,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl27nyudj00b20728d4llwrji','2022-04-20 14:22:10.758','2022-04-20 14:23:44.95','SOCIAL','Pride Night at the Rockies','<p>***Tickets have already been purchased***</p><p><br></p><p><br></p><p>Join us for Pride Night at the Rockies!</p>','2022-06-04 00:40:00','2022-06-04 04:00:00','2001 Blake Street, Denver, CO ','UNKNOWN',NULL,'',1,11,-1,'ckomap3ww004t13b7h7d0e136','cl27o0v2700cr07289n6biuwq','ckomap3ww004t13b7h7d0e136',0),('cl27q1rf300za0728q9cu6d87','2022-04-20 15:20:26.126','2022-04-24 20:53:06.608','FUNDRAISING','Beer Bust at Denver Sweet','<p>Beer Busts are our only means of fundraising, it\'s really important that we have a large showing - we need 15 people! Wear your 4-Players gear and come help pour at the beer bust!&nbsp;</p><p><br></p><p><strong>IMPORTANT: Arrive at 3:15pm for non-optional training</strong>&nbsp;Bust goes from 4pm to 8pm&nbsp;</p>','2022-08-07 21:15:00','2022-08-08 02:00:00','776 Lincoln St, Denver, CO 80203','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww005213b70kjhcoc4',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl27oampo00gp07289a1mxepl','2022-04-20 14:31:20.699','2022-04-25 18:45:28.608','RUN','Red Elephant Hill','<p><span style=\"color: rgb(0, 0, 0);\">Situated within the Arapaho National Forest, the Red Elephant Hill Off-road Trail is the toughest trail in the Empire Loop. The Empire Loop is a network of trails just above Empire, Colorado that also includes Bill Moore Lake and Mill Creek. </span></p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Please come prepared with a full tank of gas, water, snacks and lunch on the trail.</span></p>','2022-06-12 15:00:00','2022-06-12 21:00:00','','ADVANCED',NULL,'Safeway in Idaho Springs (2425 Miner St, Idaho Springs)',0,-1,6,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',0),('cl2drm4wj00bo0743ozvv8f58','2022-04-24 20:50:53.385','2022-04-24 20:50:53.385','MEETING','March Membership Meeting','','2022-03-15 01:00:00','2022-03-15 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckomdpbk2005sb4b7bij52r74','2021-05-13 04:15:30.242','2021-07-16 19:19:01.683','FUNDRAISING','Denver Sweet Beer Bust','<p>Our second fundraiser in over a year, it\'s really important that we have a large showing - we need 15 people! Wear your 4-Players gear and come help pour at the beer bust!&nbsp;</p><p><br></p><p><strong>IMPORTANT: Arrive at 3:15pm for non-optional training</strong> Bust goes from 4pm to 8pm&nbsp;</p>','2021-08-08 21:15:00','2021-08-09 02:00:00','Denver Sweet, 776 Lincoln St, Denver, CO 80203','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk2005rb4b75xu92qo0','2021-05-13 04:15:30.242','2021-06-02 01:50:36.831','FUNDRAISING','Denver Sweet Pride Beer Bust','<p>Since this is our first fundraiser in over a year, it\'s <em>really important</em> that we have a large showing - we need at least 15 people! This is typical the biggest bust of the year. Wear your 4-Players gear and come help pour at the beer bust!&nbsp;</p><p><strong>IMPORTANT: Arrive at 3:15pm for non-optional training</strong> Bust goes from 4pm to 8pm&nbsp;</p>','2021-06-27 21:15:00','2021-06-28 02:00:00','Denver Sweet, 776 Lincoln St, Denver, CO 80203','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl2s48i2100em07150e2et4ge','2022-05-04 21:52:58.728','2022-05-09 20:58:39.245','RUN','COMMUNITY: Mad Creek','<p>A community run is meant only for guests and members who have joined in 2021. They\'re intended for guest members and members that have joined the club within the last year who may be newer to the sport. It’s an opportunity for asking questions, to learn, and to get out on the trail with folks with similar experience</p><p>For this run we\'ll head to Mad Creek, just above the town of Empire, CO.</p><p>Bring water/drinks, sunscreen, snacks, etc. If there\'s interest, we can head back to Idaho Springs for lunch.</p><p><span style=\"color: rgb(64, 64, 64);\">Mad Creek is a great off-road trail for the novice 4wheeler, or for those looking for a short drive to a fantastic mountain picnic spot. This trail provides amazing views of 13,164ft Mt. Flora. It is a fairly smooth and wide trail with only a few bumpy sections, making it ideal for a stock SUV in the summer, and for big tire rigs seeking deep snow in the winter. From the end of this trail, there are a handful of great hiking trails. The end also provides plenty of room for parking your vehicle while you go off and explore by foot.</span></p>','2022-05-14 15:00:00','2022-05-14 21:00:00','','EASY',NULL,'Safeway, 2425 Miner St, Idaho Springs, CO 80452',0,-1,10,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl27okxb500is0728i4rokieq','2022-04-20 14:39:20.99','2022-04-20 14:48:07.024','RUN','Argentine Pass & McClellan Peak','<p><span style=\"color: rgb(0, 0, 0);\">I am very excited to lead the very first trail I took my jeep out on! This is an intermediate run that is great for beginners. The route starts near Georgetown and follows a trail up to an old mining out post. From there we will head up to the first chosen summit then head to the next one. There are some slight challenges such as shelf roads and tight passings, but no major obstacles to overcome. This is a great run for beginners and provides amazing views of the mountains.</span></p>','2022-08-13 15:00:00','2022-08-13 21:00:00','','INTERMEDIATE',NULL,'Behind Circle K (1501 Argentine St, Georgetown, CO)',0,-1,10,'ckomap3ww004y13b76fvy4564',NULL,'ckomap3ww004t13b7h7d0e136',0),('cl27qip2m015a072864k8ygyx','2022-04-20 15:33:36.235','2022-07-18 15:46:56.277','RUN','Wheeler Lake','<p><span style=\"background-color: transparent; color: rgb(64, 64, 64);\">This off-road trail offers breathtaking alpine scenery and challenging obstacles in Breckenridge, Colorado\'s back yard and is only 1.5 hours from Denver, Colorado. You\'ll be in constant awe from Montgomery Reservoir, to the Magnolia Mill, all the way up the valley to Wheeler Lake itself.</span></p><p><span style=\"background-color: transparent; color: rgb(64, 64, 64);\">Please come prepared with water, snacks and lunch on the trail.</span></p>','2022-07-23 15:00:00','2022-07-23 21:00:00','','ADVANCED',NULL,'City Market (400 North Park Ave, Breckenridge, CO)',0,-1,8,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2drm4wj00br0743fdabjfen','2022-04-24 20:50:53.388','2022-04-24 20:50:53.388','MEETING','June Membership Meeting','','2022-06-14 01:00:00','2022-06-14 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckomdpbk1005ob4b70ij63hd8','2021-05-13 04:15:30.241','2021-05-20 16:26:22.115','RUN','Mt Baldy run','<p>Trails: <a href=\"https://www.trailsoffroad.com/trails/391-mount-baldy\" rel=\"noopener noreferrer\" target=\"_blank\">Mt Baldy</a>&nbsp;</p><p>A mild road (partially shelf) with occasional rough spots, but nothing beyond the capability of a stock 4WD vehicle. Bring water, snacks, and lunch.</p>','2021-05-22 15:00:00','2021-05-22 23:00:00','','INTERMEDIATE',NULL,'Safeway, 1920 S Nevada Ave, Colorado Springs, CO 80905',0,-1,12,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk2005vb4b7c0352r2a','2021-05-13 04:15:30.242','2021-06-26 01:00:00.267','RUN','Anniversary Run','<p>RAIN OR SHINE!</p><p>Trails: <a href=\"https://www.trailsoffroad.com/trails/3814-apex-valley-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">Apex Valley Rd</a> | <a href=\"https://www.trailsoffroad.com/trails/2599-elk-park-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">Elk Park Rd</a> | <a href=\"https://www.trailsoffroad.com/trails/2011-mosquito-creek-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">Mosquito Creek Rd</a>&nbsp;</p><p><strong>This is the rescheduled event from earlier in the year that got postponed due to weather</strong>. Please join us in kicking off our year-long celebration of the club\'s 35-year history on our Anniversary Run to Apex Valley.</p><p>This is a members-only event (have you paid your dues yet?) and all vehicle types are encouraged to attend.&nbsp;</p><p>Bring a lunch and a chair. Please check the weather in advance and wear the appropriate layers, bring drinks and snacks. If we finish early, we can get a late lunch in town</p>','2021-06-26 15:00:00','2021-06-26 22:00:00','','EASY',NULL,'Valero at the exit for Central City Parkway - 2195 East Idaho Springs Road, Idaho Springs, CO 80452',1,-1,30,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl2drm4wi00bm0743akaikw0o','2022-04-24 20:50:53.383','2022-04-24 20:50:53.383','MEETING','January Membership Meeting','','2022-01-11 02:00:00','2022-01-11 03:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2drm4wk00bv0743sjrno68v','2022-04-24 20:50:53.391','2022-04-24 20:50:53.391','MEETING','October Membership Meeting','','2022-10-11 01:00:00','2022-10-11 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2drm4wi00bn0743oll8ru81','2022-04-24 20:50:53.384','2022-04-24 20:50:53.384','MEETING','February Membership Meeting','','2022-02-15 02:00:00','2022-02-15 03:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckq61536j00ci07552nsjes2x','2021-06-21 02:58:56.73','2021-07-02 01:06:05.481','RUN','Yankee Hill run','<p>Moderate Trail Road, Meet in Idaho Springs. There is a small snow crossing on the trail that has \"bitten\" a few people over the years but generally moderate. Fairly rocky trail so we will air down at beginning of trail.</p>','2021-07-18 15:00:00','2021-07-18 21:00:00','','INTERMEDIATE',NULL,'Safeway, Idaho Springs',0,-1,8,'ckomap3wv003q13b757fjdwgt',NULL,'ckomap3wv003q13b757fjdwgt',NULL),('cl2drm4wj00bs0743rkffbvf6','2022-04-24 20:50:53.389','2022-04-24 20:50:53.389','MEETING','July Membership Meeting','','2022-07-12 01:00:00','2022-07-12 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckomdpbju002pb4b7h3jj1ff6','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','MEETING','NOV 2017 Monthly Meeting','','2017-11-14 02:00:00','2017-11-14 03:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl2drm4wj00bp07434m76gukm','2022-04-24 20:50:53.386','2022-04-24 20:50:53.386','MEETING','April Membership Meeting','','2022-04-12 01:00:00','2022-04-12 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2drm4wk00bt0743t2qukje6','2022-04-24 20:50:53.389','2022-04-24 20:50:53.389','MEETING','August Membership Meeting','','2022-08-09 01:00:00','2022-08-09 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2drm4wk00bw0743qk7x2dvp','2022-04-24 20:50:53.392','2022-04-24 20:50:53.392','MEETING','November Membership Meeting','','2022-11-15 02:00:00','2022-11-15 03:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,NULL,0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2drm4wk00bu0743l2comt1z','2022-04-24 20:50:53.39','2022-04-24 20:53:31.396','MEETING','September Membership Meeting','','2022-09-13 01:00:00','2022-09-13 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003j13b7fdylcckg',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2drm4wj00bq0743ye4cxl5s','2022-04-24 20:50:53.387','2022-04-29 19:52:02.725','MEETING','May Membership Meeting','','2022-05-10 01:00:00','2022-05-10 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt','cl2kupq0300qr0778z0f4avb9','ckomap3wv003s13b79xoq6fdt',0),('ckpho0x1g006e0702fc95ao1h','2021-06-04 01:45:18.907','2021-06-04 03:29:13.718','RUN','Red Cone / Radical Hill / Webster Pass run','<p><span style=\"color: rgb(0, 0, 0);\">Red Cone (5-7 Difficult with Severe Obstacles)</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Optional Return trails</span></p><p><span style=\"color: rgb(0, 0, 0);\">Radical Hill (5-7 Difficult with Severe Obstacles)</span></p><p><span style=\"color: rgb(0, 0, 0);\">Deer Creek (3-3 Moderate)</span></p><p><span style=\"color: rgb(0, 0, 0);\">End in Montezuma</span></p><p><span style=\"color: rgb(0, 0, 0);\">Webster Pass to Montezuma (4-4 Moderate)</span></p><p><span style=\"color: rgb(0, 0, 0);\">Webster Pass back to where we started (4-4 Moderate)</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Rally Time 8AM</span></p><p><span style=\"color: rgb(0, 0, 0);\">20-30 min to trailhead.we will air down close to trailhead</span></p><p><span style=\"color: rgb(0, 0, 0);\">Start Time 9AM at Red Cone Trailhead.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Trailhead Coordinates 39°29\'03.3\"N 105°48\'09.8\"W</span></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Bring a lunch and drink.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Plan for rain, wind, and cold.</span></p>','2021-07-31 14:00:00','2021-07-31 21:00:00','','ADVANCED',NULL,'Conoco in Bailey. 60597 US Hwy 285, Bailey, CO 80421',0,-1,8,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckpzj32u700610721c9vf5aia','2021-06-16 13:46:52.822','2021-06-17 15:24:15.554','SOCIAL','Colorado Gay Rodeo Association - Community Booth','<p>The Colorado Gay Rodeo Association will be hosting their annual rodeo at the Arapahoe County Fairgrounds July 10th and 11th. The club will be participating in their \"community\" booth which gives us a way to socialize with rodeo members and attendees to talk about the club, our rigs and what we do! This is a great community outreach opportunity and potential recruitment of new members.</p><p>There will be a community after party on Saturday, July 10th after the rodeo wraps up that will include a drag show, bingo, yard yahtzee, beer pong and other games!</p><p>We need volunteers to help man the booth both days between 10am until about 5pm. Our rigs will be parked next to the booth which will allow us to show them off and talk about them - who doesn\'t love to do that!</p><p>There is a <a href=\"https://docs.google.com/spreadsheets/d/1WUtB7BsNPbysIxqCz0k9WIfzR-becqd30j_7Pq210r8/edit?fbclid=IwAR3zygHwCYrtzwzyA2ZLzehCzS8PxgMG-dc-3_qMXJM-IqcmDhJKvUYxepE\" rel=\"noopener noreferrer\" target=\"_blank\">Google Sheet with time slots to sign up for</a> - I\'m asking volunteers to committee to a 2 hour time slot, but if you are unable to or unable to find a time that works, let Jacob A. know and we will find you a spot! We need as many folks as we can get!</p><p><strong>Each member that volunteers will also receive complimentary admission to the rodeo</strong></p>','2021-07-10 16:00:00','2021-07-12 00:00:00','25690 E Quincy Ave, Aurora, CO 80016','UNKNOWN',NULL,'',1,-1,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl27up9wl01en0728nh0y90l7','2022-04-20 17:30:41.636','2022-08-09 04:25:33.231','CAMPING','Yellowstone','<p><br></p>','2022-09-09 16:00:00','2022-09-19 21:00:00','','INTERMEDIATE',NULL,'TBD',0,4,-1,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl27qab5m01290728ajwq0ccy','2022-04-20 15:27:04.949','2022-07-15 20:11:42.495','RUN','Yankee Hill','<p><span style=\"color: rgb(64, 64, 64);\">Excellent off-road route for those looking to escape the city while being in the heart of mining country. The Yankee Hill to Central City Route takes you directly into the Yankee Hill Network where you could spend a day or two exploring many different trails and route combinations which gives you plenty of off-road miles to enjoy.</span></p><p>We’ll start from the east near Central City and work our way towards St Mary’s glacier. This is a rocky intermediate trail, so plan to air down.</p><p>Please arrive at the rally point on time, fueled-up, and ready to go. Use the restroom and get snacks, drinks, and lunch in advance. Notify the run leader if you are running late.</p><p>Remember, we’ll be at a higher altitude, so plan for cooler weather.</p>','2022-07-16 15:00:00','2022-07-16 21:00:00','','INTERMEDIATE',NULL,'Squatch Store, 2195 East Idaho Springs Road, Idaho Springs, CO 80452',0,-1,10,'ckomap3ww005813b74sxs4jav',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckq05c3pn00e60721apt3qc5v','2021-06-17 00:09:45.418','2021-07-10 14:33:18.476','RUN','GREENHORN: Geneva Creek','<p>Save the date!</p><p>This will be our first Greenhorn Run, meant only for guest members and members who have joined in 2021.</p><p>This is an easier intermediate trail, mostly because of the shelf road section and some light bumps along the way. Most stock 4x4s should be fine. Lots of mines to check out.</p><p>Greenhorn events are intended for guest members and members that have joined the club this year who may be newer to the sport. It’s an opportunity for asking questions, to learn, and to get out on the trail with folks with similar experience.&nbsp;</p><p>Bring a lunch, drinks, and a jacket - we’ll be above tree line for part of the trip.</p>','2021-07-11 15:00:00','2021-07-11 22:00:00','','EASY',NULL,'Behind the Circle K, 1501 Argentine St, Georgetown, CO 80444',0,-1,9,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl27o457g00dc0728cz11ehji','2022-04-20 14:26:18.075','2022-05-31 23:22:59.252','RUN','Pawnee Buttes','<p><span style=\"color: rgb(0, 0, 0);\">Pawnee Grasslands in northeast Colorado contains a peculiar collection of missile silos, windmills (new and old), oil and natural gas facilities, barb-wired fences, and all kinds of wildlife such as snakes, birds, Prong horn and prairie dogs and lots of grasses. </span></p><p><span style=\"color: rgb(0, 0, 0);\">This trail run will be a series of trails in the area that will take us to different parts of the Grasslands. The trails we will be running are New Raymer Loop, Pawnee Grasslands-Keota Loop, and maybe Pawnee Grasslands Solitude Spur if we have time.</span></p><p><span style=\"color: rgb(0, 0, 0);\">In addition to the trails, we will stop in Keota for a short break. Keota isn’t technically a ghost town, but it is close to it. Only a few buildings remain.</span></p><p><span style=\"color: rgb(0, 0, 0);\">A couple of items to keep in mind while on this trail run. </span></p><p><span style=\"color: rgb(0, 0, 0);\">1) Bring a lunch and plenty to drink. </span></p><p><span style=\"color: rgb(0, 0, 0);\">2) Make sure you have a full tank of gas by the time you arrive at our starting address.</span></p><p><span style=\"color: rgb(0, 0, 0);\">3) There are no bathrooms except at the Pawnee Buttes where there are vault toilets.</span></p><p><span style=\"color: rgb(0, 0, 0);\">4) Cell phone service is hit or miss.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Total tour time is estimated at 6-7 hours. </span></p><p><span style=\"color: rgb(0, 0, 0);\">The starting address is in Wiggins CO: </span></p><p><span style=\"color: rgb(0, 0, 0);\">CDOT Rest Area: Wiggins, 5113 US-6, Wiggins, CO 80654.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Please have your vehicle gassed up, drinks, snacks, and restroom break complete so we can leave at 9am.</span></p>','2022-06-05 15:00:00','2022-06-05 23:00:00','','EASY',NULL,'CDOT Rest Area, 5113 US-6, Wiggins, CO 80654',0,-1,8,'ckpo8hppw00fa072719ah9mvg',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckoyyayut00k00768ta0zighb','2021-05-21 23:25:26.644','2021-07-16 01:14:40.66','RUN','Medano Pass run','<p>Trails: <a href=\"https://www.trailsoffroad.com/trails/371-medano-pass\" rel=\"noopener noreferrer\" target=\"_blank\">Medano Pass</a></p><p><span style=\"color: rgb(0, 0, 0);\">Medano pass takes you into the Great Sand Dunes National Park. A parks pass is required in the park. The trail is easy to moderate and has many deep sandy sections (beware of rental jeeps) as well as many water crossings. Depending on the runoff, the water crossings can be fairly deep.</span></p><p><span style=\"color: rgb(0, 0, 0);\">The run will be on Saturday July 17th and will spend some time exploring the Great Sand Dunes.</span></p><blockquote>To reach the trailhead, take HWY 69 South from Westcliff ~24 miles, or West from Walsenburg ~40 miles, to Forest Service road 559. There is a large sign for Medano Pass. The road travels accross private property for the first 7 miles before reaching the National Forest Property. About another half mile to the trailhead</blockquote><p><span style=\"color: rgb(0, 0, 0);\">Doug will be dispersed camping at the eastern end of the trail near Westcliff. He will be going up on Thursday July 15th to secure a camp site. For those not wanting to camp, you may run this as a day run, but it will be a really long day. You may look for accommodations in Westcliff (limited), Walsenburg, Pueblo, or CO Springs. </span></p><p><span style=\"color: rgb(0, 0, 0);\">Medano Pass offers travelers breathtaking scenery, plenty of free dispersed camping, hikes, sand, and water crossings. Truly a gem in the middle of the Rocky Mountains, Medano Pass is your gateway to the Great Sand Dunes National Park. The Great Sand Dunes offer a vista that can be found nowhere else in the state of Colorado. The Great Sand Dunes are the tallest sand dunes in North America, rising to a maximum height of 750 feet.</span></p>','2021-07-17 15:30:00','2021-07-17 21:00:00','','INTERMEDIATE',NULL,'37.86309,-105.40985',0,-1,8,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckphr85bk00sj0702whg7pbbt','2021-06-04 03:14:55.088','2021-06-04 03:17:45.45','RUN','Johnny Park / Pierson Park run','<p><span style=\"color: rgb(0, 0, 0);\">This is an intermediate trail, mostly easy, with a couple of short intermediate to difficult sections. The most difficult obstacles can be bypassed. Stock vehicles with good off-road clearance will need to pick their line but are unlikely to sustain trail damage. We will run it west to east, opposite to what we\'ve done the last two times I led this run. </span></p><p><span style=\"color: rgb(0, 0, 0);\">We will begin at the Johnny Park trailhead off Larimer CR47 near Big Elk Meadows (just west of Pinewood Springs), branch to the Pierson Park trail for an out-and-back run to the 2013 landslide that bisected that trial, and end at Hwy 7 in Cabin Creek, just north of Allenspark. In total, it\'s about 15 miles of trail. Pack a lunch or pick up a sub at the rally point. We will stop for lunch at the landslide and do a short hike to the slide area.</span></p><p><span style=\"color: rgb(0, 0, 0);\">The </span><a href=\"https://www.coloradocherrycompany.com/new-page-2\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0);\">coffee shop/restaurant at the rally point</a><span style=\"color: rgb(0, 0, 0);\"> opens at 9 a.m. on weekends. We\'ll rally in the large parking lot west of the restaurant.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Coming from the metro area, there\'s no gas available past the east side of Lyons, 9 miles before the rally point. Estes Park is the nearest gas to the west, and is 13 miles from the rally point.</span></p><p><span style=\"color: rgb(0, 0, 0);\">I have a place near Pinewood and can accommodate a few guests Saturday night. Ping me if you want to hang out. It\'s my birthday! There WILL be cake.</span></p>','2021-10-17 15:30:00','2021-10-17 21:00:00','','INTERMEDIATE',NULL,'Colorado Cherry Company, 12311 N. ST. VRAIN RD., LYONS, CO 80540',0,-1,8,'ckomap3wv004713b7dbed3dqi',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl1cvplje00440749x4c2ri7p','2022-03-30 01:18:04.867','2022-05-20 13:14:25.899','RUN','***CANCELLED*** Slaughterhouse Gulch','<p>Update 5/20/2022 @ 7:13am - This run has been cancelled due to the winter storm moving in. </p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">As of 5/13, the Forest Service has lifted the seasonal closure for Slaughterhouse Gulch. This 8-mile loop has a number of small obstacles that can help beginners who are looking to experience more moderate obstacles and the run leaders will be there to help you along the way!&nbsp;</span></p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Because the trail just opened for the season, I do anticipate some trail traffic so be sure to bring plenty of water, snacks and a lunch on the trail.</span></p><p><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Rally Point - Loaf N\' Jug (173 Bulldogger Rd., Bailey, CO 80421)</span></p>','2022-05-21 15:00:00','2022-05-21 20:00:00','','INTERMEDIATE',NULL,'Loaf N\' Jug (173 Bulldogger Rd., Bailey, CO 80421)',0,-1,0,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckoyl5q6n004z0768rkf6sh99','2021-05-21 17:17:27.104','2021-07-25 05:07:42.078','CLINIC','Advanced Recovery Clinic','<p><strong>Note</strong>: It is strongly encouraged that you attend the Intro to Recovery class prior to attending this. More private classes will be scheduled next year and public classes are available at <a href=\"https://ontrailtraining.com/classes\" rel=\"noopener noreferrer\" target=\"_blank\">ontrailtraining.com</a>.</p><p>Fill out this waiver: <a href=\"https://www.waiverfile.com/b/RAMOffRoadPark/Waiver.aspx?formid=2cdf35d3-8fae-4a54-8806-14d7d09ddedc\" rel=\"noopener noreferrer\" target=\"_blank\">https://www.waiverfile.com/b/RAMOffRoadPark/Waiver.aspx?formid=2cdf35d3-8fae-4a54-8806-14d7d09ddedc</a></p><p>This is a private class with a&nbsp;<a href=\"https://i4wdta.org/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44); background-color: rgb(255, 255, 255);\">I4WDTA</a>-certified instructor from On Trail Training.&nbsp;<a href=\"https://www.ontrailtraining.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44); background-color: rgb(255, 255, 255);\">More info</a>.</p><p>Cost: $70/person. Pay Craig via <a href=\"https://paypal.me/cfree356\" rel=\"noopener noreferrer\" target=\"_blank\">Paypal</a> or Venmo (@cfree356)</p><p>This is a very hands on and interactive class designed to put the skills learned in the intro class to the test. With multiple stuck scenarios, students are given the opportunity to perform recoveries with a variety of gear and techniques. While we can’t predict every possible way a vehicle can get stuck, we aim to develop the skills and confidence to use the tools at hand to safely get it moving again.</p><p>For class you will want to bring:</p><ul><li>Work gloves preferably with no velcro</li><li>Camp chair</li><li>Notebook/pen</li><li>Lunch/drinks for the day</li><li>If you have a winch, everything you need to operate it</li></ul><p>Please check the weather in advance and wear the appropriate layers and warm footwear, as we will be outside all day in an area with few trees. Class typically wraps up around 5pm.</p><p><br></p><p><br></p><p><br></p><p><strong>Terms and conditions</strong>:</p><ul><li>Class has a limit of <strong>15</strong> rigs/attendees</li><li>You must pay in advance to reserve your spot</li><li>A waitlist will be available</li><li>Space is limited, so you may not bring a guest. If husband/partner/boyfriend would like to attend, they must register and pay for themselves</li><li>Your payment is non-refundable - if you cannot attend, you\'ll have to arrange someone on the waitlist to take your place and receive payment from them</li></ul>','2021-07-25 16:00:00','2021-07-25 23:00:00','RAM Offroad Park, 12800 CO-94, Colorado Springs, CO 80929','UNKNOWN',NULL,'',0,15,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl27qcgho013k0728yoyuzgxu','2022-04-20 15:28:45.18','2022-07-26 21:04:03.62','RUN','Santa Fe Peak','<p>Lots of switch backs on this trail. It is a narrow shelf road in places and can be moderately off-camber. For those afraid of heights, you may be tested on this run. Please do your due diligence and <a href=\"https://www.trailsoffroad.com/trails/445-santa-fe-peak\" rel=\"noopener noreferrer\" target=\"_blank\">read about the trail</a> before attending.</p><p>Rally spot is the northeast corner of the River Run Gondola Parking Lot at Keystone. Plan to arrive ready to go at 9:45am for a prompt 10am departure. Get fuel, get food/drinks, use restroom in advance. If you need it, there\'s a <a href=\"https://goo.gl/maps/MfrNVXZCwdSyNFNA9\" rel=\"noopener noreferrer\" target=\"_blank\">n</a><a href=\"https://goo.gl/maps/MfrNVXZCwdSyNFNA9\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">earby gas station / convenience store</a>.</p><p>We\'ll be above tree line, so please plan accordingly. Bring layers, be ready for inclement weather, wear sunscreen, etc.</p><p>If theres time we can explore Peru Creek, Warden Gulch, Cinnamon Gulch, and/or Chihuahua Gulch.</p>','2022-07-31 15:45:00','2022-07-31 21:00:00','','INTERMEDIATE',NULL,'River Run Gondola Parking Lot, 124 Gondola Rd, Keystone, CO 80435',0,-1,10,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckphq9qhz00if0702xa0m0swn','2021-06-04 02:48:09.574','2021-08-02 23:05:05.21','RUN','Jones Pass run','<p><span style=\"color: rgb(0, 0, 0);\">Jones Pass is an easily accessible trail for most vehicles with a good number of campsites along the road. It is a short drive to the top of the pass when it is not snowed shut, and at the top, you are rewarded with panoramic mountain views in every direction! Jones Pass is located on the Continental Divide. The easy access from I-70 makes it a popular place for a hike or a quick drive to the pass to take in the views.</span></p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">This trail also offers awesome birdseye views of the Henderson Molybdenum Mine.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Woods Creek Road, near Berthoud Pass above the town of Empire, is a short and leisurely drive through property owned by the Henderson/Climax Mine Company that leads to the Urad Lake Wildlife Area. Urad Lake has fantastic fishing and miles of excellent hiking terrain.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Please come prepared with water, snacks. Planning for lunch at the Dairy King.</span></p><p><a href=\"https://www.trailsoffroad.com/trails/346-jones-pass\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0);\">Jones Pass Trails Offroad Information</a></p><p><a href=\"https://www.trailsoffroad.com/trails/3771-woods-creek-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0);\">Woods Creek Road Trails Offroad Information</a></p>','2021-09-12 15:00:00','2021-09-12 22:00:00','','EASY',NULL,'Starbucks, 999 County Road 308B, Dumont, CO 80436',0,-1,10,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',NULL),('cl2s4l4o700jc0715q6vqd5nx','2022-05-04 22:02:47.911','2022-08-12 13:31:43.052','RUN','Kingston Peak','<p>The Kingston Peak trail is almost entirely above treeline, traversing the alpine tundra at 12000\' in between Kingston Peak and James Peak. The trail offers spectacular views of James Peak and the surrounding wilderness. The upper moderate rating for the trail is pretty accurate in my experience. The trail is quite rocky and bumpy, but stock high clearance 4x4s should be able to manage without trail damage. Built rigs won\'t be challenged much, but should still have a good time enjoying the amazing scenery offered by this trail. The road is narrow in places, which can make passing oncoming traffic difficult. There are a few nice large parking areas where we can stop to eat lunch, take in the views, and&nbsp;walk around a&nbsp;bit.</p><p>We\'ll run the trail from East to West,&nbsp;starting near Black Hawk and ending up near St Mary\'s. The rally point is the parking lot of the Z Casino in Blackhawk, across from the post office (GPS coordinates:&nbsp;39.80304829554828, -105.4955149637308). From there, we\'ll travel 2 miles North up Highway 119 to Apex Valley Rd (<a href=\"https://www.trailsoffroad.com/trails/3814-apex-valley-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/3814-apex-valley-road</a>), an easy dirt road. About 6 miles down that, we hit the tiny town of Apex and turn onto Elk Park Rd (<a href=\"https://www.trailsoffroad.com/trails/2599-elk-park-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/2599-elk-park-road</a>) for two&nbsp;miles. This is where the Kingston Peak trail (<a href=\"https://www.trailsoffroad.com/trails/351-kingston-peak\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/351-kingston-peak</a>) proper begins. We\'ll follow the trail west, quickly rising past treeline, then going past Kingston and James Peaks, and eventually descend toward St Mary\'s, where the run will end. From there, it\'s a quick drive down Fall River Rd back to I-70.&nbsp;</p><p><br></p>','2022-08-28 15:30:00','2022-08-28 20:30:00','','INTERMEDIATE',NULL,'Z Casino Parking Lot - 155 Selak Street, Black Hawk, CO 80422',0,-1,10,'ckomap3wu003113b7bvifg74s',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckphnxj4t004w0702ad5hqw9q','2021-06-04 01:42:40.916','2021-06-04 03:28:47.52','RUN','T-33a / Middle St Vrain run','<p><strong style=\"color: rgb(0, 0, 0);\">Bring lunch.</strong></p><p><span style=\"color: rgb(0, 0, 0);\">On June 27th, 1965 United States Airforce Major Currie and 1st Lieutenant Darby veered from their flight path in a Lockheed Martin T-33 trainer jet and crashed into the mountainside in the Arapahoe National Forest. Both crew lost their lives and what remains today are the remnants of the aircraft. This off-road trail takes you within walking distance of the somber and memorialized scene also known as \"The Bunce School Road Plane Crash\".</span></p><p><span style=\"color: rgb(0, 0, 0);\">Rocky or undulated road surface. Potential rocks and/or tree stumps less than 24\" tall and/or vertical ledges less than 24\" tall and/or near vertical ledges or waterfalls less than 54\" inches. Tire placement becomes more difficult. Can be steep and off-camber.</span></p><p><span style=\"color: rgb(0, 0, 0);\">The road is comprised of dirt and rock with two obstacles which can not be bypassed. The majority of this trail is tight with few places to pass opposing vehicles, so always look as far ahead as possible for someone coming towards you. The obstacles can be difficult for stock vehicles. Being lifted is recommended. This is an out and back trail</span></p><p><span style=\"color: rgb(0, 0, 0);\">This is the perfect trail for experienced drivers as well as drivers ready to take their easy wheeling to the next level. It is a moderate trail with obstacles that can be as easy or as difficult as you care to make them.</span></p><p><span style=\"color: rgb(0, 0, 0);\">The trail starts at a large parking area just past Camp Dick, a campground with modern pit toilets. During the summer months it might be difficult to find a parking space but there is always room to air down and get ready.</span></p><p><span style=\"color: rgb(0, 0, 0);\">The trail is almost always wide enough to pass another group, and it starts out as a rocky road just past the parking lot. There is a \"guardian\" obstacle of rocks you must cross at the start. If this obstacle is too challenging then you should probably skip the rest of the trail (Bunce School Road is at the other end of the camp and it is much easier).</span></p><p><span style=\"color: rgb(0, 0, 0);\">There are larger rock obstacles mixed with smaller, bumpier areas along the way. You\'ll pass through these as well as other areas with logs buried in the ground, but the main obstacle is one with a large boulder at the end of it off to the right.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Coney Flats is a little more difficult than Middle St. Vrain with bigger rocks and a large \"lake\" to cross. If you do not do the Coney Flats trail you will need to go back the way you came in.</span></p><p><span style=\"color: rgb(0, 0, 0);\">The Lake can be deep (close to going over a stock Wrangler\'s air intake) or relatively shallow (up to the bumper) but it\'s always a guess. You can estimate how deep it is based on the walkway that runs along the side of the Lake. If the water level is closer than a couple feet to the bottom of the walkway you\'re taking a risk.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Like driving through all water, you should drive fast enough to create a low wake in front of your vehicle, but not so fast to splash any water.</span></p><p><span style=\"color: rgb(0, 0, 0);\">If you run Middle St. Vrain first you will have a more challenging run because the section between it and the Coney Flats \"lake\" will be uphill. If this is the direction you run it in, the trail will start from almost the far end of Middle St. Vrain. You will see a sign pointing to Coney Flats, which is an immediate uphill to your left.</span></p><p><span style=\"color: rgb(0, 0, 0);\">This hill is very steep, rocky, and too narrow in most places to pass another vehicle. Because the trail is run in both directions there is a chance you will find someone else going the other direction. There are places to pull off to the side, but if two large groups meet someone will most likely have to back up to get out of the way (uphill has the right of way, as always, but smaller groups should try to get out of the way if possible).</span></p><p><span style=\"color: rgb(0, 0, 0);\">There is a series of rocky obstacles in the middle of this hill toward the top. It starts out with a dug-out area that requires a flexible suspension and good tire placement. Then you come around a corner to find some good-sized rocks you must negotiate. This section is wider so there are a few lines you can take.</span></p>','2021-07-24 15:00:00','2021-07-24 23:00:00','','ADVANCED',NULL,'Gasamat, 22 CO-72, Nederland, CO 80466',0,-1,8,'ckomap3ww005713b7f3juf7u0',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckpho8vd8007f0702pcyh7bmn','2021-06-04 01:51:29.995','2021-08-04 02:51:55.683','RUN','Rollins Pass East run','<p>Road 117 is an easy 4% grade that ends shortly before the top of the pass tunnel (11,331ft) which has been closed off to vehicle and foot traffic. Hiking option to the top of the pass at the tunnel.&nbsp;Pass by Yankee Doodle Lake and stop for lunch there or by the pass at the top.&nbsp;</p><p><br></p><p><br></p><p>This is a good trail road for any members or guests to join that have a stock rig or are new to off-road trails. Technical experience not required.</p>','2021-08-07 15:30:00','2021-08-07 20:45:00','','EASY',NULL,'Moffat Tunnel East Portal TH Parking Lot',0,-1,12,'ckomap3ww005213b70kjhcoc4',NULL,'ckomap3ww005213b70kjhcoc4',NULL),('cks6rl26t00kn0721gxswfo4v','2021-08-11 00:38:36.626','2021-08-12 03:59:04.249','RUN','Bill Moore Lake run','<p><span style=\"color: rgb(64, 64, 64);\">About 1 hour from Denver, Colorado and situated within the Arapahoe National Forest the Bill Moore Lake 4X4 Road is one of the trails in the Empire Loop, a network of trails just above Empire, Colorado. Offering amazing alpine scenery and fun hill climbs for both the novice and seasoned, this trail is a must do.</span></p>','2021-08-14 15:00:00','2021-08-14 22:00:00','','INTERMEDIATE',NULL,'Safeway - Idaho Springs',0,-1,8,'ckomap3wv003c13b708ks4nv0',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckphrdzmq00vb0702njifbp3l','2021-06-04 03:19:27.649','2021-06-04 03:19:49.342','RUN','Barbour Fork run','<p><span style=\"color: rgb(0, 0, 0);\">Easy/ Moderate (depending on snow)</span></p><p><span style=\"color: rgb(0, 0, 0);\">This is a very short steep trek and may be covered in ice and snow when we go. Which will make it a lot more fun.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Barbour Fork Loop = this fun trail takes you through a big loop filled with hill climbs and descents, and it is fun in either direction. It is one of the closest trails to Denver off of I-70. It starts at the Barbour Fork Picnic Ground at the end of a residential road. There is plenty of room for airing down, along with truck and trailer parking. The trailhead is very easy to find. It starts out as a mellow dirt trail, but it isn\'t long before you\'re crossing up and over small rocks in the trail. The intersection with the big loop comes at just over one mile from the trailhead. The big loop can be run in either direction, but the most challenging direction is probably counter-clockwise. Take a right turn at the \"Y\" intersection to run it in this direction. A good portion of the trail winds through trees, but the biggest hill climb comes soon after the \"Y\" intersection. It is a fun and fairly steep hill of rocks, though it does not continue for long. Continue to stay on the main trail, passing various camp sites. The trail is rougher as you get closer to the far end of the loop. There are a few rough hill climbs, and some rocky sections. At the \"T\" intersection, turn left to continue along the loop. Follow the main trail to work your way around the far end. The descent down the other side of the loop is also a fun time. As you get closer to the \"Y\" intersection of the loop where you were once already, you encounter a long and fun hill with many different lines through it. The dirt is loose, and lines may change from year to year and in different trail conditions. The loop finishes with some fun rocky sections. Then you come to a flat picnic area near a large clearing. There is a roofed area that would suit a big picnic, with lots of parking. It would be easy to get to this area if you do the loop in reverse. When you get back to the \"Y\" intersection, turn right to get back to the trailhead.</span></p>','2021-10-23 15:00:00','2021-10-23 20:00:00','','INTERMEDIATE',NULL,'Safeway, 2425 Miner St., Idaho Springs, CO 80452',0,-1,8,'ckomap3ww005713b7f3juf7u0',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl3p1ghiy001l0777ac22sbt8','2022-05-27 22:51:36.231','2022-06-23 14:39:57.266','FUNDRAISING','PRIDE Beer Bust','<p>More details coming soon, but we’ve been asked to pour at the new Eagle’s Pride beer bust. They are opening up their parking lot and will have a beer trailer, as well as jockeys.</p><p>They’re expecting a big crowd and are asking us to bring 30-40 people to help pour.</p><p>We had a blast pouring at Sweet during Pride, so this should be just as fun! Let’s have a great turnout - friends and family over age 21 are more than welcome to help pour.</p>','2022-06-26 21:15:00','2022-06-27 02:00:00','Denver Eagle, 5110 W Colfax Ave, Denver, CO 80204','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt','cl3p2e13o003s07771p1zc8va','ckomap3wv003s13b79xoq6fdt',0),('ckomdpbk2005tb4b7b36khby4','2021-05-13 04:15:30.242','2021-09-16 16:11:34.115','CAMPING','Annual Moab runs/camping trip','<p><a href=\"https://docs.google.com/spreadsheets/d/1ztUaVCErMykKoVgiMY1JFvPzkv8GfcXsGoZcbeMVYGY/edit\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>Sign up for runs</strong></a></p><p><strong>Difficulty</strong>: Easy to Difficult&nbsp;</p><p><strong>Details</strong>: Our annual Moab camping trip! Runs will be decided in advance closer to the event. We aim to have an easy and difficult run for each day. Cost for members is $35 and the cost for guests is $45. Please pay @4playersco at PayPal</p><p>Remember, this terrain is considered high desert, so please plan accordingly. Bring rain gear and plenty of water.</p><p><strong>Please plan on eating dinner with the club on Saturday. The club will provide food, just bring drinks, a chair, and your appetite. </strong>If you have any dietary restrictions, please email president@4-playersofcolorado.org&nbsp;</p><p>Remember that we usually have a lot of people to fit into the two campsites, each with varied camping setups. Please work with each other to make sure that we can comfortably fit in the sites, which may mean we need to be a little flexible with our arrangements and/or parking. For example, you may not be able to use your RV\'s side awning if the parking lot is full. If there are any issues, please talk to an officer.&nbsp;</p><p>If you arrive midday on Thursday and leave on Monday morning, there\'d be 7 meals to cook (not including Saturday dinner, which the club is providing). In the past, some of us have shared breakfast and dinner cooking duties - cook once or twice and you\'re done for the weekend. Groups won\'t be larger than 5 and we\'ll leave it up to the group to determine when people arrive/leave and when they want to cook. BYO lunch foods and drinks.&nbsp;</p><p><strong>Arrival Date</strong>: Thursday, Sept 23, 2021</p><p><strong>Departure Date</strong>: Monday, Sept 27, 2021</p>','2021-09-23 18:00:00','2021-09-27 18:00:00','Moab Big Bend Campsites A & B, 7 miles upriver of junction US191 and UT128 in Moab, UT 84532','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbju002qb4b7huse0028','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','MEETING','Christmas Party/Dec 2017 Monthly Meeting','The club\'s annual Christmas party is free for members.','2017-12-10 22:00:00','2017-12-11 00:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckphrggm600wu0702nv8pi15o','2021-06-04 03:21:22.973','2021-10-19 14:16:49.292','RUN','Ice Cave Road run','<p>Trails: <a href=\"https://www.trailsoffroad.com/trails/335-ice-cave-road\" rel=\"noopener noreferrer\" target=\"_blank\">Ice Cave Road</a></p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Ice Cave Road is another fun off-road trail that\'s close to Colorado Springs and easily accessible to those in Denver and other points along the front range. Comparable trails within the Rampart Range can provide a challenge to vehicles that are a little more than stock, but still offer fun routes for the more built rigs.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Ice Cave Road traverses the forest and ridges on the east side of Rampart Range Road. Ice Cave Road may be traveled in either direction. The road is one vehicle wide over much of its course, however there are frequent pull-outs and spurs to provide ample space to allow traffic to pass, if necessary.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Bring a lunch we will stop some where along the path for lunch/break.</span></p>','2021-10-31 16:00:00','2021-10-31 22:00:00','','EASY',NULL,'7-11 at 283 E Hwy 105, Monument, CO 80132',0,-1,10,'ckomap3wv003j13b7fdylcckg',NULL,'ckomap3wv003j13b7fdylcckg',NULL),('cl2jfhsyo00ln0704dpoxurpy','2022-04-28 19:58:12.959','2022-05-31 15:09:45.148','CLINIC','Offroad Driving Skills Clinic','<p>Private Driving Skills clinic with OnTrailTraining instructor</p><p><span style=\"color: rgb(34, 34, 34);\">Good footwear is a must, we will be walking on loose uneven terrain at times. Weather should be dry, but you never know. A camp chair for lunch isn’t a bad idea. Bring water, snacks, and lunch. </span></p><p>$100 due before attending.&nbsp;<a href=\"https://buy.stripe.com/fZe17DfXa1uk0ta3cd\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44);\">Click here to pay</a>&nbsp;and reserve your spot.</p><p>Non-refundable. Price is per person.</p><p>From the website: <span style=\"color: rgb(96, 94, 94);\">This class starts with understanding how different 4-wheel drive systems and suspension work as it is essential to getting the vehicle to perform off road. We take this knowledge into the field and utilize a variety of terrain to experience firsthand how to drive properly. You will leave this course with a solid understanding of what your vehicle can and can’t do and how to get the most out of it while avoiding mechanical damage</span></p>','2022-06-04 15:00:00','2022-06-05 00:00:00','Loaf \'N Jug, 173 Bulldogger Rd, Bailey, CO 80421','UNKNOWN',NULL,'',0,15,-1,'ckomap3wv003s13b79xoq6fdt','cl3uapoiz002c0787cyv0i8ak','ckomap3wv003s13b79xoq6fdt',0),('cksp45a76007l0743trhg5dsq','2021-08-23 20:50:06.689','2021-08-23 20:50:55.649','SOCIAL','Labor Day Party','<p>It\'s the end of summer! Come celebrate with the club, catch up with everyone while not on a trail. The club will provide the basics, like burgers/dogs, non-alcoholic drinks, etc. If you\'d like anything special to drink or eat, please bring it with you.</p>','2021-09-06 17:00:00','2021-09-06 22:00:00','5953 S Quintero Ct, Aurora CO, 80016','UNKNOWN',NULL,'',1,-1,-1,'ckomap3wv003j13b7fdylcckg','cksp46bzg008e0743k01r8ykc','ckomap3wv003s13b79xoq6fdt',NULL),('ckt62lzc600h60760wxjxirek','2021-09-04 17:39:11.517','2021-09-04 17:41:53.032','RUN','Pole Hill','<p>Rescheduled from earlier in the year. Details forthcoming</p>','2021-10-16 15:00:00','2021-10-16 22:00:00','','INTERMEDIATE',NULL,'U Pump It, 4065 Ute Hwy, Longmont, CO 80503',1,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckphrlu1v00z40702pbdogdbw','2021-06-04 03:25:33.666','2021-09-10 15:22:11.154','RUN','Old Fall River Road run','<p>This is very easy trail and takes you to the top of Trail Ridge Road to the Alpine visitor Center, and can proceed down to Grand Lake. Trail Ridge Road is the highest continuous paved road in the US and is only open memorial day to mid October.</p><p>Reservations open today and you must <a href=\"https://www.recreation.gov/?fbclid=IwAR1-9YZcvgFmfhC3QdQqAbz4FteS5xWGctqxpaaeAEcS-stA5d1S1rWNclI\" rel=\"noopener noreferrer\" target=\"_blank\">make a reservation online</a> at <span style=\"color: var(--blue-link);\">Recreation.gov</span> website, probably today, reservations go quickly. You will need to create an account and it will only allow one reservation per account per day. I tried to reserve additional, but no luck. You will need the “Rocky Mountain national Park timed entry”, “Park access excluding bear lake”. 9 AM to 11 AM. The cost is $2.00 for the reservation and then you’ll need to pay the park admission fee that day.</p><p>They also release additional reservations at 5 PM the day before. Or if you are in the park gate before 9 AM you don’t need a reservation.</p>','2021-09-11 15:30:00','2021-09-11 21:00:00','','EASY',NULL,'Safeway, 451 E Wonderview Ave, Estes Park, CO 80517',0,-1,8,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckqi9g8y100gk0746u4qj9o6o','2021-06-29 16:24:48.456','2021-09-14 15:56:16.958','RUN','Spring Creek','<p><span style=\"color: rgb(64, 64, 64);\">This off-road, rock crawling trail has become the \"go to spot\" for hard wheeling within a short drive from Denver. It sees very heavy traffic during the weekends, so don\'t expect to be on this trail alone. Traversing large boulders are the norm on Spring Creek. This trail is constantly changing as new boulders become exposed each year and old boulders find new resting spots.</span></p><p><br></p><p><br></p><p><span style=\"color: rgb(64, 64, 64);\">It starts out pretty quickly with the first obstacle named \"The Wall\". Without a proper line here, body damage and/or rollovers are likely. The trail climbs straight up the mountain providing spectacular views above I-70 and the surrounding mountain towns. The final switchback known as \"The Hard Left\" will challenge even the most modified vehicles, before you enter the premier obstacle of the trail, \"The Rock Garden\" which has many different routes and lines, all of which will leave your undercarriage riddled with rock-rash scars.</span></p>','2021-10-02 15:00:00','2021-10-02 22:00:00','','ADVANCED',NULL,'Safeway in Idaho Springs',0,-1,10,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',NULL),('cl27rncti016q0728pmlroxdn','2022-04-20 16:05:13.25','2022-05-31 23:26:14.594','CLINIC','Recovery Skills Clinic - Part 1','<p>Private Intro to Recovery clinic with OnTrailTraining instructor</p><p>This class will be held on Slaughterhouse Gulch Trail near Bailey from 9-5. Meet-up is 8:30am at the Loaf-n-Jug at 173 Bulldogger Rd, Bailey, CO 80421 (intersection of Hwy 285 and County Road 43A). Bring a lunch, non-alcoholic beverage, sunscreen, and comfortable chair. Dress for every kind of weather (it\'s Colorado, as you know).</p><p>$100 due before attending. <a href=\"https://buy.stripe.com/6oEaId3aoeh60ta6oo\" rel=\"noopener noreferrer\" target=\"_blank\">Click here to pay</a> and reserve your spot. <strong>The first 10 people to sign up get to bring their rigs</strong></p><p>Non-refundable. Price is per person</p><p>From the website: Providing a solid foundation and understanding of recovery equipment and techniques. Topics including scene assessment, recovery calculations, selecting gear, inspection, maintenance, and use of all types of equipment. This class breaks down recoveries in a methodical manner examining the how and why of safely recovering a stuck vehicle.</p>','2022-06-18 14:30:00','2022-06-18 23:00:00','Loaf-n-Jug, 173 Bulldogger Rd, Bailey, CO 80421','UNKNOWN',NULL,'',0,15,-1,'ckomap3wv003e13b736ojbvua','cl3usgfuz00as0706wjjbld7r','ckomap3wv003s13b79xoq6fdt',0),('cktn84ral00bb07706nrq6vck','2021-09-16 17:45:50.636','2021-09-16 18:16:03.022','RUN','Geneva Creek','<p>This is an easier intermediate trail, mostly because of the shelf road section and some light bumps along the way. Most stock 4x4s should be fine. Lots of mines to check out.</p><p>Bring a lunch, drinks, and a jacket - we’ll be above tree line for part of the trip.</p>','2021-10-03 14:00:00','2021-10-03 21:00:00','','INTERMEDIATE',NULL,'Behind the Circle K, 1501 Argentine St, Georgetown, CO 80444',0,-1,8,'ckomap3wx005913b7afaj12ct',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckphqqe4l00nq0702d8c2jykk','2021-06-04 03:01:06.687','2021-10-07 16:39:36.618','RUN','Cloverdale Mine run/camping','<p><span style=\"color: rgb(0, 0, 0);\">There are two lakes on this trip with dispersed camping space at both lakes. Road 198 (Lake Creek Road) ends at Cloverdale mine which was created in 1922 and is at 11,440ft. There are old mine camp buildings around to explore.</span></p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">Intermediate trail difficulty - mostly for larger size rocks requiring lifted suspension, or skid plates if stock height recommended. A few technical obstacles that can easily be helped with a spotter is needed.</span></p><p><span style=\"color: rgb(0, 0, 0);\">12:00PM 10/8 - 2:00PM 10/10</span></p><p><span style=\"color: rgb(0, 0, 0);\">Friday rally at 12:00PM at Canyon City Walmart (for those interested in Camping Friday) 38°26\'56\"N 105°11\'36\"W · </span><a href=\"https://earth.app.goo.gl/neLHWn\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0);\">Google Earth</a></p><p><span style=\"color: rgb(0, 0, 0);\">Saturday rally point at planned dispersed camp site 10:00AM 38°15\'50\"N 105°41\'26\"W · Balman Reservoir</span></p><p><span style=\"color: rgb(0, 0, 0);\">Jason plans to go on Friday to hopefully grab the desired dispersed camp area that has room for 8-10 rigs and tents. If the space is full, alternate options could be </span><a href=\"https://www.fs.usda.gov/wps/portal/fsinternet/cs/recarea?ss=110308&amp;navtype=BROWSEBYSUBJECT&amp;cid=FSE_003738&amp;navid=110240000000000&amp;pnavid=110000000000000&amp;position=generalinfo&amp;recid=12750&amp;ttype=recarea&amp;pname=Lake%20Creek%20Campground\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0);\">Lake Creek Campground</a><span style=\"color: rgb(0, 0, 0);\">.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Anyone wanting to join that can’t make it on Friday? Let Jason know. We can delay starting Saturday morning up the trail towards Rainbow Lake and the mine, to allow others to join at 10:00AM Saturday. After exploring there is the lake to relax around at camp or some could explore nearby.</span></p><p><span style=\"color: rgb(0, 0, 0);\">If there is interest on Sunday, Jason has another trail spot with short hike option in Seep Springs BLM land and then could head up Shelf Road into Cripple Creek.</span></p><p><span style=\"color: rgb(0, 0, 0);\">If anyone has a trailer or does not want to dispersed camp, there are various other campgrounds along Hwy 50 between Canyon City and the turnoff the Hwy 69 south. *Lake Creek Road is rocky going up past Lake Creek Campground to the dispersed camp spot.</span></p>','2021-10-08 18:00:00','2021-10-10 20:00:00','','INTERMEDIATE',NULL,'Canyon City Walmart, 3105 US-50, Cañon City, CO 81212',0,-1,8,'ckomap3ww005213b70kjhcoc4',NULL,'ckomap3ww005213b70kjhcoc4',NULL),('ckphq5hhe00h307020l99niid','2021-06-04 02:44:51.266','2021-06-04 02:45:08.306','RUN','Mosquito Pass run','<p><a href=\"https://www.trailsoffroad.com/trails/389-mosquito-pass\" rel=\"noopener noreferrer\" target=\"_blank\">Trail info</a></p><p><span style=\"color: rgb(0, 0, 0);\">Mosquito Pass (elevation 13,185\'), between Alma and Leadville, Colorado, is among the highest Colorado passes accessible to 4WD vehicles. The views from here are spectacular, especially in early autumn when the valley’s foliage begins to change color. The vibrant gold, amber, and green colors provide a stark contrast to the drab brown stone and paled grasses covering the high treeless ridges.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Mosquito Pass is a very rocky road. From east or west, the lower portions are mostly dirt and gravel. As you gain elevation, the rocks become larger (6\" to 8\" diameter). Several segments of the road are entirely covered in loose stones. At the highest elevations, there are numerous switchbacks, but all are sufficiently wide so as not to require three-point turns. At these locations, trail surface is exposed bedrock. Mosquito Pass also includes a few shelf road portions that preclude passing.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Bring a lunch. We will stop at the top for a break.</span></p>','2021-08-29 16:00:00','2021-08-29 23:00:00','','INTERMEDIATE',NULL,'Sinclair, 640 US Hwy 285, Fairplay, CO 80440',0,-1,8,'ckomap3wv003j13b7fdylcckg',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckvll1iix00260706pomv1ev2','2021-11-04 23:31:06.624','2021-12-11 23:01:34.876','MEETING','Holiday Party & December Meeting','<p>Come celebrate the end of our 35th year! On Sunday, 12/12 we\'ll be having our holiday party and December meeting in the Sky Lounge at Parq on Speer.</p><p>Following <a href=\"https://www.denvergov.org/Government/COVID-19-Information/Public-Health-Orders-Response/Public-Health-Orders\" rel=\"noopener noreferrer\" target=\"_blank\">Denver guidelines</a>, if you are unvaccinated we ask that you wear a mask.</p><p>Members are invited to bring partners/boyfriends/husbands/etc.</p><p>We\'ll have appetizers and non-alcoholic and alcoholic drinks - each attendee will receive 2 drink tickets and drinks will be available to purchase beyond that.</p><p>Valet parking is available on site and we\'ll have Lyft credits available to those that want to ride share. Please email <a href=\"mailto:president@4-playersofcolorado.org\" rel=\"noopener noreferrer\" target=\"_blank\">president@4-playersofcolorado.org</a> if you\'d like a Lyft credit.</p><p><strong>Please note: once you submit your RSVP, you will not be able to change it.</strong></p>','2021-12-12 20:00:00','2021-12-13 00:00:00','Parq on Speer, 909 Bannock St, Denver, CO 80204','UNKNOWN',NULL,'',1,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',1),('ckphqi6ps00kt070232ijcbd0','2021-06-04 02:54:43.839','2021-09-11 01:38:48.154','RUN','Rimrocker Trail overlanding','<p><span style=\"color: rgb(0, 0, 0);\">The Rimrocker Trail is a 160-ish mile overland route between Montrose, CO and Moab, UT that covers a wide variety of topography, vast scenery and mining history. All the details of the route including maps, GPS files and narrative guides are available </span><a href=\"https://rimrockertrail.org/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0);\">here</a><span style=\"color: rgb(0, 0, 0);\">. In late September the aspens should be near peak, making a beautiful fall journey. After we cross the Utah state line, we\'ll actually depart the Rimrocker and head up across La Sal Pass to avoid some very scrapy brush and mediocre scenery. The La Sal Mountains are those snow capped peaks you see on the horizon south of Moab.</span></p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">We\'ll take 3 days and 2 nights to run the route, starting Sunday in Montrose and arriving the Wednesday before our annual club gathering in Moab. The trail is intermediate difficulty and fully passable with a mid-size pickup truck. Small offroad trailers should be fine. Full size trucks are not recommended on day 3 but there\'s a way to backtrack and get to the highway if you want to join the group for 2 days and 2 nights of camping. Bring your food and water for 3 days, 2 nights. There is a gas opportunity on Day 1 outside the town of Nucla, but it\'s about 10 miles out of the way and it will slow the group down if we have to make a gas stop, so I recommend bringing a few gallons of spare gas for peace of mind.. Plan to be completely off grid for the entire trip; I\'ll have a Garmin InReach in case we have an emergency. Dress for cold nights and prepare for possible rain showers. Campfires will be subject to any fire restrictions in effect at the time. Days 1 &amp; 2 are expected to be about 6 hours of driving with stops along the way for lunch and stopping at points of interest. We\'ll break camp and depart around 9:00am and barring any unplanned delays, we\'ll aim to get into camp 2-3 hours before sundown each day.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Day 1, Montrose to Uravan (Easy, fastest day of driving): We will cover about half the length of the whole route this day, driving graded forest roads through pines and aspens from Montrose to Nucla across the Uncompahgre Plateau. We\'ll get on pavement for a few miles as we pass through Nucla, and we\'ll stop for lunch at a park in town. In the afternoon the trail will get more interesting as we hit red dirt and traverse BLM land, settling at a dispersed campsite overlooking the San Miguel River near the former uranium mining town of Uravan.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Day 2, Uravan to La Sal Pass (intermediate difficulty): We\'ll start the morning with a short drive down from the plateau to the highway and take a brief side trip on pavement &lt;5 miles to see some well-preserved artifacts of gold mining along the San Miguel river. We\'ll then get back on the trail and climb back up to drive along the north end of Paradox Valley. The trail goes from red rocks to forest again and we\'ll start to share the trail with some bovine friends. We\'ll find a lunch spot in the Manti-La Sal National Forest and then cross the Utah-Colorado state line. After a few miles we\'ll say goodbye to the Rimrocker Trail and head up into the mountains on La Sal Pass road, which is pretty well maintained forest road with some shallow water crossings. There\'s a great dispersed camping opportunity at the top of the pass at an alpine lake (space permitting, but shouldn\'t be busy on a Tuesday). Bring a fishing pole if you\'re so inclined; there are also hiking and mountain biking opportunities near the top of the pass.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Day 3, La Sal Pass to Moab (intermediate difficulty): As we head down from the pass the trail becomes clearly an unmaintained 4x4 trail. It gets steeper, and the trees close in to narrow the trail. there are some sections of shelf roads, switchbacks and a couple spots where you have to take your line more carefully due to boulders and ruts. We should arrive in Moab in time to grab lunch at a restaurant, wash our rigs down and resupply. We have secured Big Bend Campground site B for the night. Please pay Matt </span><span style=\"color: rgb(34, 34, 34);\">$12 to help pay for the reservation.</span></p><p><strong style=\"color: rgb(0, 0, 0);\">Unless you live near Montrose, plan to arrive Sunday and spend the night there before the trip</strong><span style=\"color: rgb(0, 0, 0);\">. There are hotels and campgrounds, including at Black Canyon of the Gunnison National Park just outside town. Some of us may want to meet up Sunday night before the run. Feel free to reach out to me at matt@mattbrucker.com if you have any other questions.</span></p>','2021-09-20 15:00:00','2021-09-22 18:00:00','','INTERMEDIATE',NULL,'',0,-1,10,'ckomap3wx005a13b7hz6qaa70',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl2s4gfnl00g80715bioq1nx6','2022-05-04 21:59:08.864','2022-06-03 02:25:13.207','RUN','Devil\'s Canyon','<p>Plan to get fuel, brings lunch/snacks, drinks and meet at rally point at 10:00AM where we can air down, close to the trailhead. There are several spurs that we might explore depending on trail growth and condition.</p><p><br></p><p><br></p><p><span style=\"color: rgb(64, 64, 64);\">Devil\'s Canyon off-road trail is one of the gems close to Denver, Colorado. The trail is relatively easy and gives you a great taste of what mountain terrain is like in that low 10,000-foot level ecosystem. You experience dense forests, mixed with pine and aspen, which are all intermittently separated by open grassy areas. This is a great four-wheel drive trail for anyone seeking an easier trail with mountain scenery, or merely a quick adventure.</span></p>','2022-07-09 16:00:00','2022-07-09 21:00:00','','INTERMEDIATE',NULL,'Ponder Point Picnic Area M9MR+6H Evergreen, Colorado',0,-1,10,'ckomap3ww005213b70kjhcoc4',NULL,'ckomap3ww005213b70kjhcoc4',0),('cl2jfk87j00nx0704hattidlq','2022-04-28 20:00:06.03','2022-08-18 17:27:26.105','CLINIC','Trail Fix clinic','<p>Private Trail Fix clinic with OnTrailTraining instructor</p><p>$100 due before attending.&nbsp;<a href=\"https://buy.stripe.com/aEUcQleT64Gw8ZGaEG\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44);\">Click here to pay</a>&nbsp;and reserve your spot.</p><p>Non-refundable. Price is per person.</p><p><span style=\"color: rgb(49, 49, 49);\">We will meet 9am at the Loaf n Jug in Bailey</span></p><p><span style=\"color: rgb(49, 49, 49);\">From there we will head to Slaughterhouse gulch and find a spot to set up for the day. </span><strong style=\"color: rgb(49, 49, 49);\">Don’t wear nice clothes, we will get dirty.</strong><span style=\"color: rgb(49, 49, 49);\"> Lots of JB Weld and grease throughout the day. I will have plenty of nitrile gloves and GoJo but you might get some on your clothes. Old T-shirts and heavy pants, we will be on the ground a fair bit. I’ll have some tarps and blankets to help. We might see some rain so I’ll bring a pop up.&nbsp;</span><strong style=\"color: rgb(49, 49, 49);\">Bring work gloves and eye protection.</strong></p><p><span style=\"color: rgb(49, 49, 49);\">I’ve got a good assortment of old parts for us to play with. This will be very much adult arts and crafts.&nbsp;</span></p><ul><li><span style=\"color: rgb(49, 49, 49);\">Tire repair&nbsp;</span></li><li><span style=\"color: rgb(49, 49, 49);\">Plugs</span></li><li><span style=\"color: rgb(49, 49, 49);\">Sidewall damage&nbsp;</span></li><li><span style=\"color: rgb(49, 49, 49);\">Debead&nbsp;</span></li><li><span style=\"color: rgb(49, 49, 49);\">Valve stem</span></li><li><span style=\"color: rgb(49, 49, 49);\">Drive shaft</span></li><li><span style=\"color: rgb(49, 49, 49);\">Radiator&nbsp;</span></li><li><span style=\"color: rgb(49, 49, 49);\">Steering&nbsp;</span></li><li><span style=\"color: rgb(49, 49, 49);\">Electrical</span></li><li><span style=\"color: rgb(49, 49, 49);\">Broken axle limp out</span></li><li><span style=\"color: rgb(49, 49, 49);\">And a bunch more&nbsp;</span></li></ul><p><span style=\"color: rgb(49, 49, 49);\">We can talk about and vehicle specific weak spots and kits to bring along. Should be a fun day with lots to cover.&nbsp;</span></p><p>From the website:&nbsp;<span style=\"color: rgb(96, 94, 94);\">Let’s face it, things break sometimes. We cover how to get yourself back up and running on trail when things go south. With hands on opportunity to fix broken hoses, punctured radiators and oil pans, hydro locked engine, snapped axle, de beaded tire, if you can break it we can teach you how to fix it or tow it out safely. Useful tools and parts to bring along will also be covered.</span></p>','2022-08-21 15:00:00','2022-08-21 23:00:00','Loaf ‘N Jug, 173 Bulldogger Rd, Bailey, CO 80421','UNKNOWN',NULL,'',0,15,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckomdpbju002kb4b7am9k16e9','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','MEETING','JUN 2017 Monthly Meeting','','2017-06-13 01:00:00','2017-06-13 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbju002nb4b76y6l8m2m','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','MEETING','SEP 2017 Monthly Meeting','','2017-09-12 01:00:00','2017-09-12 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('clcl4pdi3009w0762eotaf6t5','2023-01-06 23:08:46.105','2023-02-21 18:03:58.31','SOCIAL','Snowmobile Action Tour','<p><span style=\"color: var(--primary-text);\">It\'s time again for a snowmobile tour day in the high country. This will be the 2-hour Mountain Top Action Tour just north of Leadville. There is a lot of information on the website to review details. If you have any questions, after reviewing the website, contact Jason Dean.</span></p><p><span style=\"color: var(--primary-text);\">When: 02/25/23, arrive at 11:30 for check in</span></p><p><span style=\"color: var(--primary-text);\">Where: High Country Tours - Birdseye Outpost</span></p><p><a href=\"https://mysnowmobiletour.com/our-snowmobile.../action-tour/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--blue-link);\">https://mysnowmobiletour.com/our-snowmobile.../action-tour/</a></p><p><span style=\"color: var(--primary-text);\">How to reserve your snowmobile spot:</span></p><p><span style=\"color: var(--primary-text);\">Call&nbsp;970-668-9945&nbsp;and mention the group name is under 4-Players of Colorado for the 12:00pm 2/25 Mountain Top Action Tour at Birdseye Outpost. If they can\'t find the club name, ask them to look up Jason Dean\'s reservation and they\'ll see the note. You will need to pay for your reservation when calling. They have a no-show &gt;24 hour cancellation refund option for $10 that can be added.</span></p><p><strong style=\"color: var(--primary-text);\">PLEASE NOTE: Book your reservation with High Country Tours ASAP to make sure there is room for you, as I am not able to hold a certain number of spots.</strong></p>','2023-02-25 18:30:00','2023-02-25 21:30:00','5598 CO-91 Leadville, CO 80461','UNKNOWN',NULL,'',1,15,-1,'ckomap3ww005213b70kjhcoc4','clcl4s2vu00au0762isk7v24q','ckomap3ww005213b70kjhcoc4',0),('ckomdpbju002fb4b74w7s0f2e','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','CAMPING','Rendezvous','Wyoming Pride Campout\n\nRun Leader: [ESPRESSO_STAFF]','2017-08-16 13:00:00','2017-08-20 17:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl3yo90if00hy078642e6rjeu','2022-06-03 16:39:34.358','2022-06-03 17:12:46.967','RUN','Chinaman Gulch','<p><strong>Description: </strong>Chinaman Gulch is a very popular, difficult rock crawling trail best suited for modified vehicles. Minimal snow to the area makes it an ideal location for winter wheeling. There are many obstacles and rocks to play on along this 4wd trail, many of which provide multiple lines from easy to hard. Although not very scenic, the occasional views of the Collegiate Peaks are astonishing. This trail is a great trail for groups as the main obstacles provide enough room for vehicles to pull out of the way and watch other vehicles attempt the obstacle.</p><p>One review of the trail:&nbsp;\"Terrific trail, fairly unrelenting.\"&nbsp;&nbsp;</p><p><strong>My take</strong>:&nbsp;I think that sums it up well!&nbsp;Rated 6-8, the increasingly challenging gatekeeper, the whale\'s tail, and the chute towards the end will challenge most drivers and their vehicles.&nbsp;The rest of the trail has a range of options at each obstacle and many have bypasses.&nbsp;You\'ll spend some time in a sand wash, on rocks, on granite scrambles and on 6-7 cool obstacles.&nbsp;This is a true crawler trail--feel free to reach out to me with any questions or concerns.</p><p><strong>Vehicle req\'s:</strong></p><ul><li>Lifted on 35s (depending on your vehicle/lift, you\'ll be challenged with smaller tires)</li><li>Front and rear lockers (I took a rear locker only vehicle through earlier in the year and he struggled on some obstacles--see me if you\'re only locked in the rear)</li><li>Winch/recovery gear (at least bumpers that can handle D rings/soft shackles)&nbsp;;-)</li></ul><p><br></p><p>We\'ll stop for lunch on the trail … It can be hot/sunny, so sunscreen, hats, etc. are good ideas.</p><p><strong>Rally Location: </strong></p><p>Conoco - Gunsmoke Travel Plaza, U.S. 24, Buena Vista, CO</p><p><a href=\"https://goo.gl/maps/4fZBVphKqwh4mMqP8\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://goo.gl/maps/4fZBVphKqwh4mMqP8</a></p>','2022-06-17 17:00:00','2022-06-17 22:00:00','','ADVANCED',NULL,'Conoco - Gunsmoke Travel Plaza- 12916 US-24, Buena Vista, CO 81211',0,-1,5,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckphoncfg00d70702jrfc05g9','2021-06-04 02:02:45.291','2021-06-04 03:29:40.522','CAMPING','Crested Butte camping/runs','<p><span style=\"color: rgb(0, 0, 0);\">Trails that will be traveled</span></p><ul><li><span style=\"color: rgb(0, 0, 0);\">Schofield Pass (4-4 Moderate)</span></li><li><span style=\"color: rgb(0, 0, 0);\">Crystal City Trail (3-4 Moderate)</span></li><li><span style=\"color: rgb(0, 0, 0);\">Lead King Basin (3-3 Moderate)</span></li><li><span style=\"color: rgb(0, 0, 0);\">Paradise Divide (3-3 Moderate)</span></li><li><span style=\"color: rgb(0, 0, 0);\">Daisy Pass Road (3-3 Moderate)</span></li><li><span style=\"color: rgb(0, 0, 0);\">Pearl Pass (5-6 Difficult)</span></li><li><span style=\"color: rgb(0, 0, 0);\">Montezuma Basin (4-6 Moderate with Optional Difficult Obstacles)</span></li><li><span style=\"color: rgb(0, 0, 0);\">Taylor Pass (5-6 Difficult)</span></li></ul><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">There are great hiking trails around too.</span></p><p><span style=\"color: rgb(0, 0, 0);\">There is a hiking trail from camp to Daisy Pass Road</span></p><p><span style=\"color: rgb(0, 0, 0);\">Campsite is Oh Be Joyful campground. Check Recreation.gov for when you can reserve. Current date is May 13. Campsites 20, 22, 21, 23, in respective order, are the ones we are hoping to get. 2-3 tents per campsite. </span></p><p><span style=\"color: rgb(0, 0, 0);\">$10/night. Pay Steve.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Attractions:</span></p><ul><li><span style=\"color: rgb(0, 0, 0);\">Crystal Mill</span></li><li><span style=\"color: rgb(0, 0, 0);\">Historic Town of Crystal</span></li><li><span style=\"color: rgb(0, 0, 0);\">Slow Groovin BBQ Marble,CO</span></li><li><span style=\"color: rgb(0, 0, 0);\">Lunch in Aspen, CO</span></li><li><span style=\"color: rgb(0, 0, 0);\">Dinner in Crested Butte</span></li></ul>','2021-08-23 16:00:00','2021-08-28 18:00:00','','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('clafwy46w001c07754g5xcs7w','2022-11-13 22:13:21.393','2023-01-06 18:50:16.607','MEETING','2023 Run Planning','<p>Let\'s plan our 2023 season!</p><p>We\'re going to meet at Craig &amp; Joe\'s house. Anyone is welcome to attend, especially if you <strong>are a run leader or are planning to lead runs in 2023</strong>. We\'ll have a poll go out to survey attendee preferences for those that can’t make it and we’ll see what we can do.</p>','2023-01-22 22:00:00','2023-01-23 00:00:00','1640 Harrison Street, Denver CO 80206','UNKNOWN',NULL,'',1,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl99anfk2001q0744t2g4qsfw','2022-10-15 02:22:52.031','2022-10-15 17:10:38.792','RUN','Slaughterhouse Gulch','<p>This is mostly a beginner trail with some intermediate obstacles. Dress appropriately, bring water, bring a lunch</p><p>Read more here:&nbsp;<a href=\"https://www.trailsoffroad.com/trails/463-slaughterhouse-gulch\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44);\">Slaughterhouse Gulch info</a>&nbsp;Difficulty: Moderate</p>','2022-10-16 15:30:00','2022-10-16 21:00:00','','INTERMEDIATE',NULL,'Load N Jug, 173 Bulldogger Rd, Bailey, CO 80421',0,-1,10,'ckomap3wu002x13b74lnt19lb',NULL,'ckomap3wv003s13b79xoq6fdt',0),('claik0vom002o0764saopqarc','2022-11-15 18:34:53.919','2022-11-15 23:46:44.073','RUN','Pole Hill Winter Run','<p>Let\'s get one more trail in before the snows and USDA wrap the season for us!</p><p><br></p><p><br></p><p>The plan for today is a trail that\'s accessible for stock/overland vehicles and crawlers--the trail is mostly smooth forest road with a bump here and there, some time in the trees, and some really epic views.&nbsp;For those who like to push it, there are some rock obstacles and tougher lines (TOTALLY OPTIONAL).&nbsp;</p><p>I haven\'t been up since the recent snows, so we could have some snowpack and that shouldn\'t make this trail any less doable.&nbsp;And the goal is to have fun, community, and hit the trail before season end.&nbsp;We\'ll take it really easy today and just cruise!</p><p><strong>Considerations:</strong></p><ul><li>There may (will likely) be snow on parts or most of the trail.&nbsp;Consider if you like driving in snow.</li><li>Are your tires good in snow?&nbsp;(See above)&nbsp;;-)</li><li>Do you have recovery attach points, in case you slide and we need to tug you in the snow?&nbsp;(See above)&nbsp;;-)</li><li>Dress warmly!&nbsp;(Though Sunday is supposed to warm up from recent temps)</li><li>Contact me directly with vehicle/trail questions ...</li></ul><p><br></p><p><br></p><p><br></p><p><strong>Bring:</strong></p><ul><li>Lunch, water, snacks</li><li>Tow strap, tree strap, soft shackles--if you have!&nbsp;(yes, I have all of these too)</li></ul><p><br></p><p><br></p><p><br></p><p><strong>We\'ll rally at the U-Pump-It Gas station in Lyons Colorado.&nbsp;Meet at 9:30 for a 9:45 departure to trailhead (30 min from Lyons.) - </strong><a href=\"https://goo.gl/maps/4LeTftMyqJ1m4Q868\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>Google Maps</strong></a></p><p>We\'ll return to Lyons after trail and optional beer at Oskar Blues or marg at La Mariposa!</p><p><strong>Pole Hill</strong></p><ul><li>1.5 hrs</li><li>Rated 3, Stock SUV with High Clearance and 4Low</li><li>Optional obstacles up to 5</li><li>This is an easy gravel road with a really easy side and a rockier side--notice that in the trail pic, so it\'s your choice the whole way (Subaru\'s and sedans/coupes do dispersed camping on this road)&nbsp;&nbsp;<a href=\"https://www.trailsoffroad.com/trails/422-pole-hill\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/422-pole-hill</a></li></ul><p><br></p><p><br></p><p><br></p><p><strong>Panorama Peak Loop</strong></p><ul><li>45 min</li><li>Rated 3, Stock SUV with High Clearance and 4Low</li><li>No optional higher rated obstacles</li><li>We\'ll also do the Panorama Peak Loop off the end of the trail with some great views and a nice drive through the trees.&nbsp;&nbsp;<a href=\"https://www.trailsoffroad.com/trails/2042-panorama-peak\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/2042-panorama-peak</a></li></ul><p><br></p><p><br></p><p><br></p><p><strong>Solitude Creek Loop</strong></p><ul><li>45 min</li><li>Rated 3, Stock SUV with High Clearance and 4Low</li><li>We\'ll do the Solitude Creek loop as well, depending on the snow pack.&nbsp;(This one is a bit narrower and there\'s a couple of spots that could be slick in the snow.&nbsp;This loop is totally optional as it meets right back with the main trail.&nbsp;It does offer epic views into RMNP and Estes, so cross your fingers for not TOO much snow.)&nbsp;&nbsp;<a href=\"https://www.trailsoffroad.com/trails/2043-solitude-creek\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/2043-solitude-creek</a></li></ul>','2022-11-19 16:30:00','2022-11-19 22:00:00','','INTERMEDIATE',NULL,'U Pump It - 4065 Ute Hwy, Longmont, CO 80503',0,-1,10,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckphpyig300ed0702pol8ciaa','2021-06-04 02:39:25.919','2021-06-04 03:23:52.543','RUN','Slaughterhouse Gulch night run','<p><span style=\"color: rgb(0, 0, 0);\">Get your light bars and rock lights installed and let\'s see how they work. This is an easy trails, with a couple of challenges that have by-passes to keep them easy.</span></p><p><span style=\"color: rgb(0, 0, 0);\">This is a great trail if you\'re looking for a lot of flex. The \"whoopdeedoos\" (dirt moguls that twist your suspension) found through the entire trail are challenging to a stock vehicle, especially if you have a sway bar that is not disconnected.</span></p><p><span style=\"color: rgb(0, 0, 0);\">It forms a big loop with the far end of the loop about 1,000 feet lower in elevation. That means you must go down a large hill, then back up to the top on the other side. The two hills are not very similar.</span></p><p><span style=\"color: rgb(0, 0, 0);\">When you first start the trail (near a sign for Forest Road 101) it is a mellow dirt road with some dips in it, with a gate near the trailhead that is most often open. Hunting is no longer allowed in this area. There is a clearing along the way on both the left and the right of the trail, and just before this clearing is a rock in the right side of the trail called Poser Rock. It\'s a great rock for testing your suspension, but be careful -- your rear tire on the passenger side gets off the ground very suddenly and it would be very easy to flop your vehicle on its side.</span></p><p><span style=\"color: rgb(0, 0, 0);\">A little further down the trail and you move into the trees. Please note that you can no longer take the shortcut up the hill on the former obstacle called Stump Hill, even if you see tracks made illegally by people before you. You must stay on the regular trail, so follow the sign to 101, then follow the Slaughterhouse sign (Forest Road 105) at the \"Y\" in the road. You\'ll climb a little, then start the decent to the far end of the loop. This downhill section is fairly steep and long, though not technical. It can be dangerous when icy, and you could get into trouble here in the wintertime.</span></p><p><span style=\"color: rgb(0, 0, 0);\">You stay at the bottom very briefly, enjoying rocky sections that can challenge stock vehicles. In the early season there is usually a muddy section at the bottom that cannot be avoided. If you see a \"trail\" going around this mud, do not use it. It is illegally made, and if you use it you will be off of the trail. The mud is usually completely dry by June and it usually remains dry for the rest of the year.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Soon you find yourself at a large hill with big whoopdeedoos. You\'ll climb up a bunch of these, twisting your suspension every few feet.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Once you get to the \"T\" in the road you\'ll see a sign pointing to Slaughterhouse, back the way you came. If you go left here you\'ll complete the loop and find yourself back at the start. If you go right at the \"T\" you follow the Crow Creek trail (also known as Crooked Top).</span></p>','2021-06-18 00:30:00','2021-06-18 05:00:00','','INTERMEDIATE',NULL,'Loaf N Jug, 173 Bulldogger Rd, Bailey, CO 80421',0,-1,8,'ckomap3ww005713b7f3juf7u0',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbju002mb4b7glfb72om','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','MEETING','AUG 2017 Monthly Meeting','','2017-08-15 01:00:00','2017-08-15 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbju002ob4b7hicr15og','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','MEETING','OCT 2017 Monthly Meeting','','2017-10-10 01:00:00','2017-10-10 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl2drm4wk00bx07430slm7tgv','2022-04-24 20:50:53.392','2022-12-04 04:14:02.127','MEETING','December Membership Meeting','<p>Holiday Party Time! </p><p><br></p><p><br></p><p>This year we\'re going to have our December Meeting at the <a href=\"https://www.google.com/maps/@39.7540578,-104.9934217,3a,82.2y,353.38h,96.88t/data=!3m7!1e1!3m5!1sAF1QipMP4K7occTXqdB3ENEahBAYVBI-3OUw_Q54U2VN!2e10!3e12!7i13312!8i6656\" rel=\"noopener noreferrer\" target=\"_blank\">indoor rooftop bar</a> of the ViewHouse Ballpark location.</p><p>Similar to last year, this is going to be more of a cocktail party-style event rather than a sit-down dinner. 2 drinks per person and lots of appetizers</p>','2022-12-04 23:00:00','2022-12-05 02:00:00','ViewHouse Ballpark, 2015 Market St, Denver, CO 80205','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',1),('ckydfq8uz002f07358nusxrps','2022-01-13 20:39:20.403','2022-01-13 20:40:37.615','SOCIAL','Snowmobiling - High Country Tours Birdseye Outpost','<p class=\"ql-align-center\">Join us near Leadville for some fun in the snow!</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\">Make sure to RSVP the you are going AFTER you have called High Country Tours, (970) 668-9945, and made your reservation. The group tour is listed under 4-Players of Colorado from 12:00-2:00PM.</p><p class=\"ql-align-center\"><a href=\"https://mysnowmobiletour.com/our-snowmobile-tours/mountain-top-action-tour/\" rel=\"noopener noreferrer\" target=\"_blank\">https://mysnowmobiletour.com/our-snowmobile-tours/mountain-top-action-tour/</a></p><p class=\"ql-align-center\">Plan to arrive at least 30 minutes before the tour begins at 12:00PM. Once your reservation is made, you will receive an email from High Country Tours with all the necessary information. Please bring cash to tip our guide(s) appropriately.</p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\">This guided tour is approximately 2 hours.</p><p class=\"ql-align-center\">You’ll start out at over 10,000 feet of altitude from our Birdseye Outpost, which is located about 16 miles South of Copper Mountain Resort.&nbsp;</p><p class=\"ql-align-center\">Your guide will then train you on the operation of your snowmobile before your party starts up Prospect Mountain (up to 12,600 feet!) to attack the trails and take in the majestic scenery.&nbsp;</p><p class=\"ql-align-center\">If the weather cooperates, you’ll be afforded views of Leadville’s Historic Mining District, the Continental Divide, three of the tallest mountains in the Rockies and much more!</p><p>MORE INFO</p><p class=\"ql-align-center\">Due to the more technical riding skills required on this guided Colorado snowmobile tour, usually only single riders are allowed. However, we will sometimes allow experienced drivers to take a passenger. Please keep in mind that this is decided on a case-by-case basis, so call us for more information if you’re interested in this option.</p>','2022-03-05 18:30:00','2022-03-05 21:00:00','5598 CO-91,Leadville,CO,80461,US','UNKNOWN',NULL,'',1,24,-1,'ckomap3ww005213b70kjhcoc4','ckydfrwfx003707355f8e2ebm','ckomap3ww005213b70kjhcoc4',0),('cl2s4bg5i00ff0715spw0n2fk','2022-05-04 21:55:16.23','2022-06-19 00:23:31.448','RUN','**CANCELLED** Boulder County Road 68J','<p>**NOTE** Due to emergency reservoir closure, we’re going to postpone this run until a future date, TBD. Sorry for the inconvenience.</p><p><br></p><p><br></p><p><br></p><p>A community run is specifically for guests and new members to the club within the last year.</p><p>Bring a lunch, snacks, drinks, and sunscreen. Please arrive ready to go. Plan to rally at 9:45am and depart for the trailhead at 10am sharp. Get fuel and food, visit the restroom in advance.</p><p>If there\'s time, we can take the Winiger Ridge spur trail.</p>','2022-06-19 15:45:00','2022-06-19 21:00:00','','INTERMEDIATE',NULL,'King Soopers, 1650 30th St, Boulder, CO 80301',0,1,1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckomdpbjt002cb4b7bci34otd','2021-05-13 04:15:30.233','2021-05-13 04:15:30.233','FUNDRAISING','Beer Bust Fundraiser','Beer Bust at the Wrangler - CLUB FUNDRAISER','2017-05-07 09:30:00','2017-05-08 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbju002eb4b77dvt4tl8','2021-05-13 04:15:30.234','2021-05-13 04:15:30.234','SOCIAL','Denver Pride Parade','<p>Pride Parade - Cheesman Park 7:00a</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>\n','2017-06-18 13:00:00','2017-06-18 17:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,9,'ckomap3wv003q13b757fjdwgt',NULL,'ckomap3wv003s13b79xoq6fd