'N Jug gas stations, 173 Bulldogger Rd, Bailey, CO 80421',0,NULL,20,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003sb4b792sqh2mb','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','FUNDRAISING','Trade Beer Bust','Trade Beer Bust!!','2018-09-16 21:00:00','2018-09-17 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL);
INSERT INTO `event` (`id`,`created_at`,`updated_at`,`type`,`title`,`description`,`start_time`,`end_time`,`address`,`trail_difficulty`,`trail_notes`,`rally_address`,`members_only`,`max_attendees`,`max_rigs`,`host`,`featured_image`,`creator`,`change_disabled`) VALUES ('ckomdpbjy003zb4b72huza20t','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','FUNDRAISING','Trade Beer Bust','Our first Trade Beer Bust for 2019!!\n\nSaturday, 26 January 2019\n\nTime: 2:45 for meeting before, Bust starts at 3 and runs until 7','2019-01-26 21:45:00','2019-01-27 02:00:00',NULL,'UNKNOWN',NULL,'Trade',0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0046b4b73ops6f5r','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Pierson Park and Johnny Park trail run','[caption id=\"attachment_854\" align=\"aligncenter\" width=\"1024\"]<img class=\"wp-image-854 size-large\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/7793A366-7ED4-435A-86EA-C2E1BAEAAFA2-1024x471.jpeg\" alt=\"\" width=\"1024\" height=\"471\" /> Pierson Park Road[/caption]\n\n[caption id=\"attachment_875\" align=\"aligncenter\" width=\"1697\"]<img class=\"size-full wp-image-875\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/3B1E0701-B9B9-42DE-93AA-869F2CEA5621.jpeg\" alt=\"\" width=\"1697\" height=\"858\" /> Johnny Park Road[/caption]\n\n********UPDATED JUNE 30th********\n\nDescription: This is a 1 day out and back trail run.\n<ul>\n 	<li>Note from Dave:There\'s no cellular signal at the meet up spot, but the visitors center (The Old Gallery) on the opposite side of the fire station has free wifi, as well as indoor and outdoor restrooms.</li>\n 	<li>Pierson Park Trail was bisected by the flooding that struck the region in September 2013 and is now permanently closed to through traffic. We will run the south end from Cabin Creek to the flood site and stop to observe the wrath of nature. We will backtrack to the start of Johnny Park Trail and run Johnny Park to Larimer CR 47/Big Elk Meadows Rd. We\'ll take a break along the JP trail and allow time for lunch if you packed one. The run will take about 3 hours. The route back to civilization is down mostly-paved CR 47 to US 36 -- hang a right on 36 and it\'s 15 minutes to Lyons; a left and it\'s 15 minutes to Estes Park.</li>\n 	<li>Anyone with the time and inclination to spend the afternoon at my place in Big Elk Meadows is welcome to hang out. It\'s just a few minutes away from the end of our run, Text me in advance (720-695-9341) and I be sure to have sufficient provisions for the afternoon including some BBQ. There\'s a community pool -- if you want to jump in, bring a suit. The weather forecast currently indicates a cool day with afternoon thundershowers, but who knows</li>\n</ul>\nRun Leader: Dave Martin\n\nContact Info: 720-695-9341\n\nInformation for <a href=\"https://funtreks.com/off-road-trails/pierson-park-road/\"><em><strong>Pierson Park Road</strong></em></a>\n\nMore information for <strong><a href=\"https://www.trailsoffroad.com/trails/421-pierson-park-road\"><em>Pierson Park Road</em></a></strong>\n<ul>\n 	<li>Information for <em><strong><a href=\"https://www.trailsoffroad.com/trails/345-johnny-park-road\">Johnny Park Road</a></strong></em></li>\n 	<li>More Information for <a href=\"https://funtreks.com/off-road-trails/johnny-park-road/\"><em><strong>Johnny Park Road</strong></em></a></li>\n</ul>\nTrail Rating is: Moderate\n<ul>\n 	<li>Rally Point: <strong>Dirt lot west of</strong><em><strong> <a href=\"https://goo.gl/maps/3urFfeorAh8eNN2C6\">Allenspark Fire Department</a></strong></em></li>\n 	<li>Rally Time: 10:00 AM</li>\n</ul>','2019-07-06 16:00:00','2019-07-06 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv004713b7dbed3dqi',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004rb4b725rq93tv','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','FUNDRAISING','4-Players fundraising Beer Bust #5.5','<img class=\"alignleft size-thumbnail wp-image-570\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2017/04/4PC_ORIG_HiRes_JPEG-150x150.jpg\" alt=\"\" width=\"150\" height=\"150\" />\n\nThis beer bust will be held at Denver Sweet','2019-10-27 21:15:00','2019-10-28 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,25,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004fb4b7apqt7kmx','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','CAMPING','Crystal Mill trail run & camping','[caption id=\"attachment_867\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-867\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/F0D3F3C8-9E49-46FC-A75A-09489355FF33-1024x719.jpeg\" alt=\"\" width=\"1024\" height=\"719\" /> Crystal Mill[/caption]\n\n********UPDATED AUG 26th********\n\nDescription: This is a 6 night campout and trail run hosted by Stephen Totta.\n<ul>\n 	<li>The conditions of these trails have improved since last year. All trails are easy to moderate.</li>\n 	<li>The campsite will be determined when I get there Wednesday.</li>\n 	<li>I plan on heading to Crested Butte Wednesday morning. If anyone would like to caravan, please text me and we can coordinate.</li>\n 	<li>Created Butte will be the closest town to the campsite. This campsite will be primitive and relatively remote and on Schofield Pass. But hopefully not farther than 20 miles from town.</li>\n 	<li>I will update rally point with campsite location Wednesday evening.</li>\n 	<li>If you are coming later than Thursday, please text me when you will arrive.</li>\n</ul>\nRun Leader: Stephen Totta\n\nContact Info: 816-679-9882\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/272-crystal-city\"><em><strong>Crystal City</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/devils-punchbowl/\"><em><strong>Crystal City</strong></em></a>\n<ul>\n 	<li>Trail Rating is: Easy</li>\n</ul>\nInformation for <a href=\"https://www.trailsoffroad.com/trails/353-lead-king-basin\"><em><strong>Lead King Basin</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/lead-king-basin/\"><em><strong>Lead King Basin</strong></em></a>\n<ul>\n 	<li>Trail Rating is: Moderate</li>\n</ul>\nInformation for <a href=\"https://www.trailsoffroad.com/trails/1914-schofield-pass\"><em><strong>Schofield Pass</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/poverty-gulch/\"><em><strong>Schofield Pass</strong></em></a>\n<ul>\n 	<li>Trail Rating is: Moderate</li>\n</ul>\ninformation for <a href=\"https://www.trailsoffroad.com/trails/406-paradise-divide\"><em><strong>Paradise Divide</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/paradise-divide/\"><em><strong>Paradise Divide</strong></em></a>\n\nTrail Rating is: Easy\n<ul>\n 	<li>Information for camping: campsite will be located somewhere along Schofield Pass from the Crested Butte side and east of Devil’s Punch bowl. This will be a primitive campsite. My goal is to find shade, water and enough space for all.</li>\n</ul>\nRally Point: Oh Be Joyful Recreation Area campsite’s 20 and 22.  When coming into Crested Butte stay on CO 135 thru town. You will turn slight left on to Gunnison County 734.  Go approximately 4 miles to the entrance to Oh Be Joyful Recreation Area.  Take first right after the two toilets. Follow the slate gravel road around to the right. Campsite 20 will be on the left and a little and a 2 car parallel spot on the right.\n<ul>\n 	<li>Rally Time: 9:00 AM Thursday Aug 29th</li>\n</ul>','2019-08-28 23:00:00','2019-09-04 00:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004pb4b7eghrfos8','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','SOCIAL','Colorado Springs Pride Parade... We\'re in it. Really!','<img class=\"aligncenter size-full wp-image-904\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/07/Pridfest-Colorado-Springs.jpg\" alt=\"\" width=\"5000\" height=\"2333\" />\n\nDescription:  Come join the 4-Players as they sashay their rigs in the Colorado Springs Pride Parade\n\nRun Leader: Jason Heaton\n<ul>\n 	<li>Note From Jason: We\'re allowed 6 rigs. Unfortunately, all rig spots in the parade are filled.  You are more than welcome to meet up and ride along in the parade.</li>\n</ul>\nContact Info: 303-552-4382\n\nRally Point: <a href=\"https://goo.gl/maps/MctsU3RypNye2eqJ9\"><em><strong>Phillips 66 in Monument</strong></em></a>\n\nRally Time: 8:00 AM','2019-07-14 14:00:00','2019-07-14 19:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,6,'ckomap3wv003r13b7cgfx19pg',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk0004zb4b7egczhv2c','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','Geneva Creek run','<img class=\"aligncenter size-large wp-image-1022\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/06/genevacreek-1024x576.jpg\" alt=\"\" width=\"1024\" height=\"576\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/299-upper-geneva-geneva-creek\" target=\"_blank\" rel=\"noopener\">Geneva Creek info</a>\nDetails: Doug will be leading a run up Geneva Creek on Saturday June 27th.  This is rated as an Easy to Moderate trail.\n<p style=\"font-weight: 400;\">We will be meeting at the Safeway in Idaho Springs at 9:00 am.</p>\n<p style=\"font-weight: 400;\">For those that are interested, Doug plans on doing a short ½ mile hike to see the Iron Fens, a natural phenomenon that only occurs in Coloradao.</p>\n<p style=\"font-weight: 400;\">The trail ends at the remains of the Old Geneva City 11,600 ft.   If open, there is a short off-chute that will take you up to the remains of the Old Sill mine at 12,200 ft.  Provides great views but is more of a challenge, steep hill with lots of loose rocks.</p>\n<p style=\"font-weight: 400;\">Please register by 7:00 PM on Friday June 26th so Doug has an accurate count. Bring a lunch and plenty of water, as we\'re going above treeline.</p>\n<strong>Difficulty</strong>: Easy\nRally Time: 9am\nRally Location: Safeway, Idaho Springs, CO\nRun Leader: Doug T.\n\n* Camping Opportunity','2020-06-27 09:00:00','2020-06-27 16:00:00',NULL,'EASY',NULL,'Safeway, Idaho Springs, CO',0,NULL,15,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjv002zb4b708ofa711','2021-05-13 04:15:30.235','2021-05-13 04:15:30.235','CAMPING','John Martin Reservoir','<p>Details: Camping at John Martin Reservoir campground with the YAG RV group and running a local trail if available.<br />\nUnlikely to accommodate RV reservations, but tent camping is open along side the RVs.<br />\n[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]</p>\n<p>Trail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]</p>\n<p>Rally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]</p>\n<p>Rally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>','2017-05-26 13:00:00','2017-05-30 23:00:00',NULL,'UNKNOWN',NULL,'John Martin Reservoir',0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx0037b4b7941p2q48','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Switzerland Trail run','Weather/conditions permitting.\n\nDirt road. Dry, or less than 3\" water crossing depth. Some ruts. Slight grades, up to 10 degrees. 2WD under most conditions. Rain or snow may make 4WD necessary. Usually one and a half to two vehicles wide.\n\nWill lead up to the Christmas Party in Nederland at 3pm.','2017-12-10 18:00:00','2017-12-10 22:00:00',NULL,'EASY',NULL,'King Soopers, Boulder',0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003gb4b7d7y8gmrf','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Metberry Gulch/Hackett Gulch run','Trail Rating MG: 4, HG: 5-7\n\nRally Time : 10 am\n\nRally place: Conoco, 10 Meadow Park Dr, Divide, CO 80814\n\naka Winch Hill\n\n&nbsp;','2018-05-27 16:00:00','2018-05-27 23:00:00',NULL,'ADVANCED',NULL,'Conoco, 10 Meadow Park Dr, Divide, CO 80814',0,NULL,-1,'ckomap3ww004f13b75oo18ug9',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004bb4b7azz68r44','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Mount Herman Road & Rampart Range Road trail run','[caption id=\"attachment_861\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-861\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/ACA31DC8-A01F-4256-95B8-8CBC73971456-1024x624.jpeg\" alt=\"\" width=\"1024\" height=\"624\" /> Mount Herman Road[/caption]\n\n[caption id=\"attachment_862\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-862\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/01F70D74-C69C-41CA-BA94-950E009E20F0-1024x525.jpeg\" alt=\"\" width=\"1024\" height=\"525\" /> Rampart Range Road[/caption]\n\n******** UPDATED AUG 12th********\n<ul>\n 	<li>Note from Robert:  Meet at Safeway parking lot 945am leaving at 10am. This is exit 161 off I-25.  This trail is easy and drops us off on Rampart Range rd where we have lots of oppurtunitys to do other trails, I also plan to return on Balanced Rock or Damen Rd I believe stock Suv can do any of these trails.  Bring a lunch and we\'ll find some shade and eat up.</li>\n 	<li>Also, check for traffic through castle Rock on I-25 as it\'s a mess.</li>\n</ul>\nDescription: This is a 1 day out and back trial run.\n\nRun Leader: Robert Hatfield\n\nContact info:303-330-1122\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/393-mount-herman-road\"><em><strong>Mount Herman Road</strong></em></a>\n\nTrail Rating is: Easy\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/430-rampart-range-road\"><em><strong>Rampart Range Road</strong></em></a>\n\nTrail Rating is: Easy\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/u3E2LCfKiCT59FkTA\"><em><strong>Safeway in Monument CO</strong></em></a></li>\n 	<li>Rally Time: 9:45 AM</li>\n</ul>','2019-08-25 15:45:00','2019-08-25 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003v13b7bwg6cusr',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00052b4b73zr25nbx','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','Middle St. Vrain / Coney Flats run','<img class=\"alignnone size-large\" src=\"https://i.ytimg.com/vi/_ZMjdO0ebK0/maxresdefault.jpg\" width=\"1280\" height=\"720\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/376-middle-st-vrain\" target=\"_blank\" rel=\"noopener\">Middle St. Vrain info</a> - <a href=\"https://www.trailsoffroad.com/trails/266-coney-flats-coney-creek\" target=\"_blank\" rel=\"noopener\">Coney Flats info</a>\nDetails:\n\n<span style=\"font-weight: 400;\">Middle St. Vrain combined with Coney Flats is a popular trail for modified vehicles with high clearance and is a good test for both your driving skills and your rigs capability. We will start on Middle St. Vrain and then on to Coney Flats allowing us to climb up the obstacles rather than down. The trail has a great mixture of rock and water crossing areas. Depending on run off, the water crossings can be deep at times. </span>\n\n<span style=\"font-weight: 400;\">The gatekeeper is the first obstacle we will face soon as we air down - these rocks change over time as the Forest Service rearranges them. The general rule is that if you can’t make it over the obstacle they create, you should not attempt either trail, hence the name Gatekeeper!</span>\n\n<span style=\"font-weight: 400;\">Again, be sure to read over the information from Trail Offroad and if you have any questions, please let me know!</span>\n\nDifficulty: Difficult\nRally Time: 9:00am\nRally Location: <a href=\"https://goo.gl/maps/c495GTzVSKHs47CJ9\"><span style=\"font-weight: 400;\">King Soopers</span></a><span style=\"font-weight: 400;\"> (1650 30th St, Boulder, CO 80301)</span>\nRun Leader: Jacob A./Taylor H.','2020-07-25 21:00:00','2020-07-26 04:00:00',NULL,'ADVANCED',NULL,'King Soopers (1650 30th St, Boulder, CO 80301)',0,NULL,15,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005cb4b7drimcgvb','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Red Cone / Webster Pass run','<img class=\"aligncenter size-full wp-image-1031\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/07/redcone.jpg\" alt=\"\" width=\"640\" height=\"480\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/432-red-cone\" target=\"_blank\" rel=\"noopener\">Red Cone info</a>\n\n<a href=\"https://www.trailsoffroad.com/trails/488-webster-pass\">Webster Pass info</a>\n\nDifficulty: Intermediate to Difficult\nDetails:\n\n<span style=\"font-weight: 400;\">This is an advanced trail, but it would be a great bridge for those comfortable with intermediate trails wanting to test their skills and level up. We’ll have spotters available and there are only a handful of obstacles. High clearance required, no stock vehicles. We will start with Red Cone (it is one way at the top) then come down Webster Pass. The trails are above 12,000 feet, so please come prepared with plenty of food, water and proper clothing. </span>\n\n<span style=\"font-weight: 400;\">Red Cone is one of the most iconic trails in central Colorado. This four-wheel drive trail provides spectacular views of the divide with several rocky obstacles at the beginning and a once in a lifetime descent near the end. The upper portion of the trail traverses the ridge lines around 12,000 feet with views for miles, but the steep, one-way descent at the end is the most unique feature about this trail.</span>\n\n<span style=\"font-weight: 400;\">Webster Pass is perhaps the best known and certainly most traveled of the three main passes between Summit County and Park County. The summit, above 12,000 feet, offers spectacular views of both counties and a great vantage point to watch rigs descending the white-knuckle ride down from Red Cone.</span>\n\nRally Time: 9:00am\nRally Location: <a href=\"https://www.google.com/maps/place/Loaf+\'N+Jug/@39.4393068,-105.4538024,18.36z/data=!4m13!1m7!3m6!1s0x0:0x0!2zMznCsDI5JzAzLjMiTiAxMDXCsDQ4JzA5LjgiVw!3b1!8m2!3d39.48426!4d-105.80273!3m4!1s0x876b0d827562705f:0x54de9de6474aa74d!8m2!3d39.4399388!4d-105.45391\"><span style=\"font-weight: 400;\">Loaf ‘N Jug</span></a><span style=\"font-weight: 400;\"> - 173 Bulldogger Rd, Bailey, CO 80421</span>\nRun Leader: Jacob A. &amp; Taylor H.','2020-08-30 21:00:00','2020-08-31 05:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,10,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005lb4b7fsdrft2y','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','CAMPING','Winch Maintenance Party','<img class=\"aligncenter size-full wp-image-1107\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2021/03/winch.jpeg\" alt=\"\" width=\"400\" height=\"292\" />\n\nHaven\'t used your winch in awhile? Let\'s get it prepped for the upcoming season by doing some inspection and maintenance. W<span data-offset-key=\"a1906-2-0\">e\'ll take a look at the critical components, clean them as-needed, inspect the synthetic/wire rope for damage or wear, wash the ropes, and re-tension the lines.</span>\n\nThis is a members-only event.\n\nDate: Saturday, April 10th, 2021\nTime: 1:00 pm - 3:00 pm\nLocation: Gary\'s house, 12562 Alcott St, Broomfield, CO 80020 (<a href=\"https://www.google.com/maps/dir//12562+Alcott+St,+Broomfield,+CO+80020/@39.9232195,-105.0193263,17z/data=!4m9!4m8!1m0!1m5!1m1!1s0x876c7590fceb41b5:0x87479a9dd7bc8d50!2m2!1d-105.0171376!2d39.9232195!3e0\" target=\"_blank\" rel=\"noopener\">directions</a>)','2021-04-10 16:00:00','2021-04-11 16:00:00',NULL,'UNKNOWN',NULL,NULL,1,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjv0030b4b7cwcu3d8g','2021-05-13 04:15:30.235','2021-05-13 04:15:30.235','CAMPING','West Chicago Creek','<p>Details: Camping at West Chicago Creek campground with the YAG RV group and running a local trail.<br />\nUnlikely to accommodate RV reservations, but tent camping is open along side the RVs.<br />\n[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]</p>\n<p>Trail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]</p>\n<p>Rally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]</p>\n<p>Rally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>\n','2017-06-16 13:00:00','2017-06-19 23:00:00',NULL,'UNKNOWN',NULL,'West Chicago Creek',0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003eb4b7cv9h670o','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Yankee Hill run','Rally at the <a href=\"https://goo.gl/maps/cRKYA2Xfrow\">Valero</a> near the entrance to the Central City Parkway at 9:45, leaving at 10am sharp.\n\nBring a lunch/drinks/snacks.','2018-05-12 16:00:00','2018-05-12 23:00:00',NULL,'UNKNOWN',NULL,'Valero, 45 Central City Pkwy, Evergreen, CO 80439',0,NULL,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003mb4b7guhcfn6e','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','GRAVEL MOUNTAIN (28 July) & \"SIDEWINDER\" (29 July)','GRAVEL MOUNTAIN (28 July) &amp; \"SIDEWINDER\" (29 July)\n\nRun Leader: Andy Farr\n\nRally Place: Kum &amp; Go at the west end of Granby, CO (308 Agate Street)\n\nTrail Difficulty: Moderate\n\nAndy\'s Notes:\n\nHowdy! As you guys know, I decided that the Hahn\'s Peak Run (scheduled 28-29 July) was logistically too difficult to manage given the distance from Denver and my move to Grand Lake. So here\'s the new planned run:\n\nOn Saturday, 28 July 2018, we\'ll be meeting at the Kum &amp; Go at the west end of Granby, CO (308 Agate Street) at 12pm. (Granby is about two hours from central Denver over Berthoud Pass or one hour from Estes Park ove<span class=\"text_exposed_show\">r Trail Ridge Road/RMNP.) We\'ll head north to GCR 4 and head up Stillwater Pass, and then connect to the GRAVEL MOUNTAIN off-road trails. They are fairly heavily wooded with occasional views of Porhpyry Peak and the Never Summer Ranges and can be extra fun if muddy, but they are at most a 3-4 rated trail, but will be a chance for most all rigs to join in.</span>\n<div class=\"text_exposed_show\">\n\nAfter, we will head over Hot Sulphur Springs for a soak before heading up to Andy &amp; Mike\'s place in Grand Lake for a grill out and chill out. For those spending the night, the place can accommodate overnight guests (bring air mattresses) and some small trailers (under 20\') on the lot. (Contact Andy for details.) There are also many good campgrounds and hotels in Grand Lake if you want privacy.\n\nOn Sunday, 29 July 2018, we\'ll start with a hearty breakfast early at the Sagebrush Inn in Grand Lake (1101 Grand Avenue) and before heading over to Kremmling around 10am and tackling the \"small but deadly\" Sidewinder 4x4 Trail.\n\n<a href=\"https://l.facebook.com/l.php?u=https%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3DQ5XMdsqlaag&amp;h=AT2cI-ru5DlYptfsltI1w5VnQkKpjAnkWzDlmEe-xtqHrGMmUeVpPatbGbsBxH7CL6Sgw4ROWKpkw56b4KHCMs9TBaDf8CqUpPAxGFf1Et7fvqGzloChS__3wK57bE5wQczaaiUPLHrFeiUAGQ-HGvusqvc\" target=\"_blank\" rel=\"nofollow noopener\" data-ft=\"{&quot;tn&quot;:&quot;-U&quot;}\" data-lynx-mode=\"origin\">https://www.youtube.com/watch?v=Q5XMdsqlaag</a>\n\nThis trail is a manufactured obstacle course, a short 1.7 miles long, but rated at 8-9! Any rigs on this track should have 35\" tires and a minimum 3\'lift with lockers. It\'s a small but deadly course! (On that note, I\'ll be looking for a fool or two that might want to run it or walk it once or twice before we all attempt it!) Please note we cannot run Sidewinder if there has been recent rain so I\'ll be looking for a back-up.\n\nI shall have more info before the next club meeting, and will have maps to our house for those interested.\n\n</div>','2018-07-28 18:00:00','2018-07-30 03:00:00',NULL,'INTERMEDIATE',NULL,'Kum & Go at the west end of Granby, CO (308 Agate Street)',0,NULL,-1,'ckomap3ws000e13b7f0hf242s',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003ub4b70czcfq4x','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Saxon Mountain/Kenny\'s Cabin run','If rain/snow, we\'ll skip Saxon Mtn and just do Kenny\'s Cabin.\n\nThis is considered an \"Easy\" run, but there are some very narrow ledges on the ascent. <a href=\"https://www.trailsoffroad.com/trails/449-saxon-mountain\">More info</a> on Saxon Mtn.\n\n&nbsp;\n\nTrail Name: Saxon Mountain &amp; Kenny\'s Cabin\n\nRally Time: 10am\n\nRally Place: Safeway, 2425 Miner St, Idaho Springs, CO 80452\n\nTrail Rating: 3-4\n\nRun Leader: Gary Lameris','2018-10-07 16:00:00','2018-10-07 23:00:00',NULL,'INTERMEDIATE',NULL,'Safeway, Idaho Springs',0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0041b4b728792y7a','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','FUNDRAISING','Beer Bust #2','Come help pour! This is a great opportunity for recruiting as our season starts back up again!\n\nLocation: Trade, 475 Santa Fe Drive, Denver, Colorado 80204\n\nArrive at 2:45 PM for the briefing','2019-04-13 20:45:00','2019-04-14 01:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3ww004e13b7bkun6qee',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0047b4b7eshh3yi6','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Bill Moore Lake trail run and short hike','[caption id=\"attachment_899\" align=\"aligncenter\" width=\"997\"]<img class=\"size-full wp-image-899\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/07/489A8839-4EE9-4580-BDB8-8213D05CC33B.jpeg\" alt=\"\" width=\"997\" height=\"981\" /> Bill Moore Lake[/caption]\n\n********UPDATED JULY 8th********\n\nDescription: This is a 1 day out and back trail run.\n<ul>\n 	<li>Note from Doug:   Unfortunately, McAllister Gulch and Shrine Pass are closed from snow.  Bill Moore Lake is open almost to the Lake.  We will drive as far as possible and Hike the rest, if  possible.  BRING A LUNCH</li>\n</ul>\nRun Leader: Doug Tear\n\nContact Info: 970-217-4679\n<ul>\n 	<li>Information for <a href=\"https://www.trailsoffroad.com/trails/219-bill-moore-lake\"><b><i>Bill Moore Lake</i></b></a></li>\n 	<li>More information for <a href=\"https://funtreks.com/off-road-trails/bill-moore-lake/\"><b><i>Bill Moore Lake</i></b></a></li>\n</ul>\nTrail Rating is: Moderate\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/2krqbqQmNo6kvqNF7\"><em><strong>Safeway in Idaho Springs</strong></em></a></li>\n 	<li>Rally Time: 9:00 AM</li>\n</ul>','2019-07-13 15:00:00','2019-07-13 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005ib4b7ac2ecxq0','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Snowmobiling','<a href=\"https://mysnowmobiletour.com/our-snowmobile-tours/action-tour\">More info</a>\n\nThis is a two-hour guided tour through groomed trails near Green Mtn Reservoir. We\'ll likely have to split up into multiple groups.\n\nPrice: $170-180 per sled, $65/passenger\nCall 970-668-9945 to book your reservation.\n\nDifficulty: Easy\nRally time: 2:30pm\nRally location: 7101 Heeney Road Silverthorne, CO 80498','2021-02-20 17:00:00','2021-02-20 17:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004hb4b7fb1ygl9c','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Mosquito Pass trail run','[caption id=\"attachment_869\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-869\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/A154BAF6-65FF-4229-8EE9-213DC913648E-1024x714.jpeg\" alt=\"\" width=\"1024\" height=\"714\" /> Mosquito Pass[/caption]\n\n********UPDATED SEPTEMBER 8th********\n\nDescription: This is a 1 day out and back trail run.\n\nRun Leader: Doug Tear\n\nContact info: 970-217-4679\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/389-mosquito-pass\"><em><strong>Mosquito Pass</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/mosquito-pass/\"><em><strong>Mosquito Pass</strong></em></a>\n\nTrail Rating is: Easy-Moderate\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/VzsjT8FdoWa8mqm68\"><em><strong>King Soopers in Conifer</strong></em></a></li>\n 	<li>Rally Time: 9:00 AM</li>\n</ul>','2019-09-14 15:00:00','2019-09-14 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004qb4b72uso368z','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','MEETING','End of Summer/Ryan\'s Going Away Party','Let\'s get together at Craig\'s place for an afternoon to mark the outgoing season and celebrate our outgoing Secretary. Ryan McCoy leaves us for Santa Fe soon and we want to give him our best send-off! Burgers/dogs and basic drinks will be provided. If you want any special drinks, feel free to bring them.\n\nStart: 3:00 pm\nEnd: 7:00 pm-ish\nAddress: <a href=\"https://www.google.com/maps/dir//1640+Harrison+St,+Denver,+CO+80206/@39.742737,-104.9437747,17z/data=!4m8!4m7!1m0!1m5!1m1!1s0x876c7eaae1036ffb:0x46256a641b10464c!2m2!1d-104.941586!2d39.742737\" target=\"_blank\" rel=\"noopener\">1640 Harrison Street, Denver, CO 80206\n</a>\n\nStreet parking available','2019-09-08 21:00:00','2019-09-09 01:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,35,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00051b4b7b2glbrxf','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','CAMPING','Kenny\'s Cabin / Rich\'s Memorial run/camping','<img class=\"aligncenter size-full wp-image-1028\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/07/KennysCabin-Circa-1990.jpg\" alt=\"\" width=\"600\" height=\"338\" />\n<div class=\"bi6gxh9e\" data-block=\"true\" data-editor=\"bmn1u\" data-offset-key=\"2p8o2-0-0\">\n<div class=\"_1mf _1mj\" data-offset-key=\"2p8o2-0-0\"><span data-offset-key=\"2p8o2-0-0\">Happening this weekend </span><span data-offset-key=\"2p8o2-0-1\">- This Saturday, July 18th, we will be doing our annual Kenny’s Cabin run just outside of Idaho Springs. This has been an annual tradition for the club. It will also be an informal memorial run for long time member, Rich Reynolds, who passed away late last year. Rich’s partners will be spreading his ashes up at the cabin, which has been a tradition over the years for many long time members. The website has more information on the history of Kenny’s Cabin. There is a network of trails on the mountain for anyone who is interested in exploring the area.</span></div>\n</div>\n<div data-offset-key=\"2p8o2-0-0\">\n\n<img class=\"wp-image-1027 aligncenter\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/07/unnamed-1.jpg\" alt=\"\" width=\"402\" height=\"301\" />\n\n</div>\n<div class=\"bi6gxh9e\" data-block=\"true\" data-editor=\"bmn1u\" data-offset-key=\"2p8o2-0-0\">\n<div data-offset-key=\"2p8o2-0-0\"></div>\n<div class=\"_1mf _1mj\" data-offset-key=\"2p8o2-0-0\"><span data-offset-key=\"2p8o2-0-1\">Doug will be leading us on an </span><span data-offset-key=\"2p8o2-0-2\">easy / low moderate</span><span data-offset-key=\"2p8o2-0-3\"> run up South Spring Gulch to the cabin. Stock 4x4 with good ground clearance should be able to do this run.</span></div>\n</div>\n<div class=\"bi6gxh9e\" data-block=\"true\" data-editor=\"bmn1u\" data-offset-key=\"12ts-0-0\">\n<div class=\"_1mf _1mj\" data-offset-key=\"12ts-0-0\"><a href=\"https://www.trailsoffroad.com/trails/2055-south-spring-gulch\"><span class=\"py34i1dx\"><span data-offset-key=\"12ts-0-0\">https://www.trailsoffroad.com/trails/2055-south-spring-gulch</span></span></a></div>\n<div data-offset-key=\"12ts-0-0\"></div>\n</div>\n<div class=\"bi6gxh9e\" data-block=\"true\" data-editor=\"bmn1u\" data-offset-key=\"ciif3-0-0\">\n<div class=\"_1mf _1mj\" data-offset-key=\"ciif3-0-0\"><span data-offset-key=\"ciif3-0-0\"> When we reach the cabin as a group, the memorial will take place. </span></div>\n<div class=\"_1mf _1mj\" data-offset-key=\"ciif3-0-0\"><span data-offset-key=\"ciif3-0-0\">Afterwards, we can have lunch at the cabin before heading back down. Bring a lunch, plenty of fluids, and a foldable chair if you want to sit down.</span></div>\n</div>\n<div class=\"bi6gxh9e\" data-block=\"true\" data-editor=\"bmn1u\" data-offset-key=\"21lu1-0-0\">\n<div data-offset-key=\"21lu1-0-0\"></div>\n<div class=\"_1mf _1mj\" data-offset-key=\"21lu1-0-0\"><span data-offset-key=\"21lu1-0-0\">Time and weather permitting, we may decide as a group to do another run in the area. Jacob and Taylor have offered to lead us on Cascade Creek, which is rated as </span><span data-offset-key=\"21lu1-0-1\">difficult</span><span data-offset-key=\"21lu1-0-2\">. 4x4’s with high ground clearance and skid plates recommended.</span></div>\n</div>\n<div class=\"bi6gxh9e\" data-block=\"true\" data-editor=\"bmn1u\" data-offset-key=\"fk3rm-0-0\">\n<div class=\"_1mf _1mj\" data-offset-key=\"fk3rm-0-0\"><a href=\"https://www.trailsoffroad.com/trails/249-cascade-creek\"><span class=\"py34i1dx\"><span data-offset-key=\"fk3rm-0-0\">https://www.trailsoffroad.com/trails/249-cascade-creek</span></span></a></div>\n</div>\n<p style=\"font-weight: 400;\">Meeting time will be 10:00 am at the Safeway in Idaho Springs.</p>\n<p style=\"font-weight: 400;\">If you need to cancel, please update your RSVP *and* send me a text to let me know.</p>\n<p style=\"font-weight: 400;\">Doug 970-217-4679</p>\nDifficulty: Easy/Intermediate\nRally Time: 10 am\nRally Location: Safeway, 2425 Miner St, Idaho Springs, CO 80452\nRun Leader: Doug T.','2020-07-18 22:00:00','2020-07-19 04:00:00',NULL,'ADVANCED',NULL,'Safeway, 2425 Miner St, Idaho Springs, CO 80452',0,NULL,25,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjv0031b4b7hww5511n','2021-05-13 04:15:30.235','2021-05-13 04:15:30.235','CAMPING','Arapahoe Bay','<p>Details: Camping at Arapahoe Bay campground with the YAG RV group and running a local trail.<br />\nUnlikely to accommodate RV reservations, but tent camping is open along side the RVs.<br />\n[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]</p>\n<p>Trail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]</p>\n<p>Rally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]</p>\n<p>Rally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>\n','2017-07-28 13:00:00','2017-07-30 23:00:00',NULL,'UNKNOWN',NULL,'Arapahoe Bay',0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003db4b71lfa1kig','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','FUNDRAISING','Denver Wrangler Beer Bust','Welcome to May and the start of our 32nd year as an organization. The 4-Players of Colorado are hosting the Denver Wrangler\'s Legendary Beer Bust, and we hope you\'ll come out to support us and our charities. In addition to serving your Sunday afternoon favorite beverage, we will signing-up guys for our announcements and guest accounts. Invite your neighbors, friends, and anyone you know with an off-road capable vehicle and let\'s chat over a beverage! Please arrive no later than 3:30pm.','2018-05-06 21:30:00','2018-05-07 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003lb4b7h3k4906n','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Middle St. Vrain','Middle St. Vrain\n\nRun Leader: Gary Lameris\n\nRally Time: 9:00 AM\n\nRally Place: King Soopers,  1650 30th st. Boulder, co 80301\n\nTrail Rating: 4-5\n\n&nbsp;','2018-07-21 15:00:00','2018-07-21 23:00:00',NULL,'ADVANCED',NULL,'King Soopers 1650 30th st. Boulder, co 80301',0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0049b4b7c40gbjl1','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Kingston Peak & Loch Lomond trail run','[caption id=\"attachment_859\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-859\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/8BC45584-7B20-4113-8DD6-7A59C0E000B4-1024x715.jpeg\" alt=\"\" width=\"1024\" height=\"715\" /> Kingston Peak[/caption]\n\n[caption id=\"attachment_860\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-860\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/8278BCD0-BF2D-4BE2-A413-8086EA89C490-1024x713.jpeg\" alt=\"\" width=\"1024\" height=\"713\" /> Loch Lomond[/caption]\n\n********UPDATED JULY 9th********\n\nDescription:  This is a 1 day out and back trail run.\n<ul>\n 	<li>Note from Craig:     We\'ll rally <a dir=\"ltr\" href=\"x-apple-data-detectors://5\">at 9am</a> to get an earlier start and pass through Apex ghost town on the way to the trailhead. Airing down is recommended, as this is a bumpy trail. Per the reports, vehicles with reasonable clearance are recommended - stock vehicles are discouraged, but could probably make it with a few taps on the undercarriage. Because of the loose shale and likely seasonal runoff, lockers are also recommended. With carefully-selected lines, they are probably not necessary (I don\'t have lockers). Bring a lunch, drinks (water), and the usual safety gear.\n<div></div></li>\n 	<li>\n<div>Time and weather permitting, after we descend from Kingston Peak we\'ll continue on to Loch Lamond (~45 mins out and back).</div>\n<div></div></li>\n 	<li>\n<div>Between the two trails, this is a long day. Plan to be done <a dir=\"ltr\" href=\"x-apple-data-detectors://6\">between 2:30 and 4:30pm</a>.</div></li>\n</ul>\nRun Leader: Craig Freeman\n\nContact Info: 619-559-2580\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/351-kingston-peak\"><em><strong>Kingston Peak</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/kingston-peak/\"><em><strong>Kingston Peak</strong></em></a>\n\nTrail Rating is: Easy-Moderate\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/360-loch-lomond\"><em><strong>Loch Lomond</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/loch-lomond/\"><em><strong>Loch Lomond</strong></em></a>\n\nTrail Rating is: Moderate\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/XzSYEHFBeD7BhCpV8\"><em><strong>Valero in Idaho Springs</strong></em></a></li>\n 	<li>Rally Time: 9:00 AM</li>\n</ul>','2019-07-27 15:00:00','2019-07-27 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004lb4b7bminhtp2','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','CAMPING','Farwell Mountain via Lost Dog trail run and camping','[caption id=\"attachment_873\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-873\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/1F24C721-A020-4969-92EE-32C02C38EE70-1024x469.jpeg\" alt=\"\" width=\"1024\" height=\"469\" /> Farwell Mountain via Lost Dog[/caption]\n\nDescription: This is a 1 night campout and trial run hosted by Andy Farr.\n\nRun Leader: Andy Farr\n\nContact info: 303-618-5229\n\nInformation for <a href=\"https://funtreks.com/off-road-trails/farwell-mountain-via-lost-dog/\"><em><strong>Farwell Mountain via Lost Dog</strong></em></a>\n\nTrail Rating is: Difficult\n\nRally Point: TBD\n\nRally Time: TBD','2019-10-19 14:00:00','2019-10-20 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjv0033b4b76q6mhb4w','2021-05-13 04:15:30.235','2021-05-13 04:15:30.235','CAMPING','Camp Dick','<p>Details: Camping at Camp Dick campground with the YAG RV group and running a local trail.<br />\nUnlikely to accommodate RV reservations, but tent camping is open along side the RVs.<br />\n[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]</p>\n<p>Trail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]</p>\n<p>Rally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]</p>\n<p>Rally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>\n','2017-09-15 13:00:00','2017-09-17 23:00:00',NULL,'UNKNOWN',NULL,'Camp Dick',0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004xb4b77t9l394m','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Mount Baldy run','<img class=\"aligncenter size-full wp-image-1016\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/05/Mount-Baldy-Picture.jpg\" alt=\"\" width=\"960\" height=\"640\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/391-mount-baldy\" target=\"_blank\" rel=\"noopener\">Mount Baldy Trails Offroad</a>\n<strong>Details:</strong>\n\n<span style=\"font-weight: 400;\">Mount Baldy (FS 379 and FS 379A) is located within the Pike National Forest approximately 15 miles southwest of Colorado Springs. The Mt. Baldy summit is to the south of the Stratton Reservoir while the summit of Mt. Almagre is to the north of the reservoir. The trail will end at a gate below Mt. Baldy and south of Almagre Mountain. </span>\n\n<span style=\"font-weight: 400;\">Majority of the trail is fairly easy, but towards the top it begins to become a little more difficult and rocky along the shelf road. We have completed this in a stock Tacoma in 2019 so a stock high clearance vehicle should be fine. </span>\n\n<span style=\"font-weight: 400;\">Please come prepared with water, snacks and lunch on the trail - planning for lunch at the top (depending on weather). </span>\n\n<strong>Run Leader:</strong> Jacob A. &amp; Taylor H.\n\n<strong>Difficulty:</strong> <span style=\"font-weight: 400;\">Moderate</span>\n<strong>Rally Time:</strong> 9:00am; depart 9:30am\n<strong>Rally Location:</strong>\n\n<a href=\"https://goo.gl/maps/2d3hV7KD7aZXbpsc6\">Rudy’s Country Store and BBQ</a> 315 S 31st, Colorado Springs, CO 80904','2020-06-06 21:00:00','2020-06-07 02:00:00',NULL,'EASY',NULL,'Rudy’s Country Store and BBQ 315 S 31st, Colorado Springs, CO 80904',0,NULL,15,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00056b4b7fzmagb80','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','Mill Creek and Bill Moore Lake / Red Elephant Hill run','<img class=\"aligncenter size-large wp-image-1033\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/08/maxresdefault-1024x576.jpg\" alt=\"\" width=\"1024\" height=\"576\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/219-bill-moore-lake\" target=\"_blank\" rel=\"noopener\">Bill Moore Lake info</a> - <a href=\"https://www.trailsoffroad.com/trails/433-red-elephant-hill\" target=\"_blank\" rel=\"noopener\">Red Elephant Hill info</a> - <a href=\"https://www.trailsoffroad.com/trails/377-mill-creek\" target=\"_blank\" rel=\"noopener\">Mill Creek info</a>\nDifficulty: Intermediate / Difficult\nDetails: Depending on the comfort level of attendees, we can either take Bill Moore Lake (Intermediate) up to where it intersects with Red Elephant Hill and then do the Mill Creek loop OR we can take Red Elephant Hill (difficult) up and do the Miller Creek loop. If we have enough people, we can split the group to do both and meet back up before doing Mill Creek together. Bring a lunch and plenty of fluids.\nRally Time: 9am\nRally Location: Idaho Springs Safeway\nRun Leader: Craig F.','2020-08-22 21:00:00','2020-08-23 04:00:00',NULL,'ADVANCED',NULL,'Idaho Springs Safeway',0,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjv0032b4b7cgk271az','2021-05-13 04:15:30.235','2021-05-13 04:15:30.235','CAMPING','Mt. Princeton','<p>Details: Camping at Mt. Princeton campground with the YAG RV group and running a local trail.<br />\nUnlikely to accommodate RV reservations, but tent camping is open along side the RVs.<br />\n[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]</p>\n<p>Trail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]</p>\n<p>Rally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]</p>\n<p>Rally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>\n','2017-09-01 13:00:00','2017-09-05 23:00:00',NULL,'UNKNOWN',NULL,'Mt. Princeton',0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx0036b4b7got0gb7g','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Slaughterhouse Gulch','Trail Details: Slaughterhouse Gulch in Bailey, Colorado. This trail is open year-round and should be a good run this time of year. We\'ll be looking to see if this would make a good option for a snow run in February.\n\n[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]\n\nTrail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]\n\nRally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]\n\nRally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]\n\nRun Leader: [ESPRESSO_STAFF]','2017-11-25 17:00:00','2017-11-25 22:00:00',NULL,'EASY',NULL,'King Sooper\'s parking lot, 25637 Conifer Rd, Conifer, CO',0,NULL,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003fb4b70q0zfota','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Mt. Baldy run','<div dir=\"auto\">Any stock 4wd should not be a problem. This is a high altitude trail with some shelf areas. We may do other area trails time and weather permitting.</div>\n<div dir=\"auto\"></div>\n<div dir=\"auto\">Difficulty: Easy (3/10 to 4/10)</div>\n<div dir=\"auto\">Rally time: 10am</div>\n<div dir=\"auto\">Rally place: Safeway, 1920 S Nevada Ave, Colorado Springs, CO 80905</div>','2018-05-20 16:00:00','2018-05-20 23:00:00',NULL,'INTERMEDIATE',NULL,'Safeway, 1920 S Nevada Ave, Colorado Springs, CO 80905',0,NULL,-1,'ckomap3wv003v13b7bwg6cusr',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003nb4b76e6r7iy3','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','CAMPING','Moab 2018','Pride/Moab camping trip! September 27 - October 1, Big Bend group site A and B.  Cost for members is $20.00 and non members is $40.00.','2018-09-27 14:00:00','2018-10-01 18:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,50,'ckomap3wv003o13b71nfmfkuk',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003tb4b72vj0cvos','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Peru Creek/Chihuaha Run','Trail Name: Peru Creek/Chihuaha Run\n\nRun Leader: Robert Hatfield\n\nRally Place: Gateway visitors center, 1491 Argentine st, georgetown, co 80444.\n\nRally Time: 9:00 am\n\nTrail Rating: 3-5\n\n<strong>Hatfield\'s Notes:</strong>\n\nWe will be doing Peru Creek and Chihuahua Gulch. Bring lunch and fill up across the street. We will do the trail and lunch somewhere on it. Trails are rated Easy to low moderate. Stock should be fine. After these trails are done, options are go back to I-70 and face going home traffic, or I am strongly considering taking Webster Pass/Handcart Gulch to US-285 back to Denver (to be decided day of). These two trails are not for anyone scared of heights, or narrow shelf roads (not recommended for full size trucks) . I\'m always open to explore, for those who come, We can decide extras the day off. I hope to have at least 4 rigs, come one guys, last trails before Moab.\n\n&nbsp;','2018-09-23 15:00:00','2018-09-23 23:00:00',NULL,'ADVANCED',NULL,'Gateway visitors center, 1491 Argentine st, georgetown, co 80444.',0,NULL,-1,'ckomap3wv003v13b7bwg6cusr',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0040b4b793bldn63','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','MEETING','2019 Run Planning meeting','Hello!\n<p class=\"p1\">Please join me for the 2019 Run Planning meeting. Everyone is welcome to attend and provide input on trails they\'d like to see us go on this year.</p>\n<p class=\"p1\">Location:\n7200 W. Arkansas Ave\nLakewood CO 80232</p>\n<p class=\"p1\"><strong>Run Leaders</strong>, please compile a list of at least 5 Trails and 5 dates (Saturday or Sunday) that you can lead.  You will not be leading all these runs unless you want to, this is just to handle conflicts.</p>\nPlease bring something to sit on (I am limited on seating).\n\nThanks,\n\nSteve Totta\nRun Master\n<a href=\"tel:816-679-9882\">816-679-9882</a>\n<p class=\"p1\"></p>','2019-02-10 22:00:00','2019-02-11 00:00:00',NULL,'UNKNOWN',NULL,NULL,1,NULL,-1,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003pb4b7h3fa5mxl','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Mosquito Pass','Trail Name: Mosquito Pass\n\nRun Leader: Tom Eskridge\n\nRally Time: 9:30 am\n\nRally Place: Alma, CO. Main St and Parkhill RD.\n\nTrail Rating: 4-5\n\n<strong>Make sure you fill up tank in Alma, CO.</strong>','2018-08-18 15:30:00','2018-08-18 23:00:00',NULL,'UNKNOWN',NULL,'Alma, CO. Main St and Parkhill RD.',0,NULL,-1,'ckomap3wv003o13b71nfmfkuk',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0048b4b7azsn3gwg','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Blacktail Creek trail run plus Hot Sulphur Springs and BBQ in the Evening','[caption id=\"attachment_858\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-858\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/E6FEC77F-EE52-43B8-B29B-EFFF8E73A9D3-1024x473.jpeg\" alt=\"\" width=\"1024\" height=\"473\" /> Blacktail Creek[/caption]\n\n********UPDATED JULY 7th********\n\nDescription:  This is a 1 day out and back trail run with a stop in Hot Sulphur Springs.\n<ul>\n 	<li>Note from Andy:   We should be finished with the trail around 3:00 PM.  Then a trip to Hot Sulphur Springs followed up with a BBQ in the evening.  There are also 6 places to crash for the night.</li>\n 	<li>Please text Andy if you plan to stay the night.</li>\n</ul>\n&nbsp;\n\nRun Leader: Andy Farr\n\nContact info: 303-816-5229\n\nInformation for <a href=\"https://funtreks.com/off-road-trails/blacktail-creek/\"><em><strong>Blacktail Creek</strong></em></a>\n\nTrail Rating is : Easy\n\nInformation for <a href=\"https://www.visitgrandcounty.com/explore/towns/hot-sulphur-springs/?gclid=Cj0KCQjwhuvlBRCeARIsAM720HpdR2a1bXoeUYOYI_RtsaZ3cyG-Bx4o1K7WAjmXeCld7ok_X9KAcfcaAgwuEALw_wcB\"><em><strong>Hot Sulphur Springs</strong></em></a>\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/BWGasbopuwH6oAy86\"><em><strong>Kum &amp; Go in Granby</strong></em></a></li>\n 	<li>Rally Time: 10:00 AM</li>\n</ul>','2019-07-20 16:00:00','2019-07-20 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3ws000e13b7f0hf242s',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004gb4b7bnite2t1','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Miller Rock trail run','[caption id=\"attachment_868\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-868\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/486152F2-380B-467B-A0EB-FCF05D3DEC8C-1024x471.jpeg\" alt=\"\" width=\"1024\" height=\"471\" /> Miller Rock[/caption]\n\n********UPDATED AUG 25th********\n<ul>\n 	<li>Note from Craig: It’s a tight trail. No wide vehicles, no long wheelbases, no stock clearance. Good practice for Moab :)</li>\n</ul>\nDescription: This is a 1 day out and back trail run.\n\nRun Leader: Craig Freeman\n\nContact Info: 619-559-2580\n\nInformation for <a href=\"https://funtreks.com/off-road-trails/miller-rock/\"><em><strong>Miller Rock</strong></em></a>\n\nTrail Rating is: Difficult\n<ul>\n 	<li>Rally Point:<em><strong> <a href=\"https://goo.gl/maps/cZqhUGwoy9rDXDCaA\">King Soopers in Boulder</a></strong></em></li>\n 	<li>Rally Time: 10:00 AM</li>\n</ul>','2019-09-07 14:00:00','2019-09-07 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjv002yb4b78gzhaxqq','2021-05-13 04:15:30.235','2021-05-13 04:15:30.235','CAMPING','Ouray Area','<p>Details: Camping at Ridgeway State Park campground with the YAG RV group and running multiple trails during the week.<br />\nUnlikely to accommodate RV reservations, but tent camping is open along side the RVs.<br />\n[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]</p>\n<p>Trail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]</p>\n<p>Rally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]</p>\n<p>Rally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>','2017-06-30 13:00:00','2017-07-08 23:00:00',NULL,'UNKNOWN',NULL,'Ridgeway State Park',0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003ab4b7hrbgc3uw','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Basics Clinic - Day One','Day One - 4 hrs instruction, 4 hrs practical\n\nWe will be meeting at Uncle Jeff\'s and will be riding on the Switzerland Trail near Sugarloaf Mtn (near Boulder).\n\nPrerequisites:\n<ul>\n 	<li><span style=\"font-family: Calibri; font-size: 11.0pt;\">Read owners manual</span>\n<ul>\n 	<li><span style=\"font-family: Calibri; font-size: 11.0pt;\">Know what features you have</span></li>\n 	<li><span style=\"font-family: Calibri; font-size: 11.0pt;\">Know what the buttons are/do</span></li>\n</ul>\n</li>\n 	<li><span style=\"font-family: Calibri; font-size: 11.0pt;\">A well-maintained vehicle</span>\n<ul>\n 	<li><span style=\"font-family: Calibri; font-size: 11.0pt;\">Has 4-Low (no Subaru Forester, Honda Ridgeline, etc.)</span></li>\n</ul>\n</li>\n</ul>\nTopics:\n<ul>\n 	<li>Off-road vehicles\n<ul>\n 	<li>Basics</li>\n 	<li>How 4WD works</li>\n 	<li>Options &amp; Accessories\n<ul>\n 	<li>Tires</li>\n 	<li>Lifts</li>\n 	<li>Recovery points</li>\n 	<li>Swaybar disconnects</li>\n 	<li>Lockers</li>\n 	<li>Etc.</li>\n</ul>\n</li>\n</ul>\n</li>\n 	<li>Driving Techniques</li>\n 	<li>Safety</li>\n 	<li>Pre-trip inspections</li>\n 	<li>Survival &amp; \"Peace of Mind\" Kits</li>\n 	<li>Overview of options for getting unstuck</li>\n 	<li>Post-trip maintenance</li>\n 	<li>Trail etiquette</li>\n 	<li>Tread Lightly</li>\n</ul>\nBring a camping chair, bring beverages, and pack a lunch.\n\nDirections: Take Hwy 119 (Canyon Blvd), go about a 1.25 miles then turn right onto Fourmile Canyon Drive. Reset odometer here. At ~5 miles, there\'s a junction with a sign - \"the Junction\" - take the left fork to stay on Four Mile Canyon towards Wall Street. Look for the blue/white house on the right at the 6.2 mile mark.\n\n&nbsp;','2018-04-21 15:00:00','2018-04-21 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0045b4b7fckbfzcv','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Watch the Denver Pride Parade','<blockquote>\n\n[caption id=\"attachment_851\" align=\"aligncenter\" width=\"1024\"]<img class=\"wp-image-851 size-large\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/BAEA24EF-1240-467A-9893-ED4B13725324-1024x718.jpeg\" alt=\"\" width=\"1024\" height=\"718\" /> Denver Pride-4-Players 2016[/caption]</blockquote>\n**********UPDATED JUNE 12th**********\n<ul>\n 	<li>Description:  This is for a meet up spot to watch the Denver Pride Parade.</li>\n</ul>\nRun Leader: Jason Heaton\n\nContact Info: 303-552-4382\n\nRally Point: At the corner of Grant St and E Colfax Ave.  In front of <em><strong><a href=\"https://goo.gl/maps/XSHryrLvqDEiozfV9\">Capital Hill Books</a></strong></em>\n\nRally Time: 6:30-7AM','2019-06-16 12:00:00','2019-06-16 21:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,24,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004kb4b75yu7dvaz','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Kenny\'s Cabin Memorial trail run','[caption id=\"attachment_223\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-223\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2016/12/KennysCabin-Circa-1990-1024x576.jpg\" alt=\"\" width=\"1024\" height=\"576\" /> Kenny’s Cabin circa 1990[/caption]\n\n********UPDATED OCT 5th********\n\nDescription: This is a 1 day out and back trail run.  Kenny\'s Cabin is a memorial site for many members of the 4-Players.\n\nRun Leader: Tom Eskridge\n\nContact Info: 303-807-5084\n\nTrail Rating is: Beginner\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/fH179AE8dx9C1K799\"><em><strong>Safeway in Idaho Springs</strong></em></a></li>\n 	<li>Rally Time: 10:00 AM</li>\n</ul>','2019-10-13 16:00:00','2019-10-13 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003o13b71nfmfkuk',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk0004yb4b76v8lhnpz','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','Eagle Rock / Saran Wrap run','<img class=\"aligncenter size-large wp-image-1019\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/06/Eagle-Rock-Saran-Wrap-1-1024x768.jpg\" alt=\"\" width=\"1024\" height=\"768\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/285-eagle-rock\" target=\"_blank\" rel=\"noopener\">Eagle Rock info</a> - <a href=\"https://www.trailsoffroad.com/trails/447-saran-wrap\" target=\"_blank\" rel=\"noopener\">Saran Wrap info</a>\nDetails:\n\n<span style=\"font-weight: 400;\">Both Eagle Rock and Saran Wrap are connected so will do both starting with Saran Wrap then on to Eagle Rock ending on FS road 376 which makes an easy drive back down to Colorado Springs. Taylor and I ran this on May 29th and there are several large rocks, off camber areas and deep ruts that provide great challenges often requiring a spotter. Overall it is a challenging trail. I’ve included a link to both trails with detailed information from Trails Offroad that has good information about the trail. </span>\n\n<span style=\"font-weight: 400;\">Be prepared for afternoon showers depending how late we are on the trail - it did storm just as we got off the main trail to the FS road including hail and a temperature swing from about 75 degrees to 40 degrees. Dress appropriately, bring plenty of water and a sack lunch as we will stop on the trail for lunch. </span>\n\n<span style=\"font-weight: 400;\">Again, be sure to read over the information from Trail Offroad and if you have any questions, please let me know!</span>\n\nDifficulty: <span style=\"color: #993300;\">Difficult</span>\nRally Time: 9:00am; departing right at 9:30am\nRally Location: <a href=\"https://goo.gl/maps/Kux134ewSoQ1y1Vm6\">Rudy\'s Country Store &amp; BBQ</a>; 315 S 31st St., Colorado Springs, CO 80904\n\nRun Leader: Jacob A. &amp; Taylor H.','2020-06-13 09:00:00','2020-06-14 15:00:00',NULL,'ADVANCED',NULL,'Rudy\'s Country Store & BBQ; 315 S 31st St., Colorado Springs, CO 80904',0,NULL,15,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00057b4b7dg7jg8kp','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','CAMPING','San Juans runs / camping','<strong>Difficulty</strong>: Difficult (<strong>rear lockers required on some days</strong>)\n<strong>Details</strong>:\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">I will be heading out Wednesday morning around 7AM. A Caravan is welcome.</div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">We will be camping at the Amphitheater Campground near Ouray. It is first come, first serve. So the earlier you arrive the better chances of getting one before the weekend. It is $26/ night. I’m not sure how many tents we can cram in one site, but we’ll make it work. There seem to be no bear boxes, so plan accordingly (Craig).</div>\n<div dir=\"auto\"></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">Bring a lunch with you every day. However, there may be opportunities to eat in Telluride or Lake City. There\'s a chance of a visit to <a href=\"https://orvishotsprings.com/\" target=\"_blank\" rel=\"noopener\">Orvis Hot Springs</a>, so bring a towel/suit/etc. if you\'re interested in participating. Also, bring hiking gear if you are so inclined - there are several hikes in the campground area.</div>\n<div dir=\"auto\"></div>\n</div>\n<div dir=\"auto\">This itinerary is subject to change. Please read about each run prior to attending.</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"></div>\n<div dir=\"auto\"><strong>Thursday</strong></div>\n<div dir=\"auto\">Coors Waterfall Day 7AM Depart</div>\n<ul>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/1160-yankee-boy-basin\" target=\"_blank\" rel=\"noopener\">Yankee Boy Basin</a> 3hrs</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/2492-governor-basin\" target=\"_blank\" rel=\"noopener\">Governors Basin</a> 2hrs</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/2753-sydney-basin\" target=\"_blank\" rel=\"noopener\">Sydney Basin</a> 1hr</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/2752-silver-basin\" target=\"_blank\" rel=\"noopener\">Silver Basin</a> 1hr</li>\n</ul>\n<div dir=\"auto\"><strong>Friday</strong></div>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">Easier Day with Badge 8AM Depart</div>\n<ul>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/404-ophir-pass\" target=\"_blank\" rel=\"noopener\">Ophir Pass</a> (Badge) 3hrs</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/200-alta-lakes\" target=\"_blank\" rel=\"noopener\">Alta Lakes</a> 2hrs</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/1929-last-dollar-road\" target=\"_blank\" rel=\"noopener\">Last Dollar Road</a> 2hrs</li>\n</ul>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong>Saturday</strong></div>\n<div dir=\"auto\">Epic Views Day (Sunrise) 6AM Depart</div>\n<ul>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/1408-imogene-pass\">Imogene Pass</a> (Badge) 4hrs</li>\n 	<li dir=\"auto\">Lunch in Telluride</li>\n 	<li><a href=\"https://www.trailsoffroad.com/trails/1929-last-dollar-road\" target=\"_blank\" rel=\"noopener\">Last Dollar Road</a> 2hrs</li>\n</ul>\n</div>\n<div dir=\"auto\"><strong>Sunday</strong></div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">Alpine Loop Day 6AM Depart</div>\n<ul>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/267-corkscrew-pass\">Corkscrew Pass</a> 2 hrs</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/334-hurricane-pass\">Hurricane Pass</a> 30 min</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/243-california-pass\">California Pass</a> 1 hr</li>\n 	<li dir=\"auto\">Animas Forks 30 min</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/290-engineer-pass\">Engineer Pass</a> (Badge) 3 hrs</li>\n 	<li dir=\"auto\">Lunch in Lake City</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/258-cinnamon-pass\">Cinnamon Pass</a> 5 hrs</li>\n 	<li><a href=\"https://www.trailsoffroad.com/trails/243-california-pass\">California Pass</a> 1 hr</li>\n 	<li><a href=\"https://www.trailsoffroad.com/trails/334-hurricane-pass\">Hurricane Pass</a> 30 min</li>\n 	<li><a href=\"https://www.trailsoffroad.com/trails/267-corkscrew-pass\">Corkscrew Pass</a> 2hrs</li>\n</ul>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong>Monday</strong></div>\n<div dir=\"auto\">Black Bear Pass Day 8AM Depart</div>\n<ul>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/2651-black-bear-pass\">Black Bear Pass</a> (Badge) 4hrs</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/1408-imogene-pass\">Imogene Pass</a> (Badge) 4hrs</li>\n</ul>\n</div>\n<div dir=\"auto\"><strong>Tuesday</strong></div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\">Poughkeepsie Uphill Day (<strong>Lockers required, Min Rear</strong>) 9AM Depart</div>\n<ul>\n 	<li dir=\"auto\">Mineral Creek 1hr</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/426-poughkeepsie-gulch\">Poughkeepsie Gulch</a> (Badge) 4hrs</li>\n 	<li dir=\"auto\">Hurricane Pass 30 Min</li>\n 	<li dir=\"auto\"><a href=\"https://www.trailsoffroad.com/trails/267-corkscrew-pass\">Corkscrew Pass</a> 2hrs</li>\n</ul>\n</div>\n<div class=\"o9v6fnle cxmmr5t8 oygrvhab hcukyx3x c1et5uql ii04i59q\">\n<div dir=\"auto\"><strong>Wednesday</strong></div>\n<div dir=\"auto\">Relaxed Scenic Day 9AM Depart</div>\n<ul>\n 	<li dir=\"auto\">Red Mountain Mining area 4 hrs</li>\n</ul>\n</div>\nThe departure times of 6 and 7 are crucial for timely arrival back at camp. If you have any questions or concerns, please let me know.\n- Steve\n\n<strong>Arrival Date</strong>: Wednesday, Sept 2, 2020\n<strong>Departure Date</strong>: Wednesday, Sept 9, 2020\n<strong>Location</strong>: <a href=\"https://www.fs.usda.gov/recarea/gmug/recarea/?recid=32522\" target=\"_blank\" rel=\"noopener\">Ampitheater Campground</a>, Ouray, CO\n<strong>Run Leader</strong>: Steve T.','2020-09-02 16:00:00','2020-09-09 16:00:00',NULL,'ADVANCED',NULL,NULL,0,NULL,15,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003vb4b7hj8bc2p4','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','T-33 Site run','<a href=\"https://www.trailsoffroad.com/trails/475-t33-plane-crash-co\">More info</a> on T-33 Site.\n\nDifficulty: 5\nRally Info: 10am, King Soopers Parking Lot 1650 30th St., Boulder, CO 80301\nRun leader: Greg Foskey','2018-10-13 16:00:00','2018-10-13 23:00:00',NULL,'ADVANCED',NULL,'King Soopers Parking Lot 1650 30th St., Boulder, CO 80301',0,NULL,-1,'ckomap3wv003q13b757fjdwgt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003bb4b7cpahal50','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Basics Clinic - Day Two','Day Two - 2 hrs instruction, 4+ hours practical\n\nLocation: Yankee Hill.  Meet at the parking lot at the turn off for the trail, where Columbine Campground Road forks left off of Upper Apex Road. <a href=\"https://goo.gl/maps/iF6Soa2szWD2\" target=\"_blank\" rel=\"noopener\">Directions to Rally Point</a>\n\nPrerequisites:\n<ul>\n 	<li>Read owners manual\n<ul>\n 	<li>Know what features you have</li>\n 	<li>Know what the buttons are/do</li>\n</ul>\n</li>\n 	<li>A well-maintained vehicle\n<ul>\n 	<li>Has 4-Low (no Subaru Forester, Honda Ridgeline, etc.)</li>\n</ul>\n</li>\n</ul>\nTopics:\n<ul>\n 	<li>Day one review\n<ul>\n 	<li>Momentum / Traction / Grip</li>\n 	<li>Picking lines</li>\n</ul>\n</li>\n 	<li>Driving techniques (cont\'d)\n<ul>\n 	<li>Obstacles</li>\n 	<li>Terrain</li>\n</ul>\n</li>\n 	<li>Spotter info</li>\n</ul>\nThis is the second of a two-part series.\n\nBring a camping chair, beverages, and pack a lunch. Coffee will be provided.\n\n<a href=\"https://darksky.net/forecast/39.8014,-105.4888/us12/en\">Check the weather</a> beforehand and bring layers as it\'s going to be cold in the morning.','2018-04-28 15:00:00','2018-04-28 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003jb4b7g5khc1po','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','BILL MOORE LAKE RUN','BILL MOORE LAKE RUN\n\nRUN LEADER: TOM ESKRIDGE\n\nRALLY TIME: 9:00 am\n\nRALLY PLACE: Safeway, 2425 Miner St. Idaho Springs CO 80452\n\nTRAIL DIFFICULTY: 4-5\n\n&nbsp;','2018-07-07 15:00:00','2018-07-07 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3wv003o13b71nfmfkuk',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003qb4b7cdzmff0r','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','FUNDRAISING','Triangle Beer Bust','Triangle Beer Bust!!!\n\n2036 N Broadway, Denver Co 80205\n\nBeer Bust Starts at 4pm, Need to be there at 2:45 pm if you plan to pour!!!','2018-08-26 20:45:00','2018-08-27 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3ww004e13b7bkun6qee',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003xb4b7cjhdbsk6','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','FUNDRAISING','Beer Bust At Trade','Beer Bust at Trade, Dec 2 2018.  Please show up at 3 pm if you are planing on helping pour.','2018-12-02 22:00:00','2018-12-03 03:00:00',NULL,'UNKNOWN',NULL,'Trade',0,NULL,-1,'ckomap3ww004e13b7bkun6qee',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0044b4b78emu4759','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Red Elephant Hill trail run','[caption id=\"attachment_850\" align=\"aligncenter\" width=\"1024\"]<img class=\"wp-image-850 size-large\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/EB163D71-437E-4F78-8A7D-C996A760D943-1024x529.jpeg\" alt=\"\" width=\"1024\" height=\"529\" /> Red Elephant Hill[/caption]\n\n********UPDATED JUNE 12th********\n<ul>\n 	<li>Description: This is a 1 day out and back outing.</li>\n 	<li>Note from Andy:  the trails are still snowed in.  However, we will still meet up and have an outing that will get you wet. So bring your swim suit.</li>\n</ul>\nRun Leader: Andy Farr\n\nContact Info: 303-618-5229\n\nInformation for <a href=\"https://funtreks.com/off-road-trails/red-elephant-hill/\"><em><strong>Red Elephant Hill</strong></em></a>\n\nMore information for <a href=\"https://www.trailsoffroad.com/trails/433-red-elephant-hill\"><em><strong>Red Elephant Hill</strong></em></a>\n\nTrail Rating is: Difficult\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/Smwoec6RwDwT4zo96\"><em><strong>The Frothy Cup</strong></em></a> in Idaho Springs</li>\n 	<li>Rally Time: 9:00 AM</li>\n</ul>','2019-06-15 15:00:00','2019-06-15 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3ws000e13b7f0hf242s',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004db4b70j1sg822','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Saints John trail run','[caption id=\"attachment_865\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-865\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/C7A500E8-A33C-4C62-8266-0A7A7FD79743-1024x532.jpeg\" alt=\"\" width=\"1024\" height=\"532\" /> Saints John[/caption]\n\n********UPDATED AUG 13th********\n\nDescription: This is a 1 day out and back trial run.\n<ul>\n 	<li>Run Leader: Doug Tear</li>\n 	<li>Contact Info: 970-217-4679</li>\n</ul>\nInformation for <a href=\"https://www.trailsoffroad.com/trails/443-saints-john\"><em><strong>Saints John</strong></em></a>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/deer-creek-saints-john/\"><em><strong>Saints John</strong></em></a>\n\nTrail Rating is: Moderate\n\nRequired <a href=\"https://www.cpwshop.com/privilegepos.page\"><em><strong>Permit for Saints John</strong></em></a> (Covers all trails in Colorado for 2019)\n<ul>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/jhXnr2BfRzRyoXoB8\"><em><strong>Safeway in Idaho Springs</strong></em></a></li>\n 	<li>Rally Time: 9:00 AM</li>\n</ul>','2019-08-17 15:00:00','2019-08-17 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004mb4b753714aqn','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','FUNDRAISING','4-Players fundraising Beer Bust #6','<img class=\"alignleft size-thumbnail wp-image-570\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2017/04/4PC_ORIG_HiRes_JPEG-150x150.jpg\" alt=\"\" width=\"150\" height=\"150\" />\n\nThis beer bust will be held at Trade','2019-12-08 22:00:00','2019-12-09 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005ab4b7hlje72oc','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Barbour Fork run','<a href=\"https://www.trailsoffroad.com/trails/212-barbour-fork\" target=\"_blank\" rel=\"noopener\">Barbour Fork info</a>\n<strong>Difficulty</strong>: Intermediate\n<strong>Details</strong>: This is an intermediate trail with some smaller obstacles that would be an excellent introduction to rock crawling. We\'ll have spotters available, so no stress. Bring a lunch and drinks. If there\'s time, we\'ll consider heading to Spring Creek afterwards (advanced, optional).\n\n<strong>Rally Time</strong>: 9:45 am\n<strong>Rally Location</strong>: Safeway, Idaho Springs\n<strong>Run Leader</strong>: Craig F.','2020-11-21 17:00:00','2020-11-21 17:00:00',NULL,'INTERMEDIATE',NULL,'Safeway, Idaho Springs',0,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004tb4b76hub8tki','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','MEETING','2020 Run Planning','Let\'s get together and plan out our 2020 run season! Please come prepared with some ideas of:\n<ul>\n 	<li>Which trails you\'d like to go on</li>\n 	<li>When you would like to go there (early season, late season, etc.)</li>\n 	<li>If you\'d be willing to lead</li>\n</ul>\nKeep optional side trips in mind (camping, hot springs, hike, etc.).\n\nRemember, last year the snow didn\'t melt until June so trails at higher altitudes are better-suited for later in the year. That said, we\'ll need some trails close to town (or out of the mountains) for earlier in the year.\n\nSpace is limited, so this <em>members only meeting</em> is geared towards both past and future run leaders. That said, if you don\'t want to lead and are still interested in contributing, you\'re more than welcome!\n\n<strong>Location</strong>: Craig\'s house\n<a href=\"https://www.google.com/maps/dir//1640+Harrison+St,+Denver,+CO+80206/@39.742737,-104.9437747,17z/data=!4m9!4m8!1m0!1m5!1m1!1s0x876c7eaae1036ffb:0x46256a641b10464c!2m2!1d-104.941586!2d39.742737!3e0\" target=\"_blank\" rel=\"noopener\">1640 Harrison Street</a>\nDenver, CO 80206\n\nPlenty of street parking\n\n&nbsp;','2020-03-07 08:00:00','2020-03-08 03:00:00',NULL,'UNKNOWN',NULL,NULL,1,NULL,20,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckykkh7vn002k0700hlkexg0u','2022-01-18 20:26:40.545','2022-01-18 20:26:40.545','SOCIAL','Foskey Farewell Happy Hour','<p>Foskey is leaving Colorado! Let\'s send him off right</p>','2022-01-20 00:00:00','2022-01-20 02:00:00','Denver Sweet, 776 Lincoln St, Denver, CO 80203','UNKNOWN',NULL,'',1,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckomdpbjv0034b4b733ldeb37','2021-05-13 04:15:30.235','2021-05-13 04:15:30.235','RUN','Big Elk Meadow','<p>Trail Details: For the full run, we\'ll meet at The Old Gallery in Allenspark (14861 CO-7) at 11 am. From there we will go 3 miles north on CO-7 to Cabin Creek Rd, then 3 miles east on gravel to the Johnny Park trailhead. Then it\'s 5 miles east on 4WD road to Big Elk Meadows, which takes about 1.5 hours. This trail is mostly easy but it does include a couple of sections rated as difficult requiring high clearance. Nothing dangerous or technical. Stock rigs will need to watch wheel placement and may scrape their skid plates a few times. Lifted rigs will crawl through unscathed. It\'s rocky and airing down is recommended unless you need all the clearance you can muster. Cellular service is limited to one spot with a clear view of the plains. There are nice views of Longs Peak and Mt Meeker along the way. We should arrive in Big Elk Meadows between 1 and 2 pm. Dwain and I will be hosting a BBQ at our cabin upon arrival in Big Elk Meadows.</p>\n<p>[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]</p>\n<p>Trail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]</p>\n<p>Rally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]</p>\n<p>Rally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]</p>\n<p>Run Leader: [ESPRESSO_STAFF]</p>\n','2017-07-22 17:00:00','2017-07-22 23:00:00',NULL,'ADVANCED',NULL,'The Old Gallery, Allenspark, CO',0,NULL,-1,'ckomap3wv004713b7dbed3dqi',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx0039b4b7hhl7a4li','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Sevenmile Snow Run','An Easy-Moderate trail up north near Red Feather Lakes. They are still below average snowpack and (as of 1/27) there is about 12\"-18\" on the ground with some areas experiencing drifting conditions. The ice has built up along the creek crossings on the lower part of the trail which might require a little extra assistance to cross, but they are passable. The snow is deepest near Stump Hill and the drifting is at it\'s worst near Swamp Creek at the top of Sevenmile.\n\nRally at 10am at the <a href=\"https://www.google.com/maps/place/Centerra+Park+%26+Ride/@40.4070629,-104.9953272,467m/data=!3m1!1e3!4m13!1m7!3m6!1s0x876c1b5b3b918b77:0x45300114c183a9f3!2sCo+Rd+25+%26+Co+Rd+34,+Platteville,+CO+80651!3b1!8m2!3d40.2317174!4d-104.8299278!3m4!1s0x876eacf0122c5995:0xd9cbf2bf41889f11!8m2!3d40.4079002!4d-104.9962407\" target=\"_blank\" rel=\"noopener\">Centerra Park &amp; Ride lot</a> off I-25 at Rt 34 in Loveland','2018-02-24 17:00:00','2018-02-25 00:00:00',NULL,'UNKNOWN',NULL,'Centerra Park & Ride, Loveland',0,NULL,-1,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003hb4b7952ma3mm','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','LASALLE PASS AND GOOSE CREEK RD RUN','Rally Time: 9:45\n\nRally Place: SAFEWAY 3275 W COLORADO AVE, COLORADO SPRINGS 80904\n\nTrail Rating: 2-3','2018-06-02 15:45:00','2018-06-02 23:00:00',NULL,'EASY',NULL,'SAFEWAY 3275 W COLORADO AVE, COLORADO SPRINGS 80904',0,NULL,-1,'ckomap3wv003v13b7bwg6cusr',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx003ob4b7feswayfp','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Holy Cross Run','Trail Name: Holy Cross\n\nRally Time: 9:00 am\n\nRally Place: 2313 n Frontage Rd, West Vail Co 81657\n\nTrail Rating: 8-9   -- <strong>THIS IS A DIFFICULT TRAIL, YOU NEED TO HAVE AT LEAST A 2 INCH LIFT, 33 INCH TIRES! RECOMMENDED IS A WINCH, LOCKERS, AND TOW STRAPS..</strong>\n\nRun Leader: Mike Rahn','2018-08-04 15:00:00','2018-08-06 01:00:00',NULL,'ADVANCED',NULL,'2313 n Frontage Rd, West Vail Co 81657',0,NULL,100,'ckomap3ww004f13b75oo18ug9',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003wb4b76da0asod','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','RUN','Kelly Flats run','<a href=\"https://www.trailsoffroad.com/trails/348-kelly-flats\">More info</a> on Kelly Flats.\n\nDifficulty: 5-8\nRally info: 10am, King Soopers at 1842 N College Ave, Ft. Collins, CO\nRun leader: Doug Tear','2018-10-20 16:00:00','2018-10-20 23:00:00',NULL,'ADVANCED',NULL,'King Soopers at 1842 N College Ave, Ft. Collins, CO',0,NULL,-1,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0042b4b7cu8jaavd','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','CAMPING','Medano Pass trail run & Great Sand Dunes Nat\'l Park camping','[caption id=\"attachment_888\" align=\"aligncenter\" width=\"640\"]<img class=\"wp-image-888 size-full\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/41C17AEA-9C8B-4A41-8419-00675150D3DE.jpeg\" alt=\"\" width=\"640\" height=\"480\" /> Medano Pass Campsite-May 2019[/caption]\n\n[caption id=\"attachment_847\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-847\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/938E9242-0423-4CB6-822A-DC6BA5F3CD3D-1024x523.jpeg\" alt=\"\" width=\"1024\" height=\"523\" /> Medano Pass[/caption]\n\n[caption id=\"attachment_848\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-848\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/C3D179EC-EA17-404F-BDCB-03A50862852D-1024x570.jpeg\" alt=\"\" width=\"1024\" height=\"570\" /> Great Sand Dunes National Park[/caption]\n<ul>\n 	<li>INFORMATION UPDATED: May 11, 2019</li>\n</ul>\nDescription: This is a 2 night campout and trail run hosted by Doug Tear.   A permit for the Medano Pass trail is necessary.\n<ul>\n 	<li><strong>Note from Doug:</strong> I will be leaving early Thursday morning, hopefully by 6am, unless another Snow Storm. I still plan on going even if the trail is still closed. I want to explore around this area and do some hiking.</li>\n</ul>\nRun Leader: Doug Tear\nContact info: 970-217-4679\n<ul>\n 	<li><strong>Weather &amp; Trail</strong> Information for <em><strong><a href=\"https://www.trailsoffroad.com/trails/371-medano-pass\">Medano Pass</a></strong></em></li>\n</ul>\nMore information for <a href=\"https://funtreks.com/off-road-trails/medano-pass/\"><em><strong>Medano Pass</strong></em></a>\n\nTrail Rating: 2-5 (Easy-Moderate)\n\nRequired <a href=\"https://www.cpwshop.com/privilegepos.page\"><em><strong>Permit for Medano Pass</strong></em></a> (Covers all trails in Colorado for 2019)\n\nInformation for<strong><em> <a href=\"https://www.nps.gov/grsa/index.htm\">Great Sand Dunes Nat\'l Park camping</a></em></strong>\n<ul>\n 	<li><strong>Rally Time:</strong> After 12 Noon Thursday May 23rd</li>\n 	<li><strong>Rally Location:</strong> Remote Campsite</li>\n 	<li>We will be camping off of CR 559 about a mile after you enter the National Forest, enter the trees. This is approximately 7 miles after you turn off of Hwy 69.  I will update Thursday afternoon after I set up camp. There is limited service in spots, so more than likely will not have service at camp.</li>\n 	<li>From Westcliff take Hwy 69 for 24 miles to CR 559. There is a brown Forest Service sign with an arrow for Medano Pass. Do NOT follow Google maps! Do not turn on CR 106 or through Wolf Springs Ranch. This is all private property. Keep going to CR 559.</li>\n 	<li>From I-25, take the Walsenberg I-25 Business loop and turn on Hwy 69. Follow Hwy 69 for 34 miles to CR 559.</li>\n 	<li>Follow the forest service signs up CR 559. It is private property on both sides of the road for the first 6 miles, so do not deviate. CR 559 is pretty rutted in places so take it slow.</li>\n</ul>\n&nbsp;\n\n&nbsp;','2019-05-23 18:00:00','2019-05-27 23:00:00',NULL,'ADVANCED',NULL,NULL,0,NULL,15,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004cb4b7h5yg6d6g','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Middle St. Vrain & Coney Flats trail run','[caption id=\"attachment_911\" align=\"aligncenter\" width=\"1941\"]<img class=\"size-full wp-image-911\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/08/11581497-6910-4C77-BA72-9F2A37058EF8.jpeg\" alt=\"\" width=\"1941\" height=\"999\" /> Middle St. Vrain[/caption]\n\n[caption id=\"attachment_912\" align=\"aligncenter\" width=\"1933\"]<img class=\"size-full wp-image-912\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/08/202E6954-8732-4A9E-9D3B-9DE5B65D32D7.jpeg\" alt=\"\" width=\"1933\" height=\"991\" /> Coney Flats[/caption]\n\n********UPDATED AUG 5th********\n\nDescription: This is a 1 day out and back trail run.\n\nRun Leader: Doug Tear\n\nContact Info: 970-217-4679\n\nInformation for<em><strong> <a href=\"https://www.trailsoffroad.com/trails/376-middle-st-vrain\">Middle St. Vrain</a></strong></em>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/middle-st-vrain-coney-flats/\"><em><strong>Middle St. Vrain</strong></em></a>\n\nTrail Rating is: Difficult\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/266-coney-flats-coney-creek\"><em><strong>Coney Flats</strong></em></a>\n\nMore info for <a href=\"https://funtreks.com/off-road-trails/middle-st-vrain-coney-flats/\"><em><strong>Coney Flats</strong></em></a>\n\nTrail Rating is: Difficult\n\nRally Point: Near <a href=\"https://goo.gl/maps/9CSC8Ak4TAT7sYZ3A\"><em><strong>McDonald’s in Boulder</strong></em></a>\n\nRally Time: 9:00AM\n\n&nbsp;','2019-08-10 15:00:00','2019-08-10 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003r13b7cgfx19pg',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy0043b4b70olwad6s','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','FUNDRAISING','4-Players fundraising Beer Bust #3','<img class=\"size-thumbnail wp-image-570\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2017/04/4PC_ORIG_HiRes_JPEG-150x150.jpg\" alt=\"\" width=\"150\" height=\"150\" />\n\nThis beer bust will be held at Trade','2019-06-09 21:00:00','2019-06-10 01:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy004ab4b7hgky3wo4','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','FUNDRAISING','4-Players fundraising Beer Bust #4','<img class=\"alignleft size-thumbnail wp-image-570\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2017/04/4PC_ORIG_HiRes_JPEG-150x150.jpg\" alt=\"\" width=\"150\" height=\"150\" />\n\nThis beer bust will be held at Trade','2019-07-28 21:00:00','2019-07-29 01:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005fb4b754nsd0gh','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Johnny Park, Pierson Park run','<a href=\"https://www.trailsoffroad.com/trails/3525-pierson-park-south\" target=\"_blank\" rel=\"noopener\">Pierson Park Road info</a> | <a href=\"https://www.trailsoffroad.com/trails/345-johnny-park-road\" target=\"_blank\" rel=\"noopener\">Johnny Park Road info</a>\n\n<strong>Difficulty</strong>: Easy/Intermediate\n<strong>Details</strong>: For the most part, these are easy trails. Johnny Park Road has some optional obstacles (bypasses available). Bring a lunch/snack.\n<strong>Rally Time</strong>: 10am\n<strong>Rally Location</strong>: Circle K, 4206 Ute Hwy #66, Lyons, CO 80540\n<strong>Run Leader</strong>: Robert H. and Ernest W.','2020-10-04 21:45:00','2020-10-05 05:00:00',NULL,'INTERMEDIATE',NULL,'Circle K, 4206 Ute Hwy #66, Lyons, CO 80540',0,NULL,15,'ckomap3wv003v13b7bwg6cusr',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004jb4b7g2ka0il6','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','CAMPING','Moab UT trail run and camping $40.00 per person','[caption id=\"attachment_871\" align=\"aligncenter\" width=\"1024\"]<img class=\"size-large wp-image-871\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/4FD394F5-F2F3-4B3E-87D2-3CDD8E1DCF67-1024x683.jpeg\" alt=\"\" width=\"1024\" height=\"683\" /> Top of the World - 4-Players Moab 2018[/caption]\n\n[caption id=\"attachment_928\" align=\"aligncenter\" width=\"2048\"]<img class=\"size-full wp-image-928\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/09/fullsizeoutput_983.jpeg\" alt=\"\" width=\"2048\" height=\"1536\" /> Big Bend Group Campground Moab, UT[/caption]\n\n********UPDATED SEPTEMBER 15TH********\n\nDescription: This is the 4-Players favorite trail run and campout of the year.  We will also have the October Club Meeting.\n<ul>\n 	<li>Campsite: <a href=\"https://goo.gl/maps/t1bXrYv5iewLJ3QSA\"><em><strong>Big Bend Campground</strong></em></a></li>\n 	<li>Campsite Ready Date/Time: Thursday, September 26th at12 Noon</li>\n 	<li>Rally Time for Runs are at 8 AM Friday, Saturday and Sunday</li>\n</ul>\nCampsite Host: Tom Eskridge\n\nContact Info: 303-807-5084\n\nClub Meeting Speaker: Club President, Tom Eskridge\n\nContact Info: 303-807-5084\n\nRun Leader: Dave Martin\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/608-tower-arch\"><em><strong>Tower Arch</strong></em></a>\n\nTrail Rating is: Moderate\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/549-hells-revenge\"><em><strong>Hells Revenge</strong></em></a>\n\nTrail Rating is: Moderatre-Difficult\n\nRun Leader: Tom Eskridge\n\nInformation for <a href=\"https://funtreks.com/off-road-trails/pritchett-canyon-moab-ut/\"><em><strong>Pritchett Canyon</strong></em></a>\n\nTrail Rating is: Difficult\n\nRun Leader: Doug Tear\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/523-chicken-corners\"><em><strong>Chicken Corners Evening/Night run</strong></em></a>\n\nTrail Rating is: Easy\n\nInformation for<a href=\"https://www.trailsoffroad.com/trails/570-metal-masher\"><em><strong> Metal Masher</strong></em></a>\n\nTrail Rating is: Difficult-Extreme\n\nRun Leader: Stephen Totta\n\nInformation for <a href=\"https://www.trailsoffroad.com/trails/515-bull-canyon\"><em><strong>Bull Canyon</strong></em></a>, <a href=\"https://www.trailsoffroad.com/trails/1213-day-canyon-point\"><em><strong>Day Canyon</strong></em></a> and <a href=\"https://funtreks.com/off-road-trails/bull-canyon-day-canyon/\"><em><strong>short hike</strong></em></a>\n\nTrail Rating is: Moderate\n\nRun Leader: Andy Farr\n\nMoab Pride Parade\n\nAll Rally Time: TBD','2019-09-27 14:00:00','2019-09-30 18:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,40,'ckomap3wv003o13b71nfmfkuk',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjw0035b4b7hxraf678','2021-05-13 04:15:30.236','2021-05-13 04:15:30.236','RUN','Kingston Peak','[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]\n\nTrail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]\n\nRally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]\n\nRally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]\n\nRun Leader: [ESPRESSO_STAFF]','2017-08-27 16:00:00','2017-08-27 23:00:00',NULL,'ADVANCED',NULL,'Rollinsville Stagedoor Bar',0,NULL,-1,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjy003rb4b7hn145ci1','2021-05-13 04:15:30.238','2021-05-13 04:15:30.238','CAMPING','Black Bear Pass / Imogene Pass Campout','Trial Name: Black Bear Pass / Imogene Pass\n\nRun Leader: Steve Totta\n\nRally Place: Lake City Town Park - - 3 rd Street and Silver Street, Lake City, Co 81235\n\nRally Time: TBA\n\nTrail Ratings: 3-9\n\n<strong>Notes From Steve Totta:</strong>\n\nOk guys, Labor Day camping and wheeling is a little over a month away. We’ll be camping on Engineer Pass just outside Lake City, CO. We’ll be crawling as many of the following trails as we can.\n\n1. Engineer Pass 12,800ft (Moderate)\n2. California Gulch 12,930ft (Easy)\n3. Corkscrew Gulch, Hurricane Pass 12,407ft (Easy when dry. Moderate when wet.)\n4. Red Mountain Pass, Black Bear Pass 12,800ft (Difficult, based on the last mile of switch backs dropping into Telluride otherwise Easy to Moderate.)\n5. Imogene Pass 13,114ft (Moderate)\n6. Yankee Boy Basin 12,400ft (Moderate)\n7. Mineral Creek 12,080 ft (Difficult. Rocky and steep in places. Stock 4WD can do it with careful tire placements and patience.)\n8. Poughkeepsie Gulch 12,500ft (Difficult. Not recommended for stock vehicles.)\n9. Cinnamon Pass, Wager Gulch 12,640ft (Moderate)\n10. Picayune &amp;Placer Gulches 12,750ft (Moderate)\n11. Eureka Gulch 12,600ft (Easy)\n\nTo be able to do Black Bear Pass and return to the campsite, we will take trails 1 thru 7. It is a long day. You’ll want to pack lunch and dinner. We will start at daybreak. Pace will be important as we’ll want to be on Mineral Creek before the Sun sets. From there it’s easy in the dark.\n\nI will figure out a way to post the campsite location so you can navigate on your own. There is no cell service where we will be. Lake City has a park close to Engineer Pass. I’ll post that as well. Whomever is going, we can all work together to figure out what’s the best way to find your way to the campsite.\n\nI will be heading to Lake City Aug 30th and staying til Sept 4th.\n\nQuestions: Steve Totta 816-679-9882\n\n&nbsp;\n\n&nbsp;\n\n&nbsp;','2018-09-01 14:00:00','2018-09-03 23:00:00',NULL,'ADVANCED',NULL,'Lake City Town Park - - 3 rd Street and Silver Street, Lake City, Co 81235',0,NULL,-1,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004eb4b7b5uz3pde','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','McClellan Mountain trail run','<img class=\"aligncenter size-full wp-image-905\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/07/Screen-Shot-2019-07-12-at-3.52.36-PM.png\" alt=\"\" width=\"1438\" height=\"760\" />\n\n********UPDATED JULY 12th********\n\nDescription: This is a 1 day out and back trail run.\n\nRun Leader: Craig Freeman\n<ul>\n 	<li>Note from Craig\n<div dir=\"ltr\">\n<div>McClellan Mountain was part of the Waldorf ghost town, which had a unique railway system called the Argentine Central Railway. The route we\'ll be taking is where the tracks were laid before they were pulled up in 1919.</div>\n<div></div>\n<div>We\'ll rally at 9:00am to get an earlier start. The reports indicate that stock vehicles may have some trouble and airing down is recommended, as this is a bumpy trail. Vehicles with clearance are recommended. Bring a lunch, drinks (water), and the usual safety gear. If there\'s interest we can check out the Santiago Mine on the way up.</div>\n<div></div>\n<div>Time and weather permitting, after we partially descend from McClellan Mountain, we can consider ascending <a href=\"https://www.trailsoffroad.com/trails/203-argentine-pass\">Argentine Pass</a> (~2.5 hours).</div>\n<div></div>\n<div>Between the two trails, this is a long day. Plan to be done between 2:30 and 4:00pm.</div>\n</div></li>\n</ul>\nContact Info: 619-559-2580\n\nInformation for<em><strong><a href=\"https://www.trailsoffroad.com/trails/369-mcclellan-mountain\"> McClellan Mountain</a></strong></em>\n\nMore information for <a href=\"https://funtreks.com/off-road-trails/argentine-pass-mcclellan-mountain/\"><em><strong>McClellan Mountain</strong></em></a>\n\nTrail Rating is: Moderate\n\nRally Point: Parking lot Behind <a href=\"https://goo.gl/maps/eVUBpWSPfiwmSAzh7\"><em><strong>Valero in Georgetown (Circle K?)</strong></em></a>\n\nRally Time: 9:00 AM','2019-08-03 15:00:00','2019-08-03 22:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004ob4b7bgobgcjf','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','MEETING','4-Players Monthly Meeting','<blockquote><img class=\"aligncenter size-full wp-image-570\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2017/04/4PC_ORIG_HiRes_JPEG.jpg\" alt=\"\" width=\"2500\" height=\"2500\" /></blockquote>\nthis months meeting is at <a href=\"https://goo.gl/maps/qCoka2eN4gJ165Wm7\"><em><strong>The Drop (Planned Parenthood)</strong></em></a>\n\n&nbsp;','2019-07-09 01:00:00','2019-07-09 03:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,80,'ckomap3wv003o13b71nfmfkuk',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004wb4b76ukn7py7','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Slaughterhouse Gulch run','Details: This is mostly a beginner trail with some intermediate obstacles. I\'ve chosen to go on Sunday because the weather is supposed to be worse on Saturday. It\'s not supposed to rain until the afternoon, but prepare for rain just in case. Dress appropriately, bring water, bring a lunch (get to the rally point early and grab something from King Soopers?). Read more here: <a href=\"https://www.trailsoffroad.com/trails/463-slaughterhouse-gulch\" target=\"_blank\" rel=\"noopener\">Slaughterhouse Gulch info</a>\n\nDifficulty: Moderate\nRally Time: 9am, leaving promptly at 9:15am\nRally Location: King Soopers, Conifer, CO\n\nDue to COVID-19 restrictions, we\'re limiting the number of people to 10, max of two per vehicle please. If you are bringing a passenger, please RSVP twice (the dropdown that says how many in your vehicle doesn\'t affect the RSVP count).\n\nRun Leader: Craig F.','2020-05-31 09:00:00','2020-05-31 14:00:00',NULL,'INTERMEDIATE',NULL,'TBD',0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004ib4b7evomb6ux','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','FUNDRAISING','4-Players fundraising Beer Bust #5','<img class=\"alignleft size-thumbnail wp-image-570\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2017/04/4PC_ORIG_HiRes_JPEG-150x150.jpg\" alt=\"\" width=\"150\" height=\"150\" />\n\nThis beer bust will be held at Trade','2019-09-15 21:00:00','2019-09-16 01:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,20,'ckomap3wv003f13b72rg7d5ry',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004nb4b71orp2kg0','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Winter Event. Snowsleds in Grand Lake/Bowen Gulch Recreation Area.','<img class=\"aligncenter size-large wp-image-876\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2019/05/BD6736D6-99C3-434C-B889-768D85CF00CD-1024x666.jpeg\" alt=\"\" width=\"1024\" height=\"666\" />\n\nDescription: This is a 1 day/all day event hosted by Andy Farr.\n\nRun Leader: Andy Farr\n\nContact Info: 303-618-5229\n\nInformation for <a href=\"https://gograndlake.com/snowmobile-capital-of-colorado/\"><em><strong>Grand Lake</strong></em></a>\n<ul>\n 	<li>Details:   The lakes have frozen over, and the trails are looking great. You can rent a one/two-man sled from <a href=\"http://www.onthetrailrentals.com\"><em><strong>On The Trai lRentals website</strong></em></a> (Trailhead Location). They provide suits, helmets and boots; you provide gloves and goggles. Suggested lodgings at <a href=\"http://www.blackbeargrandlake.com\"><em><strong>Black Bear Grand Lake</strong> </em></a>(clean and reasonable), OR, I have some form of accommodations here at my cabin (contact me, first come claims the best spot). We\'ll be on the trails for 8 hours, and they have some open-terrain park areas for play. Will organize lunch/snacks. Dinner Saturday night in Grand Lake or at my cabin, depending. Reserve your sled soon.</li>\n 	<li>Rally Point: <a href=\"https://goo.gl/maps/6b8VtvgYFAj5br1M6\"><em><strong>On The Trail Rentals (Trailhead location)</strong></em></a></li>\n 	<li>Rally Time: 8:30AM</li>\n</ul>','2020-02-08 13:00:00','2020-02-09 09:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,15,'ckomap3ws000e13b7f0hf242s',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004ub4b7cr9ablek','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','CAMPING','Denver\'s St. Patrick\'s Day Parade','<img class=\"aligncenter size-large wp-image-967\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/03/2020StPaticksParadeLogo-weblogo-1024x1024.jpg\" alt=\"\" width=\"1024\" height=\"1024\" />\n\nWe will be participating in the St. Patrick\'s Day Parade being held on Saturday, March 14 at 9:30am. We have spots for up to 5 rigs to drive in the parade so if you are interested in driving or riding along, reach out to Jacob A at secretary@4-playersofcolorado.org.\n\nDetails will be available hopefully this week from the parade committee and I will share once received.','2020-03-14 07:00:00','2020-03-15 02:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00053b4b74t4xa8id','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','CAMPING','Tincup Pass / Mount Princeton run/camping','<img class=\"aligncenter size-large wp-image-1026\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/07/IMG_6740-1024x744.jpg\" alt=\"\" width=\"1024\" height=\"744\" />\n\n<strong>Run Leader: </strong>Jacob A. &amp; Taylor H.\n\n903-738-8593 or jacobadkisson@gmail.com\n\n<b>Campground</b>\n\n<a href=\"https://goo.gl/maps/P1k8DqqToHUfkkhj6\"><span style=\"font-weight: 400;\">Cascade Campground</span></a><span style=\"font-weight: 400;\"> (first come, first serve) - Taylor and I plan on leaving Denver early Wednesday (7/29) morning to get to Cascade Campground to get sites for the rest of us. If for some reason the campground is full, there are a couple of other options and I will update everyone if we have to choose differently.</span>\n\n<strong>Agenda of Trails</strong>\n\n<span style=\"font-weight: 400;\">Wednesday, July 29th - Arrival Day / Camp Setup</span>\n<ul>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cascade Campground is the first choice if they have any first come, first serve spots available. Our plan is to leave Denver Metro early Wednesday morning to try and secure some spots. </span></li>\n</ul>\n<span style=\"font-weight: 400;\">Thursday, July 30th - Trail Day 1</span>\n<ul>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Trail options for Thursday - planning on running Chinaman Gulch</span>\n<ul>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Chinaman Gulch - </span><a href=\"https://www.trailsoffroad.com/trails/255-chinaman-gulch\"><span style=\"font-weight: 400;\">Trails Offroad Info</span></a><span style=\"font-weight: 400;\"> - Difficult - Severe (6-8)</span></li>\n</ul>\n</li>\n</ul>\n<span style=\"font-weight: 400;\">Friday, July 31st - Trail Day 2 - Alpine Tunnel Loop Run ~ 45 mile loop (</span><a href=\"https://goo.gl/maps/uMvz4PMWYZoRqiNG8\"><span style=\"font-weight: 400;\">https://goo.gl/maps/uMvz4PMWYZoRqiNG8</span></a><span style=\"font-weight: 400;\">)</span>\n\n<span style=\"font-weight: 400;\">***Tincup Pass does require the </span><a href=\"https://www.cpwshop.com/privilegepos.page?e4q=9004ec06-70a0-409d-90a4-9e6b57f80cc9&amp;e4p=7fc93199-9591-4230-99d2-1f91ae9c2663&amp;e4ts=1593625299&amp;e4c=aspira&amp;e4e=snasoco01&amp;e4rt=Safetynet&amp;e4h=60c56bcd860de474e468cce61f247311\"><span style=\"font-weight: 400;\">CO OHV Permit</span></a><span style=\"font-weight: 400;\"> - $25.25 - We ordered ours last week and it arrived within a few days or you can pick up in person (see website for details)***</span>\n\n<span style=\"font-weight: 400;\">Information about each of the trails is below - majority of them are easy with Tincup Pass being the most challenging. There is a bypass around Old Tincup which is the most difficult spot. We have done this pass before in a Grand Cherokee. We will stage at St. Elmo Ghost Town before heading out on the trails - this can be a long day so would like to get an early start to ensure we are not rushed on the trail.</span>\n<ul>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Alpine Tunnel East - </span><a href=\"https://www.trailsoffroad.com/trails/321-alpine-tunnel-east#waypoint-4\"><span style=\"font-weight: 400;\">Trails Offroad Info</span></a><span style=\"font-weight: 400;\"> - Easy (1-1)</span></li>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hancock Pass - </span><a href=\"https://www.trailsoffroad.com/trails/1082-hancock-pass\"><span style=\"font-weight: 400;\">Trails Offroad Info</span></a><span style=\"font-weight: 400;\"> - Moderate (4-4)</span></li>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Alpine Tunnel West - </span><a href=\"https://www.trailsoffroad.com/trails/1069-alpine-tunnel-west\"><span style=\"font-weight: 400;\">Trails Offroad Info</span></a><span style=\"font-weight: 400;\"> - Easy (2-2)</span></li>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cumberland Pass - </span><a href=\"https://www.uncovercolorado.com/activities/cumberland-pass/#:~:text=It%20connects%20the%20old%20mining,Mountains%2C%20within%20Gunnison%20National%20Forest.\"><span style=\"font-weight: 400;\">Uncover Colorado</span></a><span style=\"font-weight: 400;\"> - Easy</span></li>\n 	<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Tincup Pass - </span><a href=\"https://www.trailsoffroad.com/trails/480-tincup-pass\"><span style=\"font-weight: 400;\">Trails Offroad Info</span></a><span style=\"font-weight: 400;\"> - Moderate - Difficult (4-6) **The difficult rating here is Old Tincup - there is a bypass.**</span></li>\n</ul>\n<span style=\"font-weight: 400;\">Saturday, August 1st - Trail Day 3 - considering running both Mount Princeton and Mount Antero on same day.</span>\n<ul>\n 	<li style=\"font-weight: 400;\"><a href=\"https://www.trailsoffroad.com/trails/2518-mount-princeton\"><span style=\"font-weight: 400;\">Mount Princeton</span></a></li>\n 	<li style=\"font-weight: 400;\"><a href=\"https://www.trailsoffroad.com/trails/390-mount-antero\"><span style=\"font-weight: 400;\">Mount Antero</span></a></li>\n</ul>\n<span style=\"font-weight: 400;\">Sunday, August 2nd - Return Day</span>\n\n<strong>REMINDERS</strong>\n\n<span style=\"font-weight: 400;\">MAKE SURE YOU REGISTER ON THE </span><a href=\"http://4-playersofcolorado.org/\"><span style=\"font-weight: 400;\">4-PLAYERS WEBSITE</span></a><span style=\"font-weight: 400;\"> SO THERE IS AN ACCURATE COUNT BY NOON ON WEDNESDAY, JULY 29TH. There is no cell phone coverage at the campground so it is important for us to know who is going to be joining us ahead of time. We will be monitoring Channel 22 on the radios so might have a chance at catching us on there if in range. If there are any changes to these plans, we will communicate accordingly. </span>\n\nIf you are interested in just joining us for a day, please email or text me so we can coordinate rally point (if different than the campsite).\n\nPlease be sure to come prepared with food, water and appropriate clothes - we all know the weather can change quickly in Colorado so plan as best as you can. Taylor and I are planning on cooking out one night (more details to come).\n\nAny questions, don\'t hesitate to reach out to Jacob A. or Taylor H.','2020-07-30 16:00:00','2020-08-02 16:00:00',NULL,'ADVANCED',NULL,'TBD',0,NULL,15,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005eb4b72e3a2jew','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Dakan Road / Upper Jackson Creek Road run','<img class=\"aligncenter size-large wp-image-1036\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/08/resized_Dakan-27-20151031-1024x768.jpg\" alt=\"\" width=\"1024\" height=\"768\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/276-dakan-road\" target=\"_blank\" rel=\"noopener\">Dakan Road info</a>\n<div dir=\"ltr\"><strong>Difficulty</strong>: Easy\n<strong>Details</strong>: Dakan Road is a very pleasant trail in the Pike National Forest near Castle Rock that runs from Perry Park Road to Rampart Range Road. It is suitable for all levels of drivers, and any stock 4x4 can run this with no problems. There are a few tremendous views of the front range. This trail can be a bit crowded so be on the lookout for traffic from dirt bikes, ATVs and other vehicles. It\'s a there and back/Loop Trail. Bring a lunch/snack.\n<strong>Rally Time</strong>: 10am\n<strong>Rally Location</strong>: Shell Station, 23 W Wolfensberger Rd, Castle Rock, CO 80109\n<strong>Run Leader</strong>: Eric M.</div>','2020-10-18 10:00:00','2020-10-18 17:00:00',NULL,'EASY',NULL,'Shell Station, 23 W Wolfensberger Rd, Castle Rock, CO 80109',0,NULL,10,'ckomap3wv003j13b7fdylcckg',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00058b4b71vg26omb','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','China Wall run','<a href=\"https://www.trailsoffroad.com/trails/254-china-wall#waypoint-2\" target=\"_blank\" rel=\"noopener\">China Wall info</a>\n<strong>\nDifficulty:</strong> Difficult\n<strong>\nDetails:</strong> This is an advanced trail with optional bypasses for all but one obstacle. The trail is dirt and rock all the way through with some obstacles and steep inclines along the way. High clearance vehicles only. Bring a lunch and a chair if desired, we\'ll have lunch by the creek.\n<strong>\nRally Time:</strong> 10:00 am\n<strong>\nRally Location:</strong>\nChina Wall Trailhead: <a href=\"https://goo.gl/maps/9uMbnhd7mohtYpiM7\">https://goo.gl/maps/9uMbnhd7mohtYpiM7</a>\n39°06\'38.1\"N 105°28\'23.2\"W\nDirections: <a href=\"https://goo.gl/maps/PKTSsSmYzovNBDdA9\">https://goo.gl/maps/PKTSsSmYzovNBDdA9</a>\n\n<strong>Run Leader:</strong> Craig F.','2020-10-18 10:00:00','2020-10-18 17:00:00',NULL,'ADVANCED',NULL,'China Wall Trailhead,',0,NULL,15,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004vb4b7gea904a3','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','Switzerland Trail / Pennsylvania Gulch run','<img class=\"aligncenter size-large wp-image-1015\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/05/IMG_4537-1024x568.jpg\" alt=\"\" width=\"1024\" height=\"568\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/474-switzerland-trail\" target=\"_blank\" rel=\"noopener\">Switzerland Trail info</a> - <a href=\"https://www.trailsoffroad.com/trails/413-pennsylvania-gulch\" target=\"_blank\" rel=\"noopener\">Pennsylvania Gulch info</a>\nDetails:\n<p style=\"font-weight: 400;\">We will be doing the run this weekend for Switzerland Trail and Pennsylvania Gulch.  I checked the Boulder County Website and didn’t find any restrictions on non-residents.</p>\n<p style=\"font-weight: 400;\">Switzerland Trail is an easy trail for vehicles with high clearance.  Pennsylvania Gulch is rated moderate, more difficult when wet.</p>\n<p style=\"font-weight: 400;\">Depending on weather and attendance we will take the Pennsylvania Gulch cutoff. Those who wish, may proceed on Switzerland Trail and we will meet up where the trails merge again.</p>\n<p style=\"font-weight: 400;\">Please come prepared to practice social distancing, and have everything you need for the day.  I would prefer to avoid visiting any businesses in Boulder or Nederland.  Bring water, snacks, and lunch for on the trail.</p>\n<p style=\"font-weight: 400;\">The weather looks to be cool with possibility of rain, please dress accordingly , rain gear, warm jacket etc.</p>\n<strong>Note: Max of 10 attendees per <a href=\"https://covid19.colorado.gov/safer-at-home/safer-at-home-local-and-personal-recreation\" target=\"_blank\" rel=\"noopener\">the Safer-at-Home order</a></strong>\n\nRun Leader: Doug T.\n\nDifficulty: <span style=\"color: #ffffff;\">Easy - Moderate</span>\nRally Time: 9:00am; departing at 9:30am\nRally Location: <a href=\"https://goo.gl/maps/DdXxAEWPh32asVpK8\">Kings Soopers</a> in Sunrise Center Parking Lot; 1650 30th St., Boulder, CO 80301\n\nThe trailhead is about 45 minutes away  via Nederland and the Peak to Peak hwy.  We will return via Sugarloaf to Boulder.\n<p style=\"font-weight: 400;\"></p>','2020-05-16 21:30:00','2020-05-17 04:00:00',NULL,'INTERMEDIATE',NULL,'Kings Soopers in Sunrise Center Parking Lot; 1650 30th St., Boulder, CO 80301',0,NULL,10,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00055b4b7fqoi4067','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','Holy Cross run','<img class=\"aligncenter size-full wp-image-1030\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/07/holycross.jpg\" alt=\"\" width=\"960\" height=\"600\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/1872-holy-cross-city\" target=\"_blank\" rel=\"noopener\">Holy Cross City info</a>\nDifficulty: Difficult\nDetails: This trail is rated 7-10/10<span data-v-43ae1a3f=\"\" data-v-1a17fafe=\"\"> </span>(<span data-v-bdb64a96=\"\">SEVERE</span> <span data-v-bdb64a96=\"\">- EXTREME</span>). Required equipment for this trail includes a winch, 33\'\' or larger tires, locking differentials, and various recovery and repair equipment. Jeep Badge opportunity. Bring a lunch and plenty of liquids and expect to be out for awhile. This is a popular trail and damaged/disabled vehicles may cause backups.\nRally Time: 7:30am\nRally Location: Frisco Kum &amp; Go station, 55 Lusher Ct, Frisco, CO 80443\nRun Leader: Jacob A. &amp; Taylor H. or Tom E.','2020-08-15 07:30:00','2020-08-15 16:00:00',NULL,'ADVANCED',NULL,'Frisco Kum & Go station, 55 Lusher Ct, Frisco, CO 80443',0,NULL,6,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00054b4b72tvtfi7z','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','Argentine Pass / McClellan Mtn run','Let\'s try it again!\n\n<a href=\"https://www.trailsoffroad.com/trails/203-argentine-pass\" target=\"_blank\" rel=\"noopener\">Argentine Pass info</a> - <a href=\"https://www.trailsoffroad.com/trails/369-mcclellan-mountain\" target=\"_blank\" rel=\"noopener\">McClellan Mtn info</a>\nDifficulty: Moderate\nDetails: There\'s a lot of mining history in these hills. The trail is rocky and can be bouncy at times. There are no large obstacles, so higher clearance stock vehicles shouldn\'t have a problem. These are high-altitude trails that go above treeline and eventually turn into shelf roads towards the top. Make sure you bring enough water and emergency supplies. We\'ll stop and have lunch at some point along the way. If we get enough attendees, we\'ll split into two groups.\nRally Time: 9:30am\nRally Location: behind the Circle K convenience store, 1501 Argentine St, Georgetown, CO 80444\nRun Leader: Craig F.','2020-08-09 09:30:00','2020-08-09 16:30:00',NULL,'INTERMEDIATE',NULL,'behind the Circle K convenience store, 1501 Argentine St, Georgetown, CO 80444',0,NULL,16,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005db4b7fuffgvet','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Yankee Doodle Lake / Apex Ghost Town run','<img class=\"alignnone size-large\" src=\"https://s3.us-west-2.amazonaws.com/images-prod.trailsoffroad.com/trails/438/waypoints/0/resized_20160717_144240_HDR.jpg\" width=\"1440\" height=\"810\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/438-rollins-pass-east\" target=\"_blank\" rel=\"noopener\">Rollins Pass info (Yankee Doodle Lake)</a>\n\n<strong>Details:</strong>\n\nEasy run from Blackhawk to Yankee Doodle Lake\n\nMost all of the way will be County Rd/Forest Roads There is one rocky portion, to Yankee Doodle, but any stock 4x4 can make it with now issues.\n\n<em>If you need to fuel up do it before Black Hawk</em>, as there is no option for fuel there.\n\nWe will meet at the Post office in Black Hawk at 10am, 145 Clear Creek St, Black Hawk, CO 80422  (Just before and across from the fire station just past the Ameristar Casino)\n\nFrom Blackhawk we will go up Apex Valley to the old Ghost town of Apex, then the back way  to Tolland CO, then up to the East Portal of the Moffet tunnel and then up to Yankee Doodle Lake. if the USFS would open the old road, we could drop down into Winter Park, but the route over the Continental Divide has been closed for years. So, we will make a U turn and come back down along Boulder Creek and into Rollinsville, Or depending on Rigs, and Time we can come back to Apex and Drop down thru Pickle Gulch (this would be moderate)\n\nIt should be about a <em>2-hour run ONE WAY so pack a lunch</em>! And bring your camera, some nice Mountain views, and if you’ve never seen the tunnel we can stop there and see if there is a light at the end of it\n\n<strong>Difficulty</strong>: Easy\n<strong>Rally Time</strong>: 10:00am\n<strong>Rally Location</strong>: Black Hawk Post Office, 145 Clear Creek St, Black Hawk, CO 80422\n<strong>Run Leader</strong>: Dan R.\n\n&nbsp;\n\n&nbsp;','2020-07-26 10:00:00','2020-07-26 14:00:00',NULL,'EASY',NULL,'Black Hawk Post Office, 145 Clear Creek St, Black Hawk, CO 80422',0,NULL,10,'ckomap3wv004413b73x7b04cy',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005kb4b7akx28t9e','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Intro to Recovery Clinic','<img class=\"aligncenter size-full wp-image-1086\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2021/03/4X4-recovery-winching.jpg\" alt=\"\" width=\"1023\" height=\"465\" />\n\nThis is a private class with a <a href=\"https://i4wdta.org/\" target=\"_blank\" rel=\"noopener\">I4WDTA</a>-certirifed instructor from On Trail Training. <a href=\"https://www.ontrailtraining.com/\" target=\"_blank\" rel=\"noopener\">More info</a>.\n\nDate: <span style=\"text-decoration: line-through;\">Saturday, April 17th, 2021</span> Rescheduled for Saturday, May 1st, 2021\nTime: 9am - 5pm\nRally Location: <a href=\"https://goo.gl/maps/1KiLtnUukDQrbFdM6\" target=\"_blank\" rel=\"noopener\">Pine Junction Park and Ride on 285</a>\nTraining Location: Deckers, CO\nCost: $52/person\n\nThis class aims to provide a solid foundation and understanding of recovery equipment and techniques. Topics including scene assessment, recovery calculations, selecting gear, inspection, maintenance, and use of all types of equipment. This class breaks down recoveries in a methodical manner examining the how and why of safely recovering a stuck vehicle.\n\nWe\'ll meet at the Pine Junction Park and Ride on 285 (location below) at 9am. We can leave vehicles there if need be. There is a small store next door if you need any last minute supplies. This is the last spot we will have cell service so we can find any stragglers. From there we will convoy to the trail about 30 minutes south in Deckers.\n\nWe will set up our classroom in a campsite on an extremely easy trail. We will be in one spot all day. For class you will want to bring:\n<ul>\n 	<li>Work gloves preferably with no velcro</li>\n 	<li>Camp chair</li>\n 	<li>Notebook/pen</li>\n 	<li>Lunch/drinks for the day</li>\n 	<li>If you have a winch everything you need to operate it</li>\n</ul>\nPlease check the weather in advance and wear the appropriate layers and warm footwear, as we will be outside all day in an area with few trees. Class typically wraps up around 5pm. We can bring firewood and a small pop up tent for some cover, if needed.\n\n<strong>Terms and conditions</strong>:\n<ul>\n 	<li><span style=\"text-decoration: line-through;\">First 10 people to register who want to bring their vehicles will get a vehicle spot (max of 10)</span>. Max has been reached, remaining attendees will need to carpool from the meeting spot</li>\n 	<li>Class has a limit of 20 attendees and you must pay in advance to reserve your spot</li>\n 	<li>A waitlist will be available</li>\n 	<li>Space is limited, so you may not bring a guest. If husband/partner/boyfriend would like to attend, they must register and pay for themselves.</li>\n 	<li>Your payment is non-refundable - if you cannot attend, you\'ll have to arrange someone on the waitlist to take your place and receive payment from them</li>\n</ul>\nNote: We <em>can</em> set up more than one class, so if you don\'t get a spot this time around, there will be other opportunities in the near future','2021-05-01 16:00:00','2021-05-02 16:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,19,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckykkjiwe002y07001ekktj2a','2022-01-18 20:28:28.14','2022-02-05 14:38:58.299','MEETING','2022 Run Planning Meeting','<p><span style=\"color: rgb(32, 32, 32);\">Run Leaders and any one interested in leading a run, please plan on attending to help us form a great line up of new adventures for our upcoming season! We really want to accommodate all skill levels and all different types of rigs, so we\'d love your input. If you can\'t make it, please send any questions or suggestions to any one of the officers in advance.</span></p>','2022-02-12 22:00:00','2022-02-13 00:00:00','Denver Sweet, 776 Lincoln St, Denver, CO 80203','UNKNOWN',NULL,'',1,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('ckomdpbjx003ib4b730zy3xx7','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','RAINBOW FALLS RUN','RAINBOW FALLS RUN\n\nRALLY TIME: 10:00 am\n\nRALLY PLACE:  Loaf \'n Jug   519 US-24, Woodland Park, CO 80863\n\nTRAIL RATING: 4-5\n\nRUN LEADER: Ryan McCoy','2018-06-16 16:00:00','2018-06-16 23:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3ww004e13b7bkun6qee',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005nb4b749eq879c','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Switzerland Trail run','<span data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Meet at King Soopers 1650 30th St Boulder· In Sunrise Center 9:00 AM MDT. Depart 9:15 AMnMDT sharp.nThis is an easy run to get out on the trails early in the year. Nearly the entire route is a shelfnroad offering spectacular views of the nearby foothills and the snow-capped peaks to the west.nThe trail follows an old railroad route from Sugarloaf Mountain to the community of Gold Hill. Wenwill start the trail off Sugar loaf mountain road at the Sugarloaf mountain trailhead.nTrail Head 40° 1&amp;#39; 29.9&amp;quot;N 105°25&amp;#39;29.3&amp;quot;W 40.024992, -105.42481nDue to the popularity of the trail, we will leave early and the run is limited to 12 rigs. We will runnthe trail to the end and back.nIf there is interest, we will run Pennsylvania Gulch on the way back. It is a short intermediatentrail and provides a some more challenging terrain.nnhttps://www.trailsoffroad.com/trails/474-switzerland-trailnhttps://www.trailsoffroad.com/trails/413-pennsylvania-gulch&quot;}\" data-sheets-userformat=\"{&quot;2&quot;:1049345,&quot;3&quot;:{&quot;1&quot;:0},&quot;11&quot;:0,&quot;12&quot;:0,&quot;23&quot;:1}\">This is an easy run to get out on the trails early in the year. Nearly the entire route is a shelf road offering spectacular views of the nearby foothills and the snow-capped peaks to the west. The trail follows an old railroad route from Sugarloaf Mountain to the community of Gold Hill. We will start the trail off Sugar loaf mountain road at the Sugarloaf mountain trailhead. </span>\n\n&nbsp;\n\nTrails: <a href=\"https://www.trailsoffroad.com/trails/474-switzerland-trail\">Switzerland Trail</a> | <a href=\"https://www.trailsoffroad.com/trails/413-pennsylvania-gulch\">Pennsylvania Gulch</a>\n\n&nbsp;\n\nDate: Sat 5/8/21\nTime: <span data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Meet at King Soopers 1650 30th St Boulder· In Sunrise Center 9:00 AM MDT. Depart 9:15 AMnMDT sharp.