entrail and provides a some more challenging terrain.nnhttps://www.trailsoffroad.com/trails/474-switzerland-trailnhttps://www.trailsoffroad.com/trails/413-pennsylvania-gulch&quot;}\" data-sheets-userformat=\"{&quot;2&quot;:1049345,&quot;3&quot;:{&quot;1&quot;:0},&quot;11&quot;:0,&quot;12&quot;:0,&quot;23&quot;:1}\">If there is interest, we will run Pennsylvania Gulch on the way back. It is a short intermediate trail and provides a some more challenging terrain.\n</span>','2021-05-08 16:00:00','2021-05-09 16:00:00',NULL,'EASY',NULL,NULL,0,NULL,17,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005bb4b79hx55oil','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','CAMPING','Annual Moab runs/camping trip','<img class=\"aligncenter size-large wp-image-1034\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/08/fins-1024x474.jpg\" alt=\"\" width=\"1024\" height=\"474\" />\n\n<strong>Sample runs</strong>: Metal Masher - Steel Bender - Tower Arch - Fins N Things - Hells Revenge\n\n<strong>Difficulty</strong>: Easy to Difficult\n\n<strong>Details</strong>: Our annual Moab camping trip! Runs will be decided when we are in town. There\'s been interest expressed for Metal Masher and Steel Bender, but we aim to have an easy and difficult run for each day. This year, the cost for members is $35 and the cost for guests is $45. Remember, this terrain is considered high desert, so please plan accordingly. Bring rain gear and plenty of water.\n\n<strong>Please plan on eating dinner with the club on Saturday. The club will provide food, just bring drinks, a chair, and your appetite.\n</strong>If you have any dietary restrictions, please email vicepresident@4-playersofcolorado.org\n\nRemember that we usually have a lot of people to fit into the two campsites, each with varied camping setups. Please work with each other to make sure that we can comfortably fit in the sites, which may mean we need to be a little flexible with our arrangements and/or parking. For example, you may not be able to use your RV\'s side awning if the parking lot is full. If there are any issues, please talk to an officer.\n\nIf you arrive midday on Thursday and leave on Monday morning, there\'d be 7 meals to cook (not including Saturday dinner, which the club is providing). In the past, some of us have shared breakfast and dinner cooking duties - cook once or twice and you\'re done for the weekend. If you\'re interested in cooking with a small group for the rest of the weekend, please fill out this form and we can facilitate breaking up the interested parties into groups. Groups won\'t be larger than 5 and we\'ll leave it up to the group to determine when people arrive/leave and when they want to cook. BYO lunch foods and drinks.\n\n<strong>Arrival Date</strong>: Thursday, Sept 24, 2020\n<strong>Departure Date</strong>: Monday, Sept 28, 2020\n<strong>Location</strong>: Moab Big Bend Campsites A &amp; B, 7 miles upriver of junction US191 and UT128 in Moab, UT 84532','2020-09-24 16:00:00','2020-09-28 16:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,40,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005jb4b75j7xdcmx','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','CAMPING','Ice Racing on Georgetown Lake','<img class=\"aligncenter size-large wp-image-1072\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2021/01/Ice-Racing-1024x683.jpg\" alt=\"\" width=\"1024\" height=\"683\" />\n\n<strong>Sunday Fun Day Track</strong> is specifically for people who just want the experience of driving on ice without the pressure of competition. Entrants will have a dedicated track to take as many practice laps as they can make within a 4 hour window. The entry price is a bit higher due to the guaranteed time window, but is charged per vehicle, so it can be split amongst multiple drivers. You must register for the event on their <a href=\"https://www.motorsportreg.com/index.cfm/event/event.requirements/uidEvent/E32D173C-C5FA-A53A-7DE319D8218372C1\">website</a> by February 5th, 2021! As of 1/22, there were 12 spots available and spots are filling up quickly so if you will want to sign up quick! If you are interested in just coming out and watching, you are more than welcome to without having to sign up.\n\nRun Leaders: Jacob A. and Taylor H.\n\nEvent Date: Sunday, February 7th\n\nEntry fee is $52.99 per vehicle (up to 4 drivers)\n\nRegistration/Check-in Time: 7:30am - 8:30am\n\nDriver Orientation: 9:00am','2021-02-07 18:00:00','2021-02-07 13:00:00',NULL,'UNKNOWN',NULL,NULL,0,NULL,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl26bmmqs008907895zhkyy6y','2022-04-19 15:48:59.416','2022-04-20 15:45:05.004','MEETING','Winch Maintenance Party','<p>Haven\'t used your winch in awhile? Let\'s get it prepped for the upcoming season by doing some inspection and maintenance. We\'ll take a look at the critical components, clean them as-needed, inspect the synthetic/wire rope for damage or wear, wash the ropes, and re-tension the lines. This is a members-only event.</p>','2022-04-23 16:00:00','2022-04-23 21:00:00','5953 S Quintero Ct, Aurora CO 80016','UNKNOWN',NULL,'',1,-1,-1,'ckomap3wv003j13b7fdylcckg',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckomdpbk1005gb4b7cwlm3lou','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Rainbow Falls run','<img class=\"aligncenter size-full wp-image-1040\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/08/rainbowfalls.jpg\" alt=\"\" width=\"370\" height=\"278\" />\n\n<a href=\"https://funtreks.com/off-road-trails/rainbow-falls-ohv-area/\" target=\"_blank\" rel=\"noopener\">Rainbow Falls info</a>\n\nDifficulty: Easy\nDetails: This route has fun elevation changes and a few introductory rocky surfaces. Bring a lunch and drinks.\n\nRally Time: 9:30 am\nRally Location: City Market, 777 Gold Hill PL S. Woodland Park CO 80863\nRun Leader: Mike V-N\n\n<img class=\"wp-image-1041 alignleft\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/08/118138555_310486610376156_3647635320757606795_n-473x1024.png\" alt=\"\" width=\"333\" height=\"721\" />','2020-09-12 09:30:00','2020-09-12 17:00:00',NULL,'EASY',NULL,'City Market, 777 Gold Hill PL S. Woodland Park CO 80863',0,NULL,10,'ckomap3ww005713b7f3juf7u0',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjx0038b4b7b1j4d5o0','2021-05-13 04:15:30.237','2021-05-13 04:15:30.237','RUN','Mt Herman Winter Run','[ESPRESSO_VENUE show_title=false show_google_map_link=false show_address=false show_map_image=false]\n\nTrail Difficulty: [EE_META type=\"event_meta\" name=\"trail_difficulty\"]\n\nRally Place: [EE_META type=\"event_meta\" name=\"rally_place\"]\n\nRally Time: [EE_META type=\"event_meta\" name=\"rally_time\"]\n\nRun Leader: [ESPRESSO_STAFF]','2018-02-04 17:00:00','2018-02-05 00:00:00',NULL,'EASY',NULL,'Safeway, Monument CO',0,NULL,-1,'ckomap3ww004f13b75oo18ug9',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbjz004sb4b727f02380','2021-05-13 04:15:30.239','2021-05-13 04:15:30.239','RUN','4-Players Christmas Party','Our annual Christmas party and December membership meeting!\n\nFrom 3:00pm - 5:00pm at McCoy’s Restaurant, 4855 Federal Blvd, Denver, CO 80221.\n\nMeals will be taken care of by the club for you and your partner/partners. Alcohol is on your own bill.','2019-12-15 22:00:00','2019-12-16 00:00:00',NULL,'UNKNOWN',NULL,NULL,1,NULL,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00050b4b7g5goc5wl','2021-05-13 04:15:30.24','2021-05-13 04:15:30.24','RUN','Chinn\'s Lake run','<a href=\"https://www.trailsoffroad.com/trails/256-chinns-lake\" target=\"_blank\" rel=\"noopener\">Chinn\'s Lake info</a>\nDetails: Very easy in and out run. Plan on a lunch break at the lake.\nDifficulty: Easy\nRally Time: 9am\nRally Location: Safeway, 2425 Miner St, Idaho Springs, CO 80452\nRun Leader: Tom E.','2020-07-11 09:00:00','2020-07-11 14:00:00',NULL,'EASY',NULL,'Safeway, 2425 Miner St, Idaho Springs, CO 80452',0,NULL,20,'ckomap3wv003o13b71nfmfkuk',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk00059b4b74jc3g366','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Devil\'s Canyon run','<a href=\"https://www.trailsoffroad.com/trails/281-devils-canyon\" target=\"_blank\" rel=\"noopener\">Devil\'s Canyon info</a>\n<strong>Difficulty</strong>: Moderate\n<strong>Details</strong>: Devil\'s Canyon is rated 3-5 moderate by Trails Offroad. The trail is shaped like a lollipop and goes to about 10k ft of elevation. It travels through dense forest and some open meadows and should be a good run for fall colors. Pack a lunch, we can eat at the top.\n<strong>Rally Time</strong>: 10:30 am\n<strong>Rally Location</strong>: Safeway in Idaho Springs\n<strong>Run Leader</strong>: Steve T.','2020-10-10 10:30:00','2020-10-10 15:00:00',NULL,'INTERMEDIATE',NULL,'Safeway, Idaho Springs',0,NULL,15,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005hb4b7bdki8a51','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Switzerland Trail snow run','<img class=\"aligncenter size-large wp-image-1064\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2020/12/switzer-1024x576.jpg\" alt=\"\" width=\"1024\" height=\"576\" />\n\n<a href=\"https://www.trailsoffroad.com/trails/474-switzerland-trail\" target=\"_blank\" rel=\"noopener\">Switzerland Trail info</a>\n\n<strong>Difficulty</strong>: Easy\n<strong>Rally Time</strong>: 9:00 am\n<strong>Details: </strong>Be sure you are prepared for every condition possible and bring any recovery gear you may have. Winter runs can be challenging, even on the easiest trails.<strong>\n</strong><strong>Rally Location</strong>: King Soopers, 30th and Arapaho, Boulder near the Starbucks\n<strong>Run Leader</strong>: Jacob &amp; Taylor','2020-12-27 17:00:00','2020-12-27 17:00:00',NULL,'EASY',NULL,'King Soopers, 30th and Arapaho, Boulder',0,NULL,6,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckomdpbk1005mb4b79dg5e6og','2021-05-13 04:15:30.241','2021-05-13 04:15:30.241','RUN','Anniversary Run (UPDATED)','<img class=\"aligncenter size-large wp-image-1112\" src=\"http://members.4-playersofcolorado.org/wp-content/uploads/2021/03/35A-1024x686.jpg\" alt=\"\" width=\"1024\" height=\"686\" />\n\n<strong>NOTE: We’re going to postpone this run until later in the year due to impending winter storms. </strong>\n\nWe\'ll meet to take a photo of current full, associate, and emeritus members will be taken at Red Rocks park near the amphitheater. We can adjoin to a nearby brewery afterwards.\n\nDate: Sat 4/24/21\nTime: 2:00 pm\nRally Location: Upper North parking lot of Red Rocks Park &amp; Amphitheater - <a href=\"https://www.google.com/maps/dir//39.6682586,-105.206215/@39.6676597,-105.2065124,251m/data=!3m1!1e3!4m2!4m1!3e0\" target=\"_blank\" rel=\"noopener\">Directions</a>\n\n&nbsp;\n\n<hr />\n\n<strong>TO RESCHEDULE LATER IN THE YEAR:</strong>\n\nPlease join us in kicking off our year-long celebration of the club\'s 35-year history on our Anniversary Run to Apex Valley. This is a members-only event (have you paid your dues yet?) and all vehicle types are encouraged to attend.\n\nTrails: <a href=\"https://www.trailsoffroad.com/trails/3814-apex-valley-road\" target=\"_blank\" rel=\"noopener\">Apex Valley Rd</a> | <a href=\"https://www.trailsoffroad.com/trails/2599-elk-park-road\" target=\"_blank\" rel=\"noopener\">Elk Park Rd</a> | <a href=\"https://www.trailsoffroad.com/trails/2011-mosquito-creek-road\" target=\"_blank\" rel=\"noopener\">Mosquito Creek Rd</a>\n\nDate: TBD\nTime: TBD\nDifficulty: Easy\nRally Location: Valero at the exit for Central City Parkway - 2195 East Idaho Springs Road, Idaho Springs, CO 80452\nRun Leader: Craig F, President\n\nBring a lunch and a chair. Please check the weather in advance and wear the appropriate layers, bring drinks and snacks. If we finish early, we can get a late lunch in town','2021-04-24 16:00:00','2021-04-25 16:00:00',NULL,'UNKNOWN',NULL,NULL,1,NULL,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('ckzek85p300380751g0tl4a4i','2022-02-08 20:12:43.095','2022-02-10 01:26:44.802','SOCIAL','Denver Saint Patrick\'s Day Parade','<p>Remember before the pandemic we signed up for the Saint Patrick\'s Day Parade? Well, it looks like it is finally happening! We have a max capacity of 5 rigs to participate in the parade!</p>','2022-03-12 16:30:00','2022-03-12 22:00:00','TBD','UNKNOWN',NULL,'TBD',1,7,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckzek1fw6002u0751my4vlsfz','2022-02-08 20:07:29.681','2022-02-23 23:26:49.233','SOCIAL','Avalanche Pride Night','<p>***Updated 2/23***</p><p>Pride Night at the Avalanche Game - tickets have been purchased! Game starts at 8:00pm at Ball Arena. We have dinner reservations for Rio Grande downtown on Blake Street at 5:30pm. Then we can ride/walk over to the game!</p>','2022-03-06 03:00:00','2022-03-06 06:00:00','1000 Chopper Circle, Denver, CO 80204','UNKNOWN',NULL,'',1,-1,-1,'ckomap3ww004t13b7h7d0e136','cl006rjxs003607648nq714rq','ckomap3ww004t13b7h7d0e136',0),('cl0ftwpa1001l07927qb1w10f','2022-03-06 22:11:13.216','2022-03-07 02:48:28.956','SOCIAL','Frozen Dead Guy Days','<p>Frozen Dead guy days is back.&nbsp;</p><p><strong>Tavel&nbsp;and Leisure&nbsp;</strong>Magazine<strong>:&nbsp;Frozen Dead Guy Days Is the Weirdest Winter Festival in the U.S.</strong></p><p>Join us for some winter fun while the trails are closed. For those of you&nbsp;that are&nbsp;unaware of how this strange festival came to be:&nbsp;</p><p>Frozen Dead Guy&nbsp;Days’&nbsp;started when&nbsp;Bredo&nbsp;Morstoel, a public official from&nbsp;<a href=\"https://www.travelandleisure.com/travel-guide/norway\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 255);\">Norway</a>&nbsp;died in 1989.&nbsp;After his death, his grandson Trygve&nbsp;Bauge&nbsp;had his body sent to a San Francisco-based cryonics lab called&nbsp;<a href=\"https://www.transtime.com/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 255);\">Trans Time</a>&nbsp;to be preserved (frozen) with the hope that science would one day cure his grandfather’s ailments.</p><p>While&nbsp;Morstoel&nbsp;was being preserved,&nbsp;Bauge&nbsp;built a cryonics chamber inside a Tuff Shed at his home in Nederland, Colorado — outfitting it to withstand all kinds of natural and manmade disasters. There,&nbsp;Bauge’s&nbsp;grandfather (and a few other frozen bodies that had been sent to&nbsp;Bauge’s&nbsp;“lab”) remained for a few years.</p><p>Unfortunately, in the mid-90s,&nbsp;Bauge&nbsp;was sent back to&nbsp;<a href=\"https://www.travelandleisure.com/travel-tips/travel-trends/beautiful-landscapes-cities-norway-photos\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 255);\">Norway</a> and the frozen body was left with his mother in Colorado. The other bodies from&nbsp;Bauge’s&nbsp;fledgling cryonics lab were returned to their families.&nbsp;Bauge&nbsp;now pays a man to deliver between 900 and 1,200 pounds of fresh dry ice every two weeks to cover his grandfather’s sarcophagus — which can still be found in Nederland.</p><p>Since&nbsp;Bauge&nbsp;left the country, the story of grandpa&nbsp;Bredo&nbsp;and the failed cryonics facility have become part of the local history. And in 2002, the “Frozen Dead Guy” was suggested as a theme for the town’s winter festival (perhaps jokingly), at first. Yet the theme stuck, and the story has become part of Colorado’s culture.</p><p>Join&nbsp;us&nbsp;on Saturday March 19th&nbsp;at the Kings Soopers in Boulder,1650 30th&nbsp;St in the Sunrise Center at 10 am. (Weather permitting). It is best to car pool up to Nederland. I suggest to purchase&nbsp;a&nbsp;ticket to the entertainment tents to get a drink, or warm up a bit if needed. Tickets are 25.00 online in advanced. I&nbsp;would wait&nbsp;until&nbsp;that week&nbsp;to see what the weather&nbsp;will be like.&nbsp;</p><p>Some of the events:</p><p>3 Tents with live music.&nbsp;</p><p>Parade of Herse’s&nbsp;</p><p>Coffin Race</p><p>Polar&nbsp;Plunge</p><p>&nbsp;</p><p>Plan to dress for winter weather in layers. Nederland can be windy in the winter.&nbsp;</p><p>You&nbsp;can register for&nbsp;the Polar Plunge for&nbsp;a $10 fee. If&nbsp;any brave souls&nbsp;are interested.&nbsp;</p><p>Check the link below to see the schedule of events and to purchase tickets.&nbsp;</p><p><a href=\"https://frozendeadguydays.com/2022-event-schedule/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 255);\">https://frozendeadguydays.com/2022-event-schedule/</a></p>','2022-03-19 16:00:00','2022-03-19 21:00:00','','UNKNOWN',NULL,'King Soopers, 1650 30th St, Boulder, CO 80301',0,-1,-1,'ckomap3wv003n13b77iqfhwv1','cl0g3t9go006407923wooj50i','ckomap3wv003s13b79xoq6fdt',0);
INSERT INTO `event` (`id`,`created_at`,`updated_at`,`type`,`title`,`description`,`start_time`,`end_time`,`address`,`trail_difficulty`,`trail_notes`,`rally_address`,`members_only`,`max_attendees`,`max_rigs`,`host`,`featured_image`,`creator`,`change_disabled`) VALUES ('cl27pkqi400oj0728micaggwc','2022-04-20 15:07:11.788','2022-06-20 21:28:47.237','SOCIAL','Denver Pride Parade','<p>Denver Pride Parade is back in person and we have secured 6 rigs for to participate in the parade! The following drivers will be in the parade but if you are interested in marching in the parade with our float, please sign up below. We can have up to 50 people total as part of our entry.</p><p><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSe90KonOdfGCWIkbOkNp1Ufy5xWaZdnxbG11m38mrR0MI0V7w/viewform?usp=sf_link\" rel=\"noopener noreferrer\" target=\"_blank\">Denver Pride Parade Marcher Sign Up</a></p><p><a href=\"https://docs.google.com/document/d/1o5TA10fuVVB4rCHJspnXO8toUQj2INYhylcJgd5r45A/edit?usp=sharing\" rel=\"noopener noreferrer\" target=\"_blank\">Denver Pride Parade Information</a></p><p>Drivers - Todd H., Joe S., Arend R., Taylor H., Tom E., Dave C.</p><p>Any questions, please reach out to Jacob A.</p>','2022-06-26 15:30:00','2022-06-26 21:00:00','TBD','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww004t13b7h7d0e136','cl27pzpe800xq0728i00vit4m','ckomap3ww004t13b7h7d0e136',0),('cl27ofaan00hk07281gw0jb36','2022-04-20 14:34:57.886','2022-07-05 16:30:36.753','RUN','Sports Car Tour','<p>Let\'s dust off those 2WD/AWD vehicles! This is a run for those looking to do some on-roading in their sports cars.</p><p><br></p><p><br></p><p><span style=\"color: rgb(0, 0, 0);\">This drive takes us south to Cañon City, but we take the long way via Deckers and Cripple Creek. We stop in Cripple Creek with a visit to the heritage center. The heritage center contains a lot of history about the area and mining operations. We leave Cripple Creek and head west following the Gold Belt Tour for a short portion. Once we get close to Cañon City we will drive up and over skyline drive. Ever driven skyline drive in Cañon City? Skyline drive is a single lane, one way road over the hog back just to the west of Cañon City. It provides you with great views of the area, just keep your eyes on the road. You can always bypass it if you don’t feel comfortable driving the single lane road on top of the hog back. Once we reach downtown Cañon City, our tour ends, and you are free to find your favorite lunch destination. </span></p><p><span style=\"color: rgb(0, 0, 0);\">There are several options for your return drive to the Denver area. The quickest return to Denver will take you 1 hour 45 minutes.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Total tour time is estimated at 4 hours.</span></p><p><span style=\"color: rgb(0, 0, 0);\">Our starting location will be the Starbucks on South Kipling. </span></p><p><span style=\"color: rgb(0, 0, 0);\">The starting address is: 10278 Centennial Rd, Littleton, CO 80127</span></p><p><span style=\"color: rgb(0, 0, 0);\">Please have your car gassed up, drinks, snacks, and restroom break completed so we can leave at 8:30am. There will be several restroom breaks along the way. </span></p><p><span style=\"color: rgb(0, 0, 0);\">Tour link for Google maps: </span><a href=\"https://goo.gl/maps/LF4HhEJGBUPSr9yt8\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0);\">https://goo.gl/maps/LF4HhEJGBUPSr9yt8</a></p>','2022-07-10 14:30:00','2022-07-10 21:00:00','Starbucks, 10278 Centennial Rd, Littleton, CO 80127','EASY',NULL,'',0,-1,13,'ckpo8hppw00fa072719ah9mvg','cl3usn4e500cd0706jdi3j3hp','ckomap3ww004t13b7h7d0e136',0),('cl1cvk3tb0030074978481yml','2022-03-30 01:13:48.594','2022-05-15 00:02:21.157','RUN','Pickle Gulch','<p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Expect to experience smooth tree-shaded portions, open meadows, bumpy dirt roads, steep climbs, collapsed log cabins, weathered mining structures, and views of Rocky Mountain peaks. The top of Pickle Gulch connects to the extensive network of trails around Oregon Hill and Dakota Hill offering even more mining history, spectacular views and offroad adventure.&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Please come prepared with a full tank of gas, water, snacks and lunch on the trail.</span></p>','2022-05-15 15:00:00','2022-05-15 21:00:00','','INTERMEDIATE',NULL,'Valero - 2195 East Idaho Springs Road, Idaho Springs, CO 80452',0,-1,14,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',0),('cl1cw1ezs00710749gml6o98f','2022-03-30 01:27:16.251','2022-05-29 14:53:18.256','FUNDRAISING','Denver Sweet Beer Bust','<p>Beer Busts are our only means of fundraising, it\'s really important that we have a large showing - we need 15 people! Wear your 4-Players gear and come help pour at the beer bust!&nbsp;</p><p><strong>IMPORTANT: Arrive at 3:30pm for non-optional training</strong>&nbsp;Bust goes from 4pm to 8pm&nbsp;</p>','2022-05-29 21:30:00','2022-05-30 02:00:00','776 Lincoln St, Denver, CO 80203','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2rvx1un009j0715ohqepnm8','2022-05-04 18:00:07.583','2022-07-15 16:41:23.826','RUN','Rampart Range Road run','<p>Calling all GREENHORNS!</p><p>Ramparts Range road is a dirt road that runs N/S though the mountains just northwest of Colorado Springs. This run is an EXTREMELY EASY run best suited for those who have very little to no experience with trail running. We will be teaching the ins and outs of group running with no obstacles or stressful situations to overcome.</p><p>We will access Ramparts via the Mt Hermon Road, which starts in Monument and ends on Ramparts.</p><p>From there, we will drive south along the course of the road all the way to where it ends at Garden of the Gods.</p><p>Along our way, we will take one of the easy spurs off the main road for more fun, and stop for packed lunch at some point too!</p>','2022-07-30 14:00:00','2022-07-30 21:00:00','','EASY',NULL,'Walgreens - 265 E HWY 105, Monument, CO 80132',0,-1,10,'ckomap3ww004y13b76fvy4564',NULL,'ckomap3ww004t13b7h7d0e136',0),('ckomdpbk1005pb4b74op8b9n3','2021-05-13 04:15:30.241','2021-06-06 07:06:32.486','RUN','Miller Rock (formerly Pole Hill) run','<p><strong>Update 6/5</strong>: Dave decided to change trails to nearby Miller Rock. This trail is longer and more narrow than Pole Hill, so please <a href=\"https://www.trailsoffroad.com/trails/378-miller-rock\" rel=\"noopener noreferrer\" target=\"_blank\">read up on the trail</a> and contact Dave with any questions or concerns.</p><p>Note: The rally time has changed to <strong>10am</strong> and the rally location has changed to the <strong>Lyons Post Service</strong>, 305 Railroad Ave, Lyons, CO 80540</p><p>Pack a lunch or pick up a sub at the rally point. We will have plenty of time to stop and enjoy lunch on the trail.&nbsp;</p><p>Dave has a place near Pinewood and can accommodate a few guests Saturday night. Ping him if you want to hang out and do a sunset run on Johnny Park Rd., assuming it\'s open.</p><p>Trail: <a href=\"https://www.trailsoffroad.com/trails/378-miller-rock\" rel=\"noopener noreferrer\" target=\"_blank\">Miller Rock</a></p><p>---</p><p><strong>Update 6/4</strong>: Per the ranger, Pole Hill won\'t be open before 6/15. Dave is working with others to find a nearby alternative trail.</p><p>---</p><p>Trails: <a href=\"https://www.trailsoffroad.com/trails/422-pole-hill\" rel=\"noopener noreferrer\" target=\"_blank\">Pole Hill</a>&nbsp;</p><p>This is a relaxed moderately easy 4 mile loop trail that offers mindless wandering, perfect for a carefree early summer Sunday lunch run.&nbsp;There are a few obstacles to make things interesting for modified rigs, but the challenges can be bypassed. Stock rigs might scrape their dangley bits in one or two spots but trail damage is unlikely.</p><p>The trailhead is at the eastern edge of the Estes Valley, 10 miles west of the rally point on Hwy 36 and a mile up Pole Hill Road (CR 122). There are a few views into the Estes Valley from the trail, but otherwise it meanders through a bowl of forested hills, creeks, and small sunny meadows.</p><p>Pack a lunch or pick up a sub at the rally point. We will have plenty of time to stop and enjoy lunch on the trail.&nbsp;</p><p>This run is contingent on the end of the seasonal trail closure, typically the first weekend of June in drought years. <strong>I\'ll know on Saturday 6/5 if we\'re on for Sunday. </strong></p><p>The <a href=\"https://www.coloradocherrycompany.com/new-page-2\" rel=\"noopener noreferrer\" target=\"_blank\">coffee shop/restaurant at the rally point</a> opens at 9 a.m. on weekends. We\'ll rally in the large parking lot west of the restaurant. Coming from the metro area, there\'s no gas available past the east side of Lyons, 9 miles before the rally point and 19 miles before the trailhead. Estes Park is 4 miles west of the trailhead.&nbsp;</p><p>I have a place near Pinewood and can accommodate a few guests Saturday night. Ping me if you want to hang out and do a sunset run on Johnny Park Rd., assuming it\'s open.</p>','2021-06-06 16:00:00','2021-06-06 22:00:00','','INTERMEDIATE',NULL,'United States Postal Service, 305 Railroad Ave, Lyons, CO 80540',0,-1,8,'ckomap3wv004713b7dbed3dqi',NULL,'ckomap3wv003s13b79xoq6fdt',NULL),('cl27qfl7y014l07282w2fwvbf','2022-04-20 15:31:11.277','2022-07-13 01:24:10.745','RUN','COMMUNITY: Apex Valley','<p><strong>A community run is specifically for guests and new members to the club within the last year.</strong></p><p>We’ll start by making our way to Apex ghost town, then we’ll wind our way up to Dakota Hill and explore some of the trails nearby. If there’s time we can consider Mosquito Creek Rd.</p><p>Please arrive at the rally point on time, fueled-up, and ready to go. Use the restroom and get snacks, drinks, and lunch in advance. Notify the run leader if you are running late.</p><p>Remember, we’ll be at a higher altitude, so plan for cooler weather.</p>','2022-07-17 15:00:00','2022-07-17 21:00:00','','EASY',NULL,'Maryland Mountain Hidden Treasure Trailhead Parking Lot, 8060 Black Hawk Blvd, CO-119, Black Hawk, CO 80422',0,-1,10,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cl2s43c2r00cc07157e7mseci','2022-05-04 21:48:57.698','2022-06-13 14:56:00.785','RUN','Red Cone / Radical Hill / Saints John','<p><strong>First things first--this day is for you if you LOVE:</strong></p><ul><li><span style=\"color: rgb(34, 34, 34);\">STEEP ascents/descents</span></li><li><span style=\"color: rgb(34, 34, 34);\">HIGH, NARROW shelf/saddle roads</span></li><li><span style=\"color: rgb(34, 34, 34);\">small rock gardens</span></li><li><span style=\"color: rgb(34, 34, 34);\">expansive views above timberline&nbsp;</span></li></ul><p><span style=\"color: rgb(34, 34, 34);\">These are three of my fav trails and a great&nbsp;set of trails for you to push yourself from intermediate driving to some more advanced terrain and skills.&nbsp;However, if you DON\'T like the above--especially heights--this is not the day for you.&nbsp;&nbsp;</span></p><p>We\'ll meet in Bailey, caravan 20 min to the Hwy 285 turn off, air down and run the three trails. Depending on the drivers/pace, we\'ll be on Red Cone (2.5ish hrs), drop into the valley below Webster for lunch (out of the wind), up Radical (1ish hr) and then across Saints John (2.5ish hrs). We\'ll air up in Montezuma and folks can go home over Loveland Pass or through Dillon and I70 tunnels.&nbsp;There\'s also the option of stopping in Summit City for a post run brat/burger/brew.&nbsp;;-)</p><p><strong>Trail Descriptions:</strong></p><p><strong>Red Cone (rated 5-7, Difficult/Severe)</strong></p><p>From Trails Offroad,&nbsp;<a href=\"https://www.trailsoffroad.com/trails/432-red-cone\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/432-red-cone</a>, \"This four-wheel drive trail provides spectacular views of the divide with several rocky obstacles at the beginning and a once in a lifetime descent near the end. The upper portion of the trail traverses the ridge lines around 12,000 feet with views for miles. A well-equipped vehicle with high clearance and low range is required. If you are not comfortable with steep descents, avoid this trail.\"</p><p><strong>Radical Hill (rated 5-7, Difficult/Severe)</strong></p><p>From Trails Offroad,&nbsp;<a href=\"https://www.trailsoffroad.com/trails/429-radical-hill\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/429-radical-hill</a>&nbsp;\"A short, narrow, white-knuckle 4wd climb with several tight switchbacks leading to amazing views above 12,600 feet. If you are not comfortable with narrow shelf roads, this is not a trail for you.\"</p><p><strong>Saints John (rated 3-4, Moderate)</strong></p><p>From Trails Offroad,&nbsp;<a href=\"https://www.trailsoffroad.com/trails/443-saints-john\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/443-saints-john</a>,</p><p>\"The majority of Saints John is smooth and easy. The major hill-climbs all have larger rocks and there are a couple of small ledges that might look imposing to less experienced drivers, but choosing a good line will get a good stock truck through without issue.\" (Once you\'ve done Red Cone and Radical, Sts John will be a piece of cake.)</p><p><strong>Vehicle requirements:</strong></p><ul><li>35\'s+/2\"+ lifts, vehicle dependent, preferred (there are short narrow rock gardens on both Red Cone and Radical--skilled drivers might navigate with 33\'s, even stock, but expect to bang some rocks ;-)</li><li>Lockers (but a skilled driver without lockers can make it through)</li><li>Reach out to me if you have questions about&nbsp;your&nbsp;vehicle or driving skills!</li></ul><p><br></p><p>Bring a lunch, extra snacks, a chair, sunscreen/hat (we\'ll be above tree line much of the day)</p><p><strong>Rally Location</strong></p><p><a href=\"https://www.google.com/maps/place/Conoco/@39.4062027,-105.47904,17z/data=!4m5!3m4!1s0x876b1240a03cf383:0x9b7291d5c524bd56!8m2!3d39.4061986!4d-105.4768567\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(206, 49, 44);\">Conoco Bailey, 60597 US Hwy 285, Bailey, CO 80421</a></p><p>Once you\'re gassed up, queue up along the fence line at Mad Jack\'s across the street.</p><p>Please be in Bailey&nbsp;<strong><u>NO LATER</u></strong>&nbsp;than 9:30 (for a 9:45am departure).</p><p><strong>NOTE</strong>:&nbsp;<strong>Our day begins on Hwy 285 near Bailey and ends near Keystone (Hwy 6 or I70)&nbsp;</strong></p>','2022-08-06 15:30:00','2022-08-06 23:00:00','','ADVANCED',NULL,'Conoco Bailey, 60597 US Hwy 285, Bailey, CO 80421',0,-1,8,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clcd31wvd00240743ld7z9tcu','2023-01-01 08:00:22.288','2023-03-06 02:46:52.01','MEETING','April Membership Meeting','','2023-04-11 01:00:00','2023-04-11 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww005213b70kjhcoc4',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clcd31wvd00250743e0xlhmxz','2023-01-01 08:00:22.291','2023-03-06 02:47:33.217','MEETING','May Membership Meeting','','2023-05-09 01:00:00','2023-05-09 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6a9gpy00e20651dzvl2qaq','2023-03-13 03:46:55.846','2023-07-14 16:56:32.712','RUN','Brewery Hill ','<p><strong><em>***Please note that Breckenridge Peak 10 Trail is still closed and the run leader has changed the trail to ensure we are still getting some mountain time!***</em></strong></p><p>Since peak 10 is closed, we will do Brewery Hill instead! The brewery hill run is rather short, but there are many other beginner and intermediate trails at its endpoint, which we can explore as well. This is all around the Golden horseshoe area near Breckenridge. This run is new to me, so it should be exciting!&nbsp;</p><p>The Brewery Hill 4WD trail is tightly wooded trail that traverses the Golden Horseshoe trail system. Brewery Hill varies from steep and rocky to slick and muddy.</p><p>Brewery Hill is part of the Golden Horseshoe trail system which covers over 8000 acres between the Swan River and French Gulch. The area has a rich history and is dotted with countless mines, mills, and cabins dating from the late 1870s through the 1950s.</p><p>The Golden Horseshoe is crisscrossed with 4WD, ATV, single track, mountain bike and foot trails. Keep a sharp eye out for other folks using this network and, as always, be considerate. Stay the trail, and pack out what you packed in.</p><p>Trails Offroad Information - https://www.trailsoffroad.com/trails/232-brewery-hill</p>','2023-07-15 15:00:00','2023-07-15 21:00:00','','INTERMEDIATE',NULL,'Safeway - 1008 Summit Blvd, Frisco, CO 80443',0,-1,8,'ckomap3ww004y13b76fvy4564',NULL,'ckomap3ww004t13b7h7d0e136',0),('clcd31wve00260743diaug8bh','2023-01-01 08:00:22.294','2023-03-06 02:47:43.193','MEETING','June Membership Meeting','','2023-06-13 01:00:00','2023-06-13 02:30:00','Charlie\'s Denver, 900 E Colfax Ave, Denver, CO 80218','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6a2v3200b50651p97qqegp','2023-03-13 03:41:47.87','2023-06-25 02:27:59.613','SOCIAL','Denver PrideFest Parade','<p>Driver spots are all taken but we have room for marchers! </p><p>If you are marching in the parade you must sign up using this form below:</p><p><a href=\"https://forms.gle/w7xqtX1K2TNVEuXdA\" rel=\"noopener noreferrer\" target=\"_blank\">https://forms.gle/w7xqtX1K2TNVEuXdA</a></p>','2023-06-25 15:30:00','2023-06-25 21:00:00','','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',0),('clcd31wvg00280743shwckcfy','2023-01-01 08:00:22.306','2023-07-28 17:32:06.874','MEETING','August Membership Meeting','','2023-08-15 01:00:00','2023-08-15 02:30:00','Bad Habits Denver, 3014 E Colfax Ave, Denver, CO 80206','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clcd31wvf00270743puwhfb31','2023-01-01 08:00:22.302','2023-06-21 13:13:41.746','MEETING','July Membership Meeting','','2023-07-11 01:00:00','2023-07-11 02:30:00','Bad Habits, 3014 E Colfax Ave, Denver, CO 80206','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6a3yq600bp0651nfg9pm7s','2023-03-13 03:42:39.245','2023-06-28 15:06:30.957','RUN','T-33','<p>Trail is 2 miles long. Couple of technical obstacles.</p>','2023-07-08 16:00:00','2023-07-08 21:00:00','','ADVANCED',NULL,'B&F Mountain Market, 60 Lakeview Dr, Nederland CO 80466',0,-1,8,'ckomap3wv003q13b757fjdwgt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6a61wk00dd0651cogv5gjc','2023-03-13 03:44:16.676','2023-05-13 13:28:08.877','RUN','Kingston Peak with Hike','<p><span style=\"color: rgb(34, 34, 34);\">Situated about an hour from the Denver and Boulder</span></p><p><br></p><p><br></p><p><span style=\"color: rgb(34, 34, 34);\">Metro areas, this is a high-altitude trail that is a must-do for anyone</span></p><p><span style=\"color: rgb(34, 34, 34);\">in the area as it is the gem of the immediate surround off-road trails</span></p><p><span style=\"color: rgb(34, 34, 34);\">in the area. Although they call this the Kingston Peak Trail, the real</span></p><p><span style=\"color: rgb(34, 34, 34);\">beauty and focal point are the amazing views you get of James Peak for</span></p><p><span style=\"color: rgb(34, 34, 34);\">almost the entire route. James Peak is 13,294 feet and named in honor of</span></p><p><span style=\"color: rgb(34, 34, 34);\">Dr. Edwin James, an early explorer, historian, and botanist who was a</span></p><p><span style=\"color: rgb(34, 34, 34);\">member of the famous Stephen H. Long expedition to Colorado in 1820.\"</span></p><p><br></p><p><span style=\"color: rgb(34, 34, 34);\">The meeting place will be at the back of the Z Casino parking lot (101</span></p><p><span style=\"color: rgb(34, 34, 34);\">Gregory Street, just north of the intersection of Hwy 119 (Black Hawk</span></p><p><span style=\"color: rgb(34, 34, 34);\">Blvd) and Gregory Street (shown on some maps as Black Hawk Street) in</span></p><p><span style=\"color: rgb(34, 34, 34);\">the town of Black Hawk at 10am.&nbsp;We will depart there at precisely 10:30</span></p><p><span style=\"color: rgb(34, 34, 34);\">and then will air down when we turn off Hwy 119 onto Apex Valley Road.&nbsp;</span></p><p><span style=\"color: rgb(34, 34, 34);\">&nbsp;From there it\'s a relatively flat drive until we reach the eastern end</span></p><p><span style=\"color: rgb(34, 34, 34);\">of the Kingston Peak Trail, when the road turns rough and steep. We will</span></p><p><span style=\"color: rgb(34, 34, 34);\">stop for the hike (see below), then proceed to the top of Kingston Peak</span></p><p><span style=\"color: rgb(34, 34, 34);\">for a lunch stop.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Towards the back side of the mountain will pass by a gorgeous overlook</span></p><p><span style=\"color: rgb(34, 34, 34);\">of Loch Lomond, and at the end we will wind up in the town of St.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Mary\'s.</span></p><p><br></p><p><span style=\"color: rgb(34, 34, 34);\">Then for those who wish to socialize afterwards we can proceed to Vice</span></p><p><span style=\"color: rgb(34, 34, 34);\">Kitchen Wine and Whiskey in Golden (18445 W Colfax Ave suite 104, just</span></p><p><span style=\"color: rgb(34, 34, 34);\">off I-70 and US-40).</span></p><p><br></p><p><strong style=\"color: rgb(34, 34, 34);\">REQUIREMENTS</strong></p><p><span style=\"color: rgb(34, 34, 34);\">This run will require drivers to have a good amount of ground clearance</span></p><p><span style=\"color: rgb(34, 34, 34);\">(at least 10 inches) and a 4-Low setting in their transfer case.&nbsp;Stock</span></p><p><span style=\"color: rgb(34, 34, 34);\">4WD vehicles with these features should be fine.&nbsp;The trail itself isn\'t</span></p><p><span style=\"color: rgb(34, 34, 34);\">too challenging but be prepared for some steep inclines and narrow</span></p><p><span style=\"color: rgb(34, 34, 34);\">tracks with large dropoffs.</span></p><p><br></p><p><span style=\"color: rgb(34, 34, 34);\">Also make sure you bring a jacket or coat, as the weather can turn</span></p><p><span style=\"color: rgb(34, 34, 34);\">quickly.&nbsp;Also bring extra water, food (lunch), sunscreen, hiking shoes,</span></p><p><span style=\"color: rgb(34, 34, 34);\">a 2-way radio capable of transmitting on General Mobile Radio Service</span></p><p><span style=\"color: rgb(34, 34, 34);\">(GMRS) frequencies, and a full tank of gas.</span></p><p><br></p><p><strong style=\"color: rgb(34, 34, 34);\">THE HIKE</strong></p><p><span style=\"color: rgb(34, 34, 34);\">About two-thirds of the way up to Kingston Peak itself we will stop at</span></p><p><span style=\"color: rgb(34, 34, 34);\">the James Peak Lookout (Point of Interest #7 on Trails Offroad) and hike</span></p><p><span style=\"color: rgb(34, 34, 34);\">down to James Peak Lake, weather permitting.&nbsp;This part is optional;</span></p><p><span style=\"color: rgb(34, 34, 34);\">however anyone who doesn\'t want to do the hike is requested to stick</span></p><p><span style=\"color: rgb(34, 34, 34);\">around at the Lookout and wait for the others to return, which could be</span></p><p><span style=\"color: rgb(34, 34, 34);\">90 minutes or more.</span></p><p><span style=\"color: rgb(34, 34, 34);\">Further information:</span></p><p><a href=\"https://www.trailsoffroad.com/trails/351-kingston-peak\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/351-kingston-peak</a></p>','2023-07-09 16:00:00','2023-07-09 21:00:00','','INTERMEDIATE',NULL,'TBD',0,-1,10,'cl578ovtu00dh077814vu027f',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6aopxh00l9065176jw5t7j','2023-03-13 03:58:47.62','2023-08-07 21:06:03','RUN','Argentine Pass','<p>“<span style=\"color: rgb(64, 64, 64);\">Looking for an offroad adventure close to Denver that\'s guaranteed to get your blood pumping and take your breath away? Argentine Pass is a beautiful journey through stunning scenery, with moderate obstacles, thrilling switchbacks, and shelf roads that excite your adventure. Along the way, you\'ll even have the chance to explore the historic Waldorf Mine and Santiago Mines, adding a touch of history to your journey. But the real highlight of the&nbsp;trail is the view from the top - at over 13,000 feet you\'ll see Gray\'s and Torrey\'s Peaks and, on clear days, awe-inspiring Colorado Mountain vistas in the distance.” — Trails Offroad </span></p>','2023-08-12 16:00:00','2023-08-12 21:00:00','','INTERMEDIATE',NULL,'Behind Circle K, 1501 Argentine St, Georgetown, CO 80444',0,-1,8,'cl578ovtu00dh077814vu027f',NULL,'ckomap3ww005213b70kjhcoc4',0),('clf6apub600lt0651daq20kzi','2023-03-13 03:59:39.953','2023-08-08 20:03:54.252','RUN','GREENHORN - Apex/Michigan/Dakota','<p>Greenhorn events are intended for guest members and members that have joined the club in the past year who may be newer to the sport. It’s an opportunity for asking questions, to learn, and to get out on the trail with folks with similar experience.&nbsp;</p>','2023-08-13 16:00:00','2023-08-13 21:00:00','','UNKNOWN',NULL,'Squatch Store, 2195 East Idaho Springs Road, Idaho Springs, CO 80452',0,-1,8,'ckomap3ww005813b74sxs4jav',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6asutw00nl0651v39rcvgz','2023-03-13 04:02:00.595','2023-08-17 15:59:02.489','RUN','Buena Vista Runs + Camping','<p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">NOTE:&nbsp;Both the Chinaman run and the Miner’s Loop run are “FULL”</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> (as of Jordan Blisk’s registration) … anyone registering for this run from 8/15 forward is welcome to camp, but you need to talk to Wes about runs and be prepared to do your own.&nbsp;&nbsp;</span></p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">ALSO NOTE:&nbsp;Bruce Perry has stepped down from this event.&nbsp;</span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">There will be no official “easy” runs offered, though attendees are welcome to plan their own.</strong></p><p><strong><u>CAMPING</u></strong>&nbsp;</p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">We will be camping southwest of Buena Vista which is adjacent to Brown’s Creek Trailhead in dispersed camping off roads 270/272.&nbsp;Actual location is </span><a href=\"https://goo.gl/maps/SJcKnGm5PQQDdqi99\" rel=\"noopener noreferrer\" target=\"_blank\">https://goo.gl/maps/SJcKnGm5PQQDdqi99</a>.</p><p><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">There is a vault toilet that is a 3 minute walk from the site.&nbsp;These sites have stone fire rings so do bring firewood for evening campfires.&nbsp;Food and drink will be on your own at camp or in town.&nbsp;We’ll be relatively close to everything:&nbsp;gas, groceries, restaurants (20 min to BV, 25 min to Salida), hot springs (15 min to Mt Princeton, 30 min to Cottonwood) and 20-30 min to trail starts each day.&nbsp;</span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">20 min to nearest gas from camp (so top off when you arrive and each time you’re in town to save the trip pre-run in the morning)—we won’t go to/by a gas station prior to the Sat run.</strong></p><p><br></p><p><strong><u>RUN ITINERARY</u>&nbsp;</strong>(We’ll be flexible here … but since I’ve been getting questions, here’s the rough plan …)</p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\"><em>THURS 8/17</em></strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">: Campers welcome to arrive Thursday evening—please </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\"><em>let Wes know in advance if coming Thurs</em></strong></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\"><em>FRI 8/18:</em></strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">&nbsp;Campers can arrive afternoon/evening----do your own run, hit the hot springs, hike Brown’s Creek, do an afternoon raft trip on the Arkansas.</span></p><ul><li><strong style=\"background-color: transparent;\">Advanced</strong><span style=\"background-color: transparent;\"> drivers: 10:30 am </span><a href=\"https://www.trailsoffroad.com/trails/255-yansing-gulch-aka-chinaman-gulch\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Chinaman Gulch</strong></a><span style=\"background-color: transparent;\"> (</span><strong style=\"background-color: transparent;\">min 35’s, front/rear lockers, winch)</strong><span style=\"background-color: transparent;\">.&nbsp;Part of our Fri afternoon Crawler series (Make sure you are confirmed with Wes directly for this run.)&nbsp;</span><strong style=\"background-color: transparent;\">Meet at 10am </strong><span style=\"background-color: transparent;\">at </span><strong style=\"background-color: transparent;\">Gunsmoke Conoco </strong><span style=\"background-color: transparent;\">in Johnson Village, 12916 US-24 #285, Buena Vista, CO 81211&nbsp;</span><a href=\"https://goo.gl/maps/jLYdL4afWnjYRrwD6\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\">https://goo.gl/maps/jLYdL4afWnjYRrwD6</a><span style=\"background-color: transparent;\">&nbsp;</span></li></ul><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\"><em>SAT 8/19:&nbsp;</em>Miner’s Loop</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> Includes </span><a href=\"https://www.trailsoffroad.com/trails/1082-hancock-pass\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Hancock Pass</strong></a><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> ; </span><a href=\"https://www.trailsoffroad.com/trails/1069-alpine-tunnel-west\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Alpine Tunnel</strong></a><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> ; </span><a href=\"https://www.trailsoffroad.com/trails/480-tincup-pass\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Tincup Pass</strong></a><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">&nbsp;</span></p><ul><li><strong style=\"background-color: transparent;\">9:00 am rally at group campsite … 9:30 am depart for trail</strong></li><li><span style=\"background-color: transparent;\">This will be a full day—</span><strong style=\"background-color: transparent;\">be gassed up, have snacks</strong><span style=\"background-color: transparent;\">, and be ready for a fun and beautiful routing!&nbsp;&nbsp;</span></li><li><strong style=\"background-color: transparent;\">Intermediate</strong><span style=\"background-color: transparent;\"> with </span><strong style=\"background-color: transparent;\">Advanced</strong><span style=\"background-color: transparent;\"> options:&nbsp;</span><strong style=\"background-color: transparent;\">6+ hours, mostly 4 ratings with optional rating 5/6 obstacles) … </strong><span style=\"background-color: transparent;\">stock ok (35+ for advanced options), lockers not required, but comfort driving/passing on shorter shelf roads, articulation, basketball sized rocks, steps under 1’.&nbsp;&nbsp;</span></li><li><span style=\"background-color: transparent;\">All rigs will do most of the trail together—at two spots we might break into smaller groups to do intermediate versus advanced small stretches.</span></li><li><span style=\"background-color: transparent;\">Tomichi, Napoleon, and Old Tincup are some of the advanced options—we’ll decide based on group prefs/skills and weather conditions day of).&nbsp;&nbsp;</span></li><li><span style=\"background-color: transparent;\">The routing begins near </span><strong style=\"background-color: transparent;\">St. Elmo</strong><span style=\"background-color: transparent;\"> ghost town.&nbsp;We will likely stop midday in </span><strong style=\"background-color: transparent;\">Pitkin</strong><span style=\"background-color: transparent;\">:&nbsp;Silver Plume store and BBQ lunch (very expensive gas available here too) and late afternoon in </span><strong style=\"background-color: transparent;\">Tincup</strong><span style=\"background-color: transparent;\">:&nbsp;a quick walk around Tincup Cemetery, and depending on timing, Frenchy’s Café in Tincup for pie before finishing the trail.</span></li></ul><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\"><em>SUN 8/20:&nbsp;</em></strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Some campers have expressed the desire to break camp and head home Sunday morning.&nbsp;Some will break camp and do a trail.&nbsp;</span></p><p><br></p><ul><li><span style=\"background-color: transparent;\">For those who don’t depart, we may do something as a group, or on your own </span><strong style=\"background-color: transparent;\">… Rally 9:00 am (ish) to discuss trails </strong><span style=\"background-color: transparent;\">&nbsp;… options include:&nbsp;</span><strong style=\"background-color: transparent;\">intermediate</strong><span style=\"background-color: transparent;\"> </span><a href=\"https://www.trailsoffroad.com/trails/390-mount-antero\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Mt Antero</strong></a><span style=\"background-color: transparent;\">, </span><strong style=\"background-color: transparent;\">advanced</strong><span style=\"background-color: transparent;\"> </span><a href=\"https://www.trailsoffroad.com/trails/313-grizzly-lake\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Grizzly Lake</strong></a><span style=\"background-color: transparent;\"> or </span><a href=\"https://www.trailsoffroad.com/trails/339-iron-chest\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Iron Chest</strong></a><span style=\"background-color: transparent;\">, or boondocking down by </span><strong style=\"background-color: transparent;\">Rawley Mine/Bonanza (harder intermediate), </strong><span style=\"background-color: transparent;\">or a hot springs soak</span></li></ul><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">**NOTE</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> to those interested in </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">truly</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> “</span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Easy</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">” </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">trails</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">, or just a pure sightseeing drive, there are a number of options in the area:&nbsp;</span><a href=\"https://www.trailsoffroad.com/trails/221-billings-lake\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Billings Lake</strong></a><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> or </span><a href=\"https://www.trailsoffroad.com/trails/7149-marshall-pass\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(5, 99, 193);\"><strong>Marshall Pass</strong></a><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> for example … or do a mostly paved/gravel </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">loop tour over Cottonwood and Monarch passes</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">.&nbsp;It’s perfectly acceptable to forego the above planned trails and do your own—there are trails for all levels in the area!&nbsp;&nbsp;</span></p>','2023-08-18 14:00:00','2023-08-21 00:00:00','','INTERMEDIATE',NULL,'https://goo.gl/maps/SJcKnGm5PQQDdqi99',0,-1,10,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3ww004t13b7h7d0e136',0),('clf6aaz7000en0651rlcyetyy','2023-03-13 03:48:06.444','2023-07-11 19:02:55.537','RUN','NIGHT RUN - Slaughterhouse Gulch','<p><br></p>','2023-07-16 01:00:00','2023-07-16 03:00:00','','INTERMEDIATE',NULL,' Load N Jug, 173 Bulldogger Rd, Bailey, CO 80421',0,-1,10,'ckomap3wu002x13b74lnt19lb',NULL,'ckomap3wu002x13b74lnt19lb',0),('clg8hywmx000i0691ulgcy488','2023-04-08 21:37:54.838','2023-06-04 14:47:23.298','RUN','Cancelled - Kelly Flats','<p>***Cancelled due to rain and potential flooding*** </p><p><br></p><p><strong>From Trails Offroad:</strong>&nbsp;<a href=\"https://www.trailsoffroad.com/trails/348-kelly-flats\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">https://www.trailsoffroad.com/trails/348-kelly-flats</a></p><p>\"Rough and rugged, Kelly Flats 4x4 Road is one of the more difficult trails in northern Colorado. Just west of the narrows in the Poudre Canyon, the drive to the trailhead through the Poudre Canyon is stunning and breathtaking. Two distinct obstacles highlight this road: Heart Attack Hill and The Chutes. Both obstacles have bypasses. Kelly Flats 4x4 Road can be unnerving for beginning off-road drivers and the optional obstacles can be difficult and challenging for experienced drivers with modified rigs. The rest of the trail is a mixture of dirt two-track and the occasional rock. Keep a keen eye out for elk and moose while in the forested area as they are often spotted. Put your transfer case in low range and enjoy this popular trail.\"</p><p><strong><u>My take</u><em>:</em></strong>&nbsp;This is rated a 5/7 trail ... 5 for all required/easiest lines, and many of us regulars on the trail think it should be a 4/7 ... I think it\'s easier than the rating.&nbsp;While we will encounter both obstacles, most moderate (stock vehicle) drivers do fine staying the left line on Heart Attack Hill --I\'ve done it w/out lockers, and anyone can just observe the Chutes from the bottom or top of the bypass.&nbsp;In the last two years, I\'ve had many stock JK\'s and XJ\'s complete with no problems, and I\'m happy to see any Taco\'s/4Runner\'s, etc give it a shot!&nbsp;So this trail is truly \"intermediate\" with \"advanced\" options.&nbsp;Reach out if you want to discuss if this trail is for you!</p><p><strong>ITINERARY</strong></p><ul><li>10:30 am - Depart Ted\'s Place (and end of cell service) for the scenic drive up Poudre Canyon, you can gas up here if needed.</li><li>11:15 am - Arrive at Kelly Flats Trailhead parking lot (not campground) and air down</li><li>11:30 am - Head up the trail. We\'ll run up Heart Attack Hill, stop for lunch in the clearing with epic views of the north ridge of RMNP, head to the Chutes (optional, those who don\'t can watch the fun), and come back across Pingree Park. Should be done by 3:30ish depending on trail traffic and how many people do the Chutes.&nbsp;Folks can head 1) down the canyon and home, 2) into Red Feather Lakes for a bite, 3) down to FoCo or Wellington for a post-trail draft at one of NoCo\'s great breweries--we can decide post-trail</li><li>4:30 pm or so - Back in Fort Collins or Wellington and beverages/food or depart</li></ul><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><strong>REQUIREMENTS/SKILLS</strong></p><ul><li>You\'ll be happier lifted on 35s, though careful placement/confident drivers on 33s will suffice, depending upon the vehicle.&nbsp;The stock pickups may struggle on some of the ledges/drops, though there are enough easy lines that most vehicles can get through the base trail.</li><li>Lockers only for the harder line on Heart Attack Hill and for the Chutes</li><li>Comfort driving on a steep, loose ascent</li><li>Comfort dropping off 1.5\'+ rocks/ledges</li></ul><p>Contact me directly if you\'re unsure.</p><p><br></p><p><br></p><p><br></p><p><br></p><p><strong>BRING</strong></p><p>(As usual) your chair, lunch, drinks, jacket, and a smile :-D</p>','2023-06-04 16:30:00','2023-06-04 22:00:00','','ADVANCED',NULL,'Teds Place, 6511 US-287, Laporte, CO 80535',0,-1,8,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3ww004t13b7h7d0e136',0),('clf6920es001x0651aa9m0wmf','2023-03-13 03:13:08.499','2023-04-15 02:18:19.707','RUN','Switzerland Trail','<p>***There will be multiple groups***</p><p><br></p><p><br></p><h2><br></h2><h2>Switzerland Trail w/ Optional Pennsylvania Gulch</h2><p>This is an easy run to get out on the trails early in the year. Nearly the entire route is a shelf road offering spectacular views of the nearby foothills and the snow-capped peaks to the west. The trail follows an old railroad route from Sugarloaf Mountain to the community of Gold Hill. We will start the trail off Sugar loaf mountain road at the Sugarloaf mountain trailhead.&nbsp;Trails: Switzerland Trail | Pennsylvania Gulch&nbsp;Date: </p><p>Sat 5/6/23 Time: 10:00 AM MDT. Depart 10:15 AM MDT sharp. </p><p>Difficulty: Easy Rally Location: King Soopers 1650 30th St Boulder In Sunrise Center </p><p>Trail Head: 40.024992 W, -105.42481 N Run Leader: Jeffrey Gordon / Jason Dean / Jacob Adkisson </p><p>Bring a lunch and a chair. Please check the weather in advance and wear the appropriate layers, bring drinks and snacks. We will run the trail to the end and back.&nbsp;If there is interest, we will run Pennsylvania Gulch with 1 or 2 of the 3 groups being led. It is a short intermediate trail and provides some more challenging terrain.</p><p><br></p><p><br></p><p><a href=\"https://www.trailsoffroad.com/trails/474-switzerland-trail\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\"><strong>Switzerland Trail Information</strong></a></p><p>Nestled a few miles west of Boulder Colorado, Switzerland Trail is an easy outing for an afternoon getaway. Nearly the entire route is a shelf road offering spectacular views of the nearby foothills and the snow-capped peaks to the west. The trail has only slight grades as it follows an old railroad route from Sugarloaf Mountain to the community of Gold Hill. Because Switzerland Trail is open year-round, It can be a popular spot for those who partake in snowy driving adventures.</p><p><a href=\"https://www.trailsoffroad.com/trails/413-pennsylvania-gulch\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\"><strong>Pennsylvania Gulch Trail Info</strong></a></p><p>Pennsylvania Gulch Trail is an excellent 4wd choice to challenge new and intermediate off-road drivers. It is approximately two miles long and is one off-road trail not to miss in the area.&nbsp;Most of the trails in the area can be negotiated in 2WD but Pennsylvania Gulch requires 4WD.&nbsp;Pennsylvania Gulch is about the trail rather than the mountain views as it remains in the trees for its duration.&nbsp;It is moderately rocky with many exposed tree roots on the trail.&nbsp;The trail is uphill and narrow with only one or two places to pass so it is best taken from east to west as uphill travel will have the right-of-way.</p>','2023-05-06 16:00:00','2023-05-06 21:00:00','','EASY',NULL,'King Soopers - 1650 30th Street, Boulder, CO 80301',0,-1,20,'cl16t7r46002i0744im6vthjg',NULL,'ckomap3ww005213b70kjhcoc4',0),('clh0ohrjk009a0618si1iu13k','2023-04-28 14:58:05.36','2023-05-03 14:33:07.398','RUN','Pawnee Grasslands','<p>We will start at the Maverick Gas station at 1206 Main St, Fort Morgan, CO 80701 departing at 09:00 and heading due north to the Pawnee Buttes Trailhead in Grover where we\'ll stop for lunch, then head south towards Keota (small \'ghost\' town) to end the day. Run time is roughly 5-6 hours along gravel and dirt roads with no obstacles.&nbsp;</p><p>I\'d urge attendees to fuel up at our start point, coming with a packed lunch and drinks. The rendezvous&nbsp;point will be the only restroom available until the trailhead\'s&nbsp;more&nbsp;primitive&nbsp;offerings.&nbsp;</p>','2023-05-07 15:00:00','2023-05-07 21:00:00','','EASY',NULL,'Maverick Gas Station - 1206 Main St., Fort Morgan, CO 80701',0,-1,10,'ckz6a8s8m000b0788n8nczcwv',NULL,'ckomap3ww004t13b7h7d0e136',0),('clf69zu5400910651i5dzg8o0','2023-03-13 03:39:26.68','2023-05-05 13:56:22.833','RUN','Crested Butte runs + camping','<p>This years trip will include a little bit of wheeling, a little bit of hiking, and a little bit of relaxation. Crested Butte is a beautiful area with temperatures 15 degrees cooler than surrounding areas. Also, bring your mountain bike to it’s birth place for some trail fun</p><p>We’ll be camping at Oh Be Joyful Campground. Each camper will have to reserve their campsite 2 weeks prior to arrival. Registration will close 3 weeks before the trip. I will assign each camper a campsite # to reserve along with other information when registration closes.</p><p>The trails that we will traverse are:</p><ul><li>Paradise Divide</li><li>Schofield Pass</li><li>Crystal City/Crystal Mill</li><li>Lead King Basin</li><li>Pearl Pass</li><li>Taylor Reservoir</li></ul><p><br></p><p>See you all there!</p>','2023-06-21 16:00:00','2023-06-27 21:00:00','','INTERMEDIATE',NULL,'Oh Be Joyful Campground',0,-1,8,'ckomap3ww004813b7c8718327',NULL,'ckomap3ww004t13b7h7d0e136',0),('clf69qbl2004w06513dztebmv','2023-03-13 03:32:02.725','2023-05-09 05:30:04.125','RUN','Sports Car Journey','<p>4-Players sports car journey Steamboat Springs</p><p>Steamboat Springs known for their hot Springs (a visit to Strawberry Park hot springs is a must), ski resort, hiking, fishing, shopping, and many other attractions will be our destination for this trip.&nbsp;</p><p>The great thing about this trip is you can return back to Denver the same day or if you want to experience the hot springs or ride the gondola up to get amazing views of the Yampa valley, you can spend the night and return on Sunday.</p>','2023-06-03 14:30:00','2023-06-03 21:00:00','','UNKNOWN',NULL,'King Soopers, 17171 S Golden Rd, Golden, CO 80401',0,-1,15,'ckpo8hppw00fa072719ah9mvg',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clhiikgbs00d2061491saveze','2023-05-11 02:32:04.256','2023-05-11 02:32:04.256','RUN','Broomfield Pride Motorcade','<p>Let\'s get some 4-Players representation at the 2nd annual Broomfield Pride! </p><p>The motorcade is about 45 minutes long and then Broomfield Pride will take place in the park all day. </p><p>Max of 5 vehicles allowed. We\'ll meet in front of the Broomfield City Hall building to decorate vehicles, with the parade starting around 11:30am on Spader Way.</p><p><br></p>','2023-06-03 16:00:00','2023-06-03 21:00:00','','UNKNOWN',NULL,'Broomfield City Hall, 1 Descombes Dr, Broomfield, CO 80020',0,-1,5,'ckomap3wx005e13b7090m48ju',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clijis62f00ey06510rojp0ij','2023-06-06 00:05:32.72','2023-06-06 00:05:56.972','SOCIAL','Tom Eskridge Celebration of Life','<p>A Celebration of Life for Tom Eskridge will be held at The Eagle Denver 5110 W Colfax Ave, Denver, CO 80204 on Wednesday June 7th from 5-7. Please come and have cheers to him and reminisce. Send me your favorite pictures of you and Tom as I’ll put a collage of remembrance together. Invite anyone and all as Tom would’ve welcomed them. After 7 join The Eagle for poker with JW an adventure Tom enjoyed if you’re a little on the wild side </p>','2023-06-07 23:00:00','2023-06-08 01:00:00','Eagle Denver 5110 W Colfax Ave, Denver, CO 80204 ','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt','clijisotg00g0065118ov4ga4','ckomap3wv003s13b79xoq6fdt',0),('clf6ahhcs00i20651v55jtqcf','2023-03-13 03:53:09.915','2023-07-26 21:58:41.854','RUN','ANNUAL RETREAT - San Juans','<p>The run leaders voted to forego our annual club retreat to Moab this year in favor of a trip to the San Juans!</p><p>The run leader went early and found a dispersed campsite near Ouray. The campsite is located here: <a href=\"https://goo.gl/maps/YWiCbN9neHefAe3z6\" rel=\"noopener noreferrer\" target=\"_blank\">38.0146868, -107.6532537</a></p><p>Please note: the road to this campsite is an offroad trail and we do not recommend bringing a trailer or 2WD vehicle on this road</p><p>This is a multiple day bring-your-own-food and beverage event, although there are great places to eat in Ouray. We\'ll plan to meet up at 8am at the rally spot each morning.</p><p><strong>Because the snow drifts still have some of the popular trails closed, the trails will be discussed and decided at the campsite the night before. </strong></p><p><strong>Attendees should begin arriving in town on 7/26, but only plan to meet at the rally point every morning from 7/27 to 7/31.</strong></p><p>Note: there is a Facebook chat in the club group if you would like to join.</p><p>---</p><p>Current tentative options:</p><ol><li>Black Bear Pass is likely off the list until Saturday/Sunday/whenever they reopen it.</li><li>Mineral to Engineer to Animas Forks and back over California Pass, Hurricane Pass, and Corkscrew Gulch.</li><li>Red Mountain Pass (short)</li><li>Long route to Lake city and back</li><li><a href=\"https://www.facebook.com/smccoroads/posts/681457684022529?comment_id=3143290782632759&amp;notif_id=1689780911338117&amp;notif_t=comment_mention&amp;ref=notif\" rel=\"noopener noreferrer\" target=\"_blank\">Imogene Pass </a>and back around Norwood to Ridgway or Last Dollar Road</li></ol>','2023-07-26 14:00:00','2023-07-31 21:00:00','','INTERMEDIATE',NULL,'38.0180512,-107.6750215',0,-1,50,'ckomap3ww004813b7c8718327',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clh0y3vvz00or06183a05p5q6','2023-04-28 19:27:13.967','2023-09-12 20:16:18.333','RUN','Dakan Rd / Upper Jackson Creek Road','<p>Dakan Road is a very pleasant trail in the Pike National Forest near Castle Rock that runs from Perry Park Road to Rampart Range Road. It is suitable for all levels of drivers, and any stock 4x4 can run this with no problems. There are a few tremendous views of the front range. This trail can be a bit crowded so be on the lookout for traffic from dirt bikes, ATVs, and other vehicles. This is a very nice trail through the valley in between Devil\'s Head and Dakan Mountain with a creek that runs through it. It has some spots for fishing, camping, and picnics. It\'s a nice trail to run to extend other trails or just to do Dakan Road as a loop. It has a lot of connectors to ATV and Dirt Bike trails. There is a very large network of trails here in the rampart range area that can make for a great day on the trail.</p>','2023-09-17 16:00:00','2023-09-17 21:00:00','','EASY',NULL,'Circle K - 23 W Wolfensberger Rd., Castle Rock, CO 80109',0,-1,4,'ckomap3wv003j13b7fdylcckg',NULL,'ckomap3ww004t13b7h7d0e136',0),('clh0o9jhk007a06185auat7th','2023-04-28 14:51:41.672','2023-05-15 02:28:40.612','RUN','Medicine Bow','<p><strong><em>***RESCHEDULED FROM 5/14*** </em></strong></p><p>4-Players&nbsp;Medicine&nbsp;Bow&nbsp;tour. Super easy, might be some water crossings but those should not be deep. For lunch, we will eat on the trail someplace. You can get a packaged sandwich at the rally location in the morning or bring your own lunch. Gas up at the rally point if you have less than a half tank of gas. This is open to Members and Greenhorns</p>','2023-08-06 15:00:00','2023-08-06 23:00:00','','EASY',NULL,'Akal Travel Center, 2 Sammons Ln, Buford, WY 82052',0,-1,8,'ckpo8hppw00fa072719ah9mvg',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clh0a7b2r002d0618r33klrew','2023-04-28 08:18:02.82','2023-05-25 23:57:41.563','FUNDRAISING','Denver Sweet Beer Bust!','<p>Denver Sweet has asked us to pour for their Memorial Day beer bust and we know 3-day weekends draw out the big crowds so all hands on deck! We need at least 20 people (club members, guests, friends, family, whoever!) to help pour. Sweet always takes care of us and it\'s our turn to help them out. Spread the word! Share this event:</p><p><a href=\"https://facebook.com/events/s/memorial-day-and-4th-anniversa/2439352739558468/\" rel=\"noopener noreferrer\" target=\"_blank\">https://facebook.com/events/s/memorial-day-and-4th-anniversa/2439352739558468/</a></p><p>Bring your rig to show off in the parking lot</p>','2023-05-28 22:00:00','2023-05-29 02:00:00','Denver Sweet, 776 Lincoln St #54, Denver, CO 80203, United States','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf69wobm007p0651haxec3gu','2023-03-13 03:36:59.17','2023-05-15 16:43:41.046','RUN','Medano Pass run + camping','<p>Medano pass is a Moderate to Intermediate (more Intermediate this time of year). The trail ends in the Great Sand Dunes National Park. A park pass is technically required, but as long as you don’t leave the park, I don’t think anyone will check. It is up to you if you want to purchase a day pass.We will return back over the pass.</p><p><br></p><p><br></p><p>The trail has varied terrain starting with forest at the top and gradually becoming more arid as you progress down. There are several long sections of deep sand that are fun to play in, and numerous water crossings. You will need a high clearance 4x4 as I expect the water crossings to be fairly deep this time of year. Please read the online reviews of the trail.</p><p>We will be dispersed camping on the east side of Medano Pass outside of Westcliff. There are NO services or water nearby. You will need to plan accordingly. Cell service is limited depending on how high you are up the pass. I will be going up on Thursday to secure a camp site for the group. I am hoping to get the same site we had last time. Anyone is welcome to join me on Thursday or come up on Friday afternoon. We will run the trail on Saturday. You are welcome to come up on Saturday and run the trail depending on space availability.</p>','2023-06-08 16:00:00','2023-06-11 21:00:00','','INTERMEDIATE',NULL,'TBD',0,-1,8,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clh0ofcmu008u0618tt7yb1rc','2023-04-28 14:56:12.725','2023-05-17 15:38:40.858','RUN','GREENHORN - Rampart Range','<p>Meet at Conoco&nbsp;<a href=\"https://www.google.com/maps/search/221+S+8th+St,+Colorado+Springs,+CO+80905?entry=gmail&amp;source=g\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 133, 244);\">221 S 8th St, Colorado Springs, CO 80905</a>&nbsp;departing at 09:00 to head toward the base of Rampart Range Rd @ Garden of the Gods. Follow north to Mt. Herman Road (with option to continue toward Sedalia). Run time is roughly 4-6 hours along dirt roads with few obstacles.&nbsp;</p><p><br></p><p><br></p><p>I\'d urge attendees to fuel up at our start point, coming with a packed lunch and drinks. The rendezvous point will be the only restroom available for the entirety of the run.&nbsp;&nbsp;</p><p>Hoping to stop for lunch at Pikes Peak Lookout, wind and traffic permitting.&nbsp;</p>','2023-05-21 15:00:00','2023-05-21 22:00:00','','EASY',NULL,'Conoco 221 S 8th St, Colorado Springs, CO 80905',0,-1,10,'ckz6a8s8m000b0788n8nczcwv',NULL,'ckomap3wu002x13b74lnt19lb',0),('clnkksoey00e90618bbwfe1ie','2023-10-10 17:08:13.587','2023-10-10 17:08:13.587','RUN','Saxon Mtn','<p>Let\'s do it. For real, I\'m serious. I\'ll even bring cookies.</p><p>This is a bouncy trail with a handful of smaller obstacles. This is ideal for vehicles with at least a small lift (or a short wheelbase if no lift). Stock vehicles will likely be fine, but if you have low-hanging running boards, I recommend skipping this one.</p><p>Meet behind the Circle K in Georgetown. We can air down and wander up and over the hill. </p><p>It\'s going to be in the 40s, so plan accordingly.</p>','2023-10-14 15:00:00','2023-10-14 21:00:00','','ADVANCED',NULL,'Circle K, Georgetown, CO',0,-1,8,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clndkchyh002a06067sm3x5n0','2023-10-05 19:21:15.487','2023-10-05 19:28:57.047','FUNDRAISING','Denver Sweet Beer Bust','<p>Looking for pourers and fillers. Guests and friends of members are more than welcome to help pour.</p><p><br></p><p><br></p><p>Meet at 3:00 if you want to showcase your vehicle up front.</p><p>Please arrive no later than 3:30 to do the mandatory training.</p><p>Tell your friends! Let’s get a good turnout.</p>','2023-10-15 21:30:00','2023-10-16 02:00:00','Denver Sweet','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wu002x13b74lnt19lb','clndkjiph004s0606igymzssh','ckomap3wv003s13b79xoq6fdt',0),('clixfs0lx009k0611iaq705e1','2023-06-15 17:50:13.262','2023-06-15 17:57:52.138','SOCIAL','Leadville Pride Parade','<p>Leadville, CO has organized their first ever Pride Parade, which is to be the highest Pride Parade in the US! It is last minute but we have been asked to come out and participate in the parade. There is no set number of vehicles that we can have.</p><p><br></p><ul><li>Staging Starts at 3:30pm at Silver City Printing and Parking Lots East of 4th St</li><li>Parade kicks off at 4pm and will head North up Harrison, turning right on East 8th St. (no throwing items out).</li><li>Parade will end at FREIGHT which will be hosting a drag show, dance party and food!</li></ul><p><br></p><p><img src=\"https://mail.google.com/mail/u/0?ui=2&amp;ik=9b05fe56c4&amp;attid=0.0.1&amp;permmsgid=msg-f:1768733632824718371&amp;th=188bcdde2ecdb423&amp;view=fimg&amp;fur=ip&amp;sz=s0-l75-ft&amp;attbid=ANGjdJ_CKbN9g6EJV9nU1rrei1TRHlyeAyCNuxkEL9lTycOGfTbrLgCBKgD5U-mXj37tz9AjN80sLcsRryMsZNMzxb2Nay8GuzxCeqeqTP_Bcc7QTXSjx0XKcg5PzLM&amp;disp=emb&amp;realattid=ii_liwidaw31\" alt=\"Pride Parade.png\" height=\"362\" width=\"483\"></p>','2023-06-17 21:30:00','2023-06-18 00:00:00','','UNKNOWN',NULL,'Silver City Printing - 115 E 4th St., Leadville, CO 80461',0,-1,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',0),('clpj2jzey00300657ej779cvd','2023-11-29 01:09:13.331','2023-11-29 01:09:13.331','RUN','Rampart Range Road Winter Run','<p>After meeting at the Walgreens in Monument, we\'ll head out onto Mt. Herman Rd towards Rampart Range Rd, then north to Ice Cave Rd loop. </p><p>We\'ll end the day onto Dakan Rd which dumps out near Castle Rock.</p><p><br></p><p>The latest trail report for Rampart mentioned 2\"-3\" of snow on the trail.</p><p>Dress appropriately for the weather. </p><p>I\'m excited to lead this run in the snow! Especially to get a run on the calendar in December for any Guest members who would like qualify for membership at the December Meeting. </p><p><br></p><p>I will email the group the day before the run with any updates. </p><p><br></p><p>Rally Point:</p><p>https://www.google.com/maps/place/39.0930278,-104.8646667</p>','2023-12-03 17:00:00','2023-12-03 22:00:00','','EASY',NULL,'Walgreens - 265 E Hwy 105, Monument, CO 80132',0,-1,6,'cl4wa4uop00ui071706h99c7f',NULL,'ckomap3ww005213b70kjhcoc4',0),('clktsc2yp002q0617nqbo8ctc','2023-08-02 13:50:04.796','2023-08-25 19:23:42.405','RUN','***CANCELLED*** Old Flowers Road (Fri Afternoon Cruiser, Post Overland Expo)','<h1><strong>***Please note that Wes has cancelled this run due to heavy rains and potential flooding in the area***</strong></h1><p><br></p><p>Let\'s do a scenic \"overland\" style NOCO trail after the Fri Overland Expo.&nbsp;(You don\'t have to come to the EXPO on Fri to do the run ;-)</p><p><strong>Old Flowers Road</strong></p><p>If Kelly Flats is my favorite hardcore NoCo trail,&nbsp;<a href=\"https://www.trailsoffroad.com/trails/403-old-flowers-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204);\">Old Flowers Road</a>&nbsp;is definitely my fav NoCo cruiser ... full of wildflowers, meadows, tree stands, a mountain ranch with stone buildings and some cool cabins ... this one is a great one to kick back and enjoy the view.&nbsp;There may be a little mud, a rut or two, stream crossings ... but what the trail lacks in challenge it makes up for in scenery.</p><p>We\'ll meet near The Ranch Events Center, so that those who have been shopping at the Overland Expo can join if they like.&nbsp;After crossing through Loveland, we\'ll have a beautiful paved cruise up to the trailhead through the Larimer hogback and Masonville.&nbsp;The trail itself is 1.5-2 hours.&nbsp;We\'ll finish with a cruise down Poudre Canyon where you can return home from Fort Collins or perhaps stop at one of the many great FoCo breweries.</p><p>Requirements:</p><p>None.&nbsp;This one is fine for stock vehicles.&nbsp;It\'s rated 3, so you\'ll have to place your tires carefully a few times, but this is a great easy intermediate trail.</p><p>We\'ll start at the Loaf and Jug so you can fuel up the vehicle and your cooler--there are also a number of fast food joints in this plaza if you want to grab something for the road.&nbsp;Meet at 3pm, ready to depart at 3:30pm sharp.</p>','2023-08-25 21:00:00','2023-08-26 02:00:00','','INTERMEDIATE',NULL,'Loaf and Jug - 6140 Crossroads Blvd in Loveland - https://goo.gl/maps/WTkv2T4fakWrx8Hd9',0,-1,0,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3ww004t13b7h7d0e136',0),('clcd31wvi002c07438dhg00sk','2023-01-01 08:00:22.349','2023-11-30 18:54:45.237','MEETING','December Membership Meeting','<p><span style=\"color: var(--primary-text);\">Our December meeting / holiday party will take place on Sunday, December 17th from 2p to 4p on the&nbsp;</span><a href=\"https://www.facebook.com/Denver-Eagle-100887389955916/?__cft__[0]=AZVtIOtDbDvKw1CCffgHfXCIfnfZSIygkRuEroTm7qCv5f4dRONVzrrjhzbYetKLv3tCUVxcCMKfJC7Qc-zx-8ad5NGEkldHHaTOl4sX2JQQFOlBfeeOdCjV1Uqm_LWksEG12N75wD_aCwdykkPZdOVH&amp;__tn__=kK-R\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--accent);\">Denver Eagle</a><span style=\"color: var(--primary-text);\">\'s back patio. We\'ll arrange for attendees to get 2 free drinks at the bar and for a caterer to be there.</span></p><p><span style=\"color: var(--primary-text);\">Don\'t forget!&nbsp;We\'ll be voting on the nominated members for 2024 officers that day, so it\'s really important that we get as many members present so that we have a proper quorum.</span></p>','2023-12-17 21:00:00','2023-12-17 23:00:00','Denver Eagle, 5110 W Colfax Ave, Denver, CO 80204','UNKNOWN',NULL,'',0,-1,-1,'ckomap3wv003s13b79xoq6fdt','clplk2495003n0631g5rctt5q','ckomap3wv003s13b79xoq6fdt',0),('clf6a28xa00am0651zoyg1lm5','2023-03-13 03:41:19.15','2023-06-30 23:39:10.222','RUN','***Cancelled*** Bill Moore Lake','<p><strong><em>***RESCHEDULED FROM 6/24*** … and 7/1… ***</em></strong></p><p><br></p><p><br></p><p>As of 6/25, the trail was reported to be impassable due to snow drifts. It\'s been hot lately, so I\'m hoping we\'ll have better luck. If we can\'t go all the way, we can hit up nearby Mad Creek.</p><p>The first section tends to erode and has gotten worse the last couple of years. It\'s on the high end of intermediate, but still fun. We\'ll get through it and work our way up to the meadow, maybe stop for lunch before continuing on to the lake.</p><p>We\'ll use FRS radios on channel 22. As usual, bring lunch, water, sunscreen, jacket, rain gear, etc. Please arrive at the rally point on time, ready to go. Use the restroom, grab coffee/food, and fuel up beforehand.</p>','2023-07-01 16:00:00','2023-07-01 21:00:00','','INTERMEDIATE',NULL,'Safeway, 2425 Miner St, Idaho Springs, CO 80452',0,-1,8,'ckomap3wv003s13b79xoq6fdt',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6adgle00gn0651w2e09g6a','2023-03-13 03:50:02.306','2023-06-02 15:12:31.473','RUN','Metberry Gulch','<p>Metberry&nbsp;Gulch is a well-known destination for wheelers seeking a more accessible yet challenging trail with a sprinkle of breathtaking views. This trail boasts a mix of rocky terrain, steep inclines, and a switchback that will put both driver and vehicle to the test. Starting with dense forests, then open meadows, and finally stunning mountain vistas, the scenery along the way is nothing short of spectacular. The trail passes through the Heyman fire burn area, Colorado’s largest fire at the time. The trail ends on the bank of the South Platte River. The hardest obstacle,&nbsp;Chicken Scratch Hill is at the end of the trail. You may choose to park above and walk down to the river for those not wishing to attempt the hill.&nbsp;</p><p>&nbsp;I will be camping in the area that weekend, so the meetup will be&nbsp;near&nbsp;the trailhead.&nbsp;Make sure you bring a&nbsp;lunch/snacks, plenty of water, and be prepared for the ever changing&nbsp;Colorado weather.&nbsp;</p><p>&nbsp;</p><p><a href=\"https://www.trailsoffroad.com/trails/373-metberry-gulch\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(5, 99, 193);\">https://www.trailsoffroad.com/trails/373-metberry-gulch</a></p><p>&nbsp;</p><p>Meet up location. Intersection of Hwy 67 and Abbey Ave.&nbsp;Westcreek&nbsp;CO.&nbsp;&nbsp;10:00 am&nbsp;&nbsp;&nbsp;</p><p>N39.15369&nbsp;&nbsp;W-105.16185</p><p>&nbsp;</p>','2023-07-22 16:00:00','2023-07-22 21:00:00','','INTERMEDIATE',NULL,'Intersection of Hwy 67 and Abbey Ave. Westcreek CO',0,-1,8,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6aiwjk00ir065129hhr3b9','2023-03-13 03:54:16.255','2023-06-02 15:15:19.478','RUN','Santa Fe Peak','<p>The Santa Fe Peak Trail is one of the most dramatically beautiful and&nbsp;enjoyable&nbsp;trails in the area.&nbsp;It&nbsp;starts&nbsp;in the&nbsp;thick evergreen&nbsp;forests&nbsp;around the town of Montezuma&nbsp;and climbssteadily upwards on a narrow rocky trail with lots of switchbacks until&nbsp;it&nbsp;breaks&nbsp;through the tree line and keepsclimbing upwards&nbsp;to the summit of Santa Fe Peak, where&nbsp;wewill be&nbsp;surrounded by gorgeous&nbsp;360-degree&nbsp;views&nbsp;at 13,100 feet above sea level.&nbsp;&nbsp;</p><p>We will meet at the&nbsp;northwest corner of the River Run Gondola Parking Lot at the Keystone Resort&nbsp;(39.608736, -105.946243)&nbsp;of US Highway 6 (west of Loveland Pass)&nbsp;at 10am.&nbsp;&nbsp;Please make sure you fuel up&nbsp;on the way here&nbsp;as there are no gas stations anywhere nearby.&nbsp;&nbsp;We will depart at&nbsp;approximately&nbsp;10:20heading east/southeast&nbsp;along Montezuma Road to the small town of Montezuma, where we will air down.&nbsp;From there we pick up the Santa Fe Peak Trail.&nbsp;After about 5 miles the trail dead-ends at the peak, so&nbsp;after stopping&nbsp;at or near the summit for lunch, pictures, and some&nbsp;hiking around (weather permitting),&nbsp;we will&nbsp;head back down&nbsp;to the town of Montezuma&nbsp;to air&nbsp;back&nbsp;up.</p><p>Then for those who wish to socialize afterwards we can proceed to Vice Kitchen Wine and Whiskey in Golden (18445 W Colfax Ave suite 104, just off I-70 and US-40).</p><p><strong>REQUIREMENTS</strong></p><p>While the trail is described as “moderate”, there are steep drop-offs&nbsp;to the sides, tight&nbsp;switchbacks,&nbsp;and some narrow,&nbsp;off-camber shelf roads that can be pretty&nbsp;intimidating, especially for the acrophobic.&nbsp;Any stock 4x4 with 4-Low&nbsp;gearing and 10 inches of ground clearance will be able to make this climb.</p><p>The weather at this altitude can be&nbsp;unpredictable, so please bring a jacket, extra water, food (lunch),&nbsp;sunscreen, hiking shoes, a 2-way radio capable of transmitting on General Mobile Radio Service (GMRS) frequencies, and a full tank of gas.</p><p>&nbsp;</p><p>More information:&nbsp;<a href=\"https://www.trailsoffroad.com/trails/445-santa-fe-peak\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 255);\">Santa Fe Peak - Colorado Offroad Trail (trailsoffroad.com)</a></p><p>&nbsp;</p>','2023-08-05 16:00:00','2023-08-05 21:00:00','','INTERMEDIATE',NULL,'River Run Gondola Lot, 124 Gondola Rd, Keystone, CO 80435',0,-1,8,'cl578ovtu00dh077814vu027f',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clisw6yff00a706650yt8kjsp','2023-06-12 13:30:53.25','2023-06-12 13:30:53.25','SOCIAL','Denver Pride 5K','<p>Join the 4-Players of Colorado in the Denver Pride 5K being held on Saturday, June 24th at 9:30am. You must register for this event through the link below - be sure you are joining the 4-Players of Colorado Team. </p><p>https://denverpride.org/5k/</p>','2023-06-24 15:30:00','2023-06-24 18:00:00','','UNKNOWN',NULL,'',0,-1,-1,'ckomap3ww004t13b7h7d0e136',NULL,'ckomap3ww004t13b7h7d0e136',0),('clf69xnmt00850651wdaf02mh','2023-03-13 03:37:44.932','2023-06-14 03:14:35.901','RUN','Mt Baldy','<blockquote>Everyone try to arrive gassed up and ready to go by 9:45 AM so we can be on our way at 10:00 AM. I expect the run will take us about 5 hours total.</blockquote><p>&nbsp;</p><blockquote>From the Home Depot, it’s a few miles along neighborhood streets to get to the trailhead for Old Stage Road (FS368), which is an easy, well-travelled dirt road. We’ll follow Old Stage Road for 10 miles to the trailhead for Mt Baldy (FS379) and air down at a turnout somewhere along the way. The beginning of the Mt Baldy trail is pretty easy, with some rocks, bumps, and optional mud holes. The trail does get more difficult near the summit with larger rocks and some mildly off-camber shelf road sections. From the summit, there is a short walk to view Mt Baldy Reservoir. It’s an out and back trail, we’ll head back down the way we came. Bring your own lunch.</blockquote><p><br></p>','2023-06-17 16:00:00','2023-06-17 21:00:00','','INTERMEDIATE',NULL,'Home Depot at Broadmoor Town Center, 2250 Southgate Rd, Colorado Springs, CO 80906',0,-1,8,'ckomap3wu003113b7bvifg74s',NULL,'ckomap3wv003s13b79xoq6fdt',0),('cljg3l74n00uj06479l0d852r','2023-06-28 19:16:37.078','2023-06-28 19:16:37.078','RUN','Kelly Flats - Rescheduled','<p><strong>***PLEASE NOTE THIS IS A RESCHEDULED RUN. ONLY REGISTER IF YOU WERE ON TEH ORIGIONAL JUNE 4TH RUN THAT WAS CANCELLED**** (there will be another run for this trail offered later this fall)</strong></p><p><strong>Itinerary </strong></p><ul><li>10:00 am&nbsp;- Depart Ted\'s Place (and end of cell service) for the scenic drive up Poudre Canyon, you can gas up here if needed.</li><li>10:45 am&nbsp;- Arrive at Kelly Flats Trailhead parking lot (not campground) and air down</li><li>11:00 am&nbsp;- Head up the trail. We\'ll run up Heart Attack Hill, stop for lunch in the clearing with epic views of the north ridge of RMNP, head to the Chutes (optional, those who don\'t can watch the fun), and come back across Pingree Park. Should be done by&nbsp;3:00/3:30ish&nbsp;depending on trail traffic and how many people do the Chutes.&nbsp;Folks can head 1) down the canyon and home, 2) into Red Feather Lakes for a bite, 3) down to FoCo or Wellington for a post-trail draft at one of NoCo\'s great breweries--we can decide post-trail</li><li>4:00 pm or so&nbsp;- Back in Fort Collins or Wellington and beverages/food or depart</li></ul><p><br></p><p><strong style=\"color: rgb(34, 34, 34);\">From Trails Offroad:</strong><span style=\"color: rgb(34, 34, 34);\">&nbsp;</span><a href=\"https://www.trailsoffroad.com/trails/348-kelly-flats\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204); background-color: rgb(255, 255, 255);\">https://www.trailsoffroad.com/trails/348-kelly-flats</a></p><p><span style=\"color: rgb(34, 34, 34);\">\"Rough and rugged,&nbsp;Kelly&nbsp;Flats&nbsp;4x4 Road is one of the more difficult trails in northern Colorado. Just west of the narrows in the Poudre Canyon, the drive to the trailhead through the Poudre Canyon is stunning and breath-taking. Two distinct obstacles highlight this road: Heart Attack Hill and The Chutes. Both obstacles have bypasses.&nbsp;Kelly&nbsp;Flats&nbsp;4x4 Road can be unnerving for beginning off-road drivers and the optional obstacles can be difficult and challenging for experienced drivers with modified rigs. The rest of the trail is a mixture of dirt two-track and occasional rock. Keep a keen eye out for elk and moose while in the forested area as they are often spotted. Put your transfer case in low range and enjoy this popular trail.\"</span></p><p><strong style=\"color: rgb(34, 34, 34);\"><u>My take</u><em>:</em></strong><span style=\"color: rgb(34, 34, 34);\">&nbsp;This is rated a 5/7 trail ... 5 for all required/easiest lines, and many of us regulars on the trail think it should be a 4/7 ... I think it\'s easier than the rating.&nbsp;While we will encounter both obstacles, most moderate (stock vehicle) drivers do fine staying the left line on Heart Attack Hill --I\'ve done it w/out lockers, and anyone can just observe the Chutes from the bottom or top of the bypass.&nbsp;In the last two years I\'ve had many stock JK\'s and XJ\'s complete with no problems, and I\'m happy to see any Taco\'s/4Runner\'s etc give it a shot!&nbsp;So this trail is truly \"intermediate\" with \"advanced\" options.&nbsp;Reach out if you want to discuss if this trail is for you!</span></p><p><strong>REQUIREMENTS/SKILLS</strong></p><ul><li>You\'ll be happier lifted on 35s, though careful placement/confident drivers on 33s will suffice, depending upon vehicle.&nbsp;The stock pickups may struggle on some of the ledges/drops, though there are enough easy lines that most vehicles can get through the base trail.</li><li>Lockers only for the harder line on Heart Attack Hill and for the Chutes</li><li>Comfort driving on a steep, loose ascent</li><li>Comfort dropping off 1.5\'+ rocks/ledges</li><li>Contact me directly if you\'re unsure.</li></ul><p><strong>BRING</strong></p><p>(As usual) your chair, lunch, drinks, jacket and a smile :-D</p>','2023-07-02 16:00:00','2023-07-02 21:30:00','','INTERMEDIATE',NULL,'Ted\'s Place - 6511 US 287, Laporte, CO 80535',0,-1,7,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3ww004t13b7h7d0e136',0),('clf6azmvp00p90651yemru4gk','2023-03-13 04:07:16.885','2023-08-15 01:58:11.534','RUN','Webster Pass','<p><span style=\"color: rgb(64, 64, 64);\">Webster Pass is perhaps the best-known and certainly most traveled of the three main passes between Summit County and Park County. It connects to two very popular, very challenging 4WD trails,&nbsp;</span><a href=\"https://www.trailsoffroad.com/trails/432-red-cone\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(2, 138, 215); background-color: rgb(255, 255, 255);\"><strong>Red Cone</strong></a><span style=\"color: rgb(64, 64, 64);\">&nbsp;and&nbsp;</span><a href=\"https://www.trailsoffroad.com/trails/429-radical-hill\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(2, 138, 215); background-color: rgb(255, 255, 255);\"><strong>Radical Hill</strong></a><span style=\"color: rgb(64, 64, 64);\">. The summit, above 12,000 feet, offers spectacular views of both counties and a great vantage point to watch rigs descending the white-knuckle ride down from Red Cone.&nbsp;We will start at the south end of the trail and make our way north to Montezuma!&nbsp;Webster Pass is a relatively easy 4WD road. From the north, there are not any serious obstacles other than one stream crossing that, during Spring runoff, will test the door seals of stock trucks.</span></p>','2023-08-20 14:30:00','2023-08-20 21:00:00','','INTERMEDIATE',NULL,'Marge Hudak Public Swimming Pool Parking Lot - 57393 US HWY 285, Bailey, CO 80421',0,-1,8,'ckomap3ww004y13b76fvy4564',NULL,'ckomap3ww004t13b7h7d0e136',0),('clmffdzg000bj0649t7nzw9z9','2023-09-11 21:58:16.747','2023-09-11 21:58:16.747','RUN','Red Cone / Radical Hill / Saints John','<p>This day is for you if you LOVE:</p><ul><li>STEEP ascents/descents</li><li>HIGH, NARROW shelf/saddle roads</li><li>small rock gardens</li><li>expansive views above timberline</li></ul><p>These are a great set of trails for you to push yourself from intermediate driving to some more advanced terrain and skills. However, if you DON\'T like the above--especially heights--this is not the day for you.&nbsp;</p><p>We\'ll meet at 9:15 in Grants, CO at the Shaggy Sheep cookhouse.&nbsp;(Come by 8:30 if you want to have breakfast here.)&nbsp;We\'ll and air down and drive 5 min on Hwy 287 to the turn off to Red Cone.&nbsp;NOTE: the last gas station is BEFORE the meetup point, in Bailey.&nbsp;Please arrive fueled up!</p><p>Depending on the drivers/pace, we\'ll be on Red Cone (2ish hrs), drop into the valley below Webster for lunch (out of the wind), up Radical (1.5ish hr) and then across Saints John (2ish hrs). We\'ll air up in Montezuma and folks can go home over Loveland Pass or through Dillon and I-70 tunnels. There\'s also the option of stopping in Summit County for a post run brat/burger/brew. ;-)</p><p><span style=\"color: rgb(34, 34, 34);\">Trail Descriptions:</span></p><p><span style=\"color: rgb(34, 34, 34);\">Red Cone (rated 5-7, Difficult/Severe)</span></p><p><span style=\"color: rgb(34, 34, 34);\">From Trails Offroad,&nbsp;</span><a href=\"https://www.trailsoffroad.com/trails/432-red-cone\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204); background-color: rgb(255, 255, 255);\">https://www.trailsoffroad.com/trails/432-red-cone</a><span style=\"color: rgb(34, 34, 34);\">, \"This four-wheel drive trail provides spectacular views of the divide with several rocky obstacles at the beginning and a once in a lifetime descent near the end. The upper portion of the trail traverses the ridge lines around 12,000 feet with views for miles. A well-equipped vehicle with high clearance and low range is required. If you are not comfortable with steep descents, avoid this trail.\"</span></p><p><span style=\"color: rgb(34, 34, 34);\">Radical Hill (rated 5-7, Difficult/Severe)</span></p><p><span style=\"color: rgb(34, 34, 34);\">From Trails Offroad,&nbsp;</span><a href=\"https://www.trailsoffroad.com/trails/429-radical-hill\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204); background-color: rgb(255, 255, 255);\">https://www.trailsoffroad.com/trails/429-radical-hill</a><span style=\"color: rgb(34, 34, 34);\">&nbsp;\"A short, narrow, white-knuckle 4wd climb with several tight switchbacks leading to amazing views above 12,600 feet. If you are not comfortable with narrow shelf roads, this is not a trail for you.\"</span></p><p><span style=\"color: rgb(34, 34, 34);\">Saints John (rated 3-4, Moderate)</span></p><p><span style=\"color: rgb(34, 34, 34);\">From Trails Offroad,&nbsp;</span><a href=\"https://www.trailsoffroad.com/trails/443-saints-john\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(17, 85, 204); background-color: rgb(255, 255, 255);\">https://www.trailsoffroad.com/trails/443-saints-john</a><span style=\"color: rgb(34, 34, 34);\">,</span></p><p><span style=\"color: rgb(34, 34, 34);\">\"The majority of Saints John is smooth and easy. The major hill-climbs all have larger rocks and there are a couple of small ledges that might look imposing to less experienced drivers, but choosing a good line will get a good stock truck through without issue.\" (Once you\'ve done Red Cone and Radical, Sts John will be a piece of cake.)</span></p><p><span style=\"color: rgb(34, 34, 34);\">Vehicle recommendations:</span></p><ul><li>35\'s+/2\"+ lifts, vehicle dependent, preferred (there are short narrow rock gardens on both Red Cone and Radical--skilled drivers might navigate with 33\'s, even stock, but expect to bang some rocks ;-)</li><li>Lockers (but a skilled driver without lockers can make it through)</li><li>Reach out to me if you have questions about your vehicle or driving skills!</li></ul><p><span style=\"color: rgb(34, 34, 34);\">Bring a lunch, extra snacks, a chair, sunscreen/hat (we\'ll be above tree line much of the day)</span></p><p><span style=\"color: rgb(34, 34, 34);\"><span class=\"ql-cursor\">﻿</span>Rally Location</span></p><p>Again,&nbsp;<strong>meet up/air down 9:15</strong>&nbsp;at The Shaggy Sheep Cookhouse, 50455 US Hwy 285, Grant, CO 80448 ...&nbsp;<strong>9:30 departure</strong>.</p><p><strong><em>Get gas in Bailey en route to the Shaggy Sheep ... there is no gas between here and trailhead.</em></strong></p><p><span style=\"color: rgb(34, 34, 34);\">NOTE: Our day begins on Hwy 285 near Bailey and ends near Keystone (Hwy 6 or I-70)</span></p>','2023-09-17 15:15:00','2023-09-17 23:00:00','','ADVANCED',NULL,'The Shaggy Sheep Cookhouse - 50455 US HWY 285, Grant, CO 80448',0,-1,7,'ckomap3wt001v13b7cz8debau',NULL,'ckomap3ww004t13b7h7d0e136',0),('clh0zj19l00pn0618gg1u6viw','2023-04-28 20:07:00.393','2023-08-15 13:32:56.6','RUN','Dakan Rd / Upper Jackson Creek Rd','<p><span style=\"color: rgb(34, 34, 34);\">Dakan Road is a very pleasant trail in the Pike National Forest near Castle Rock that runs from Perry Park Road to Rampart Range Road. It is suitable for all levels of drivers, and any stock 4x4 can run this with no problems. There are a few tremendous views of the front range. This trail can be a bit crowded so be on the lookout for traffic from dirt bikes, ATVs, and other vehicles.This is a very nice trail through the valley in between Devil\'s Head and Dakan Mountain with a creek that runs through it. It has some spots for fishing, camping, and picnics. It\'s a nice trail to run to extend other trails or just to do Dakan Road as a loop. It has a lot of connectors to ATV and Dirt Bike trails. There is a very large network of trails here in the rampart range area that can make for a great day on the trail.</span></p>','2023-09-17 16:00:00','2023-09-17 21:00:00','','EASY',NULL,'Circle K - 23 W Wolfensberger Rd., Castle Rock, CO 80109',0,-1,6,'ckomap3wv003j13b7fdylcckg',NULL,'ckomap3ww004t13b7h7d0e136',0),('clf6awc2100oh0651wv1rzmsi','2023-03-13 04:04:42.888','2023-09-10 15:08:42.672','RUN','GREENHORN - Jones Pass','<p>Greenhorn events are intended for guest members and members that have joined the club in the past year who may be newer to the sport. It’s an opportunity for asking questions, to learn, and to get out on the trail with folks with similar experience.&nbsp;</p><p><span style=\"background-color: transparent; color: rgb(64, 64, 64);\">Jones Pass is an easily accessible trail for most vehicles with a good number of campsites along the road. It is a short drive to the top of the pass when it is not snowed shut, and at the top, you are rewarded with panoramic mountain views in every direction! Jones Pass is located on the Continental Divide. The easy access from I-70 makes it a popular place for a hike or a quick drive to the pass to take in the views.</span></p><p><span style=\"background-color: transparent; color: rgb(64, 64, 64);\">This trail also offers excellent birdseye views of the Henderson Molybdenum Mine.</span></p><p><span style=\"background-color: transparent; color: rgb(64, 64, 64);\">Woods Creek Road, near Berthoud Pass above the town of Empire, is a short and leisurely drive-through property owned by the Henderson/Climax Mine Company that leads to the Urad Lake Wildlife Area. Urad Lake has fantastic fishing and miles of excellent hiking terrain. </span></p><p><span style=\"background-color: transparent; color: rgb(64, 64, 64);\">Please come prepared with water and snacks. Planning for lunch at a local establishment.&nbsp;</span></p><p><a href=\"https://www.trailsoffroad.com/trails/346-jones-pass\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(17, 85, 204);\">Jones Pass Trails Offroad Information</a></p><p><a href=\"https://www.trailsoffroad.com/trails/3771-woods-creek-road\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(17, 85, 204);\">Woods Creek Road Trails Offroad Information</a></p>','2023-09-10 15:00:00','2023-09-10 21:00:00','','EASY',NULL,'Starbucks, 999 308 B, Dumont, CO 80436, United States',0,-1,8,'ckosskhyp01iu0769sg18kya6',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6andee00jg0651kwpggk5i','2023-03-13 03:57:44.725','2023-07-05 20:38:04.38','RUN','Saints John / Deer Creek','<p>This 4WD trail runs along&nbsp;high alpine ridge lines for several miles with spectacular 360-degree views.&nbsp;The trail features&nbsp;a couple of&nbsp;steep&nbsp;hill climbs to keep things interesting. The trail\'s north end drops down into the forest below, making its way into the tiny town of Montezuma.&nbsp;The current 4WD trail follows the route once taken by ox or mule-driven ore carts hauling the mined ore over the Continental Divide and down the Swan River Valley to the mills and rails in Breckenridge.</p><p>I will be making a loop of&nbsp;Deer Creek&nbsp;and&nbsp;Saints John.&nbsp;Deer Creek is an easy trail&nbsp;and&nbsp;Saints John is a lower moderate trail.&nbsp;It&nbsp;was posted Saints John was graded last year to remove some of the rough sections. A stock 4x4 with decent clearance should be good.&nbsp;There were still some decent sized rocks on the 2 hill climbs last year. I usually like to run this trail in the opposite direction due to the views, but&nbsp;this year&nbsp;we will&nbsp;run&nbsp;so&nbsp;we can take advantage of the hill climbs.&nbsp;</p><p>The majority of the run will&nbsp;be&nbsp;above timberline&nbsp;and over 11,000 ft.&nbsp;with great views of Breckenridge and Red Cone.&nbsp;Because of the open terrain and elevation, make sure you are prepared for sun, rain, wind, and cold, probably don’t have to worry about snow, but sleet and hail is a possibility.&nbsp;In other words, a typical summer day in the Colorado high country.&nbsp;</p><p>Meetup behind the Circle K in Georgetown. 9:30am&nbsp;</p>','2023-08-06 15:30:00','2023-08-06 21:00:00','','INTERMEDIATE',NULL,'Circle K, 1501 Argentine St, Georgetown, CO 80444',0,-1,8,'ckomap3wv003n13b77iqfhwv1',NULL,'ckomap3wv003s13b79xoq6fdt',0),('clf6aby9600f70651mycu6ad8','2023-03-13 03:48:51.881','2023-07-08 17:12:27.492','RUN','Rollins Pass','<p>Road 117 is an easy 4% grade that ends shortly before the top of the pass tunnel (11,331ft) which has been closed off to vehicle and foot traffic. Hiking option to the top of the pass at the tunnel.&nbsp;Pass by Yankee Doodle Lake and stop for lunch there or by the pass at the top.&nbsp;</p><p>This is a good trail road for any members or guests to join that have a stock rig or are new to off-road trails. Technical experience not required.</p>','2023-07-16 16:00:00','2023-07-16 21:00:00','','EASY',NULL,'Moffat Tunnel East Portal TH Parking https://goo.gl/maps/xoamD5sPkYhitXW36  ',0,-1,8,'cl4wa4uop00ui071706h99c7f',NULL,'ckomap3ww005213b70kjhcoc4',0),('cljzsv8px00aa0681wfy6p6xf','2023-07-12 14:11:53.441','2023-08-15 22:22:24.054','RUN','Kingston Peak with Hike - Reschedule','<p><strong>NOTE:&nbsp;This is the second attempt of the same run we did on July 9th that was diverted due to seasonal closure.&nbsp;If you were not a part of that group, please allow those who participated in that run to sign up first.&nbsp;Any remaining available spots can be claimed after September 15th.&nbsp;</strong></p><p>“Situated about an hour from the Denver and Boulder Metro areas, this is a high-altitude trail that is a must-do for anyone in the area as it is the gem of the immediate surround off-road trails in the area. Although they call this the Kingston Peak Trail, the real beauty and focal point are the amazing views you get of James Peak for almost the entire route. James Peak is 13,294 feet and named in honor of Dr. Edwin James, an early explorer, historian, and botanist who was a member of the famous Stephen H. Long expedition to Colorado in 1820.\" – Trails Offroad review</p><p>The meeting place will be at the back of the Z Casino parking lot (101 Gregory Street, just north of the intersection of Hwy 119 (Black Hawk Blvd) and Gregory Street (shown on some maps as Black Hawk Street) in the town of Black Hawk at 10am. We will depart there at around 10:20 and then will air down when we turn off Hwy 119 onto Apex Valley Road to air down.&nbsp;</p><p>From there it\'s a relatively flat drive until we reach the eastern end of the Kingston Peak Trail, when the road turns rough and steep. We will stop for the hike (see below), then have lunch before or after proceeding to the top of Kingston Peak.</p><p>Towards the back side of the mountain will pass by a gorgeous overlook of Loch Lomond, and at the end we will wind up in the town of St. Mary\'s.</p><p>Then for those who wish to socialize afterwards we can proceed to Over Yonder Brewing Company in Golden (18455 W Colfax Ave suite 104, just off I-70 and US-40).</p><p>Further information on the trail: https://www.trailsoffroad.com/trails/351-kingston-peak</p><p><strong>REQUIREMENTS</strong></p><p>This run will require drivers to have a good amount of ground clearance (at least 10 inches) and a 4-Low setting in their transfer case. Stock 4WD vehicles with these features should be fine. The trail itself isn\'t too challenging but be prepared for some steep inclines and narrow tracks with large drop-offs.</p><p>Also make sure you bring a jacket or coat, as the weather can turn quickly. Also bring extra water, food (lunch), sunscreen, hiking shoes, a 2-way radio capable of transmitting on General Mobile Radio Service (GMRS) frequencies, and a full tank of gas.</p><p><strong>THE HIKE</strong></p><p>About two-thirds of the way up to Kingston Peak itself we will stop at the James Peak Lookout (Point of Interest #7 on Trails Offroad) and hike down to James Peak Lake, weather permitting.&nbsp;The trail loop is about 3 miles round-trip with an elevation change of 744 feet (down then back up).</p><p>This part is optional; however, anyone who doesn\'t want to do the hike is requested to stick around at the Lookout and wait for the others to return, which could be 90 minutes or more.</p><p>Further information on the hike: https://www.alltrails.com/trail/us/colorado/james-peak-lake&nbsp;</p>','2023-08-26 16:00:00','2023-08-26 22:00:00','','INTERMEDIATE',NULL,'Z Casino Parking Lot - 155 Selak Street, Black Hawk, CO 80422',0,-1,10,'cl578ovtu00dh077814vu027f',NULL,'ckomap3ww004t13b7h7d0e136',0);

