son-park-south','Pierson Park South','<p><a href=\"https://www.trailsoffroad.com/trails/3525-pierson-park-south\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p>','40.2349730394781,-105.501774027944',NULL,NULL,NULL,NULL,NULL,NULL,'ckphrbec500tz0702cbsk9511'),('ckprr1ew200aa07197ia0flz8','2021-06-11 03:07:22.657','2021-06-11 03:07:22.657','saxon-mountain','Saxon Mountain','<p><a href=\"https://www.trailsoffroad.com/trails/449-saxon-mountain\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p>','39.7227478120476,-105.689796460792',NULL,NULL,NULL,NULL,NULL,NULL,'ckprr1ews00ab0719tu6q9b6l'),('ckomdpbgb0011b4b75w8u1dq9','2021-05-13 04:15:30.107','2021-06-21 02:58:25.891','yankee-hill','Yankee Hill','<p><a href=\"https://www.trailsoffroad.com/trails/502-yankee-hill-to-central-city\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p>','39.81439,105.55385','Black Hawk, CO 80422',NULL,NULL,NULL,NULL,NULL,'ckq614e0p00c00755a28t1b9f'),('ckomdpbgb0016b4b7f6i27409','2021-05-13 04:15:30.107','2021-08-11 16:21:16.376','mosquito-pass','Mosquito Pass','<p><a href=\"https://www.trailsoffroad.com/trails/389-mosquito-pass\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p><p><br></p>','39.28155,-106.06024','',NULL,NULL,NULL,NULL,NULL,'cks7p9abs006z07829betcalf'),('ckrtk5c7t003o0743qilmtmw0','2021-08-01 18:49:25.507','2021-08-01 18:53:00.909','old-fall-river-road','Old Fall River Road','<p><span style=\"color: rgb(64, 64, 64);\">A historic roadway crossing through&nbsp;</span><a href=\"https://www.nps.gov/romo/index.htm\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(8, 103, 217);\">Rocky Mountain National Park</a><span style=\"color: rgb(64, 64, 64);\">. It was built between 1913 and 1920 by 38 convicts from the Colorado state penitentiary, resulting in it being the very first motor route to cross the park. Following the construction of&nbsp;</span><a href=\"https://www.nps.gov/romo/planyourvisit/trail_ridge_road.htm\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(8, 103, 217);\">Trail Ridge Road</a><span style=\"color: rgb(64, 64, 64);\">&nbsp;in 1932, Old Fall River Road was designated a one-way route and continues to be today. Your journey up Old Fall River Road and around the slopes of Mt. Chapin, will take you through three of the life zones, or ecosystems, that Rocky Mountain National Park has to offer.</span></p>','40.414252,-105.655204','',NULL,NULL,NULL,NULL,NULL,'ckrtk5c8e003p07437o4qwnfx'),('ckomdpbga000gb4b72gsw417s','2021-05-13 04:15:30.106','2022-04-20 14:48:46.293','argentine-pass','Argentine Pass','<p>Clear Creek County</p><p><br></p><p>N039 40.990 W105 42.170</p>','',',,,',NULL,NULL,NULL,NULL,NULL,'cl27owyrr00l00728a4g6gd92'),('cl27p3jvp00mc07280c1iu07f','2022-04-20 14:53:50.053','2022-04-20 14:53:50.053','peak-10','Peak 10','<p><span style=\"color: rgb(64, 64, 64);\">Peak 10 4WD trail combines the casual fun of driving up ski runs with the thrill of high altitude shelf roads and impeccable views of Breckenridge and the Blue River valley. The trail reaches over 13,000 feet and ends at a telecommunications tower just above the ruins of the Briar Rose mine.</span></p><p><span style=\"color: rgb(64, 64, 64);\">Any vehicle can drive up the through the Breckenridge Ski Resort property, around and under a couple of ski lifts, and past the Overlook lodge. But when you leave the ski property, the trail gets serious, requiring 4WD and good ground clearance.</span></p>','39.474050, -106.049940','511 Village Rd, Breckenridge, CO 80424',NULL,NULL,NULL,NULL,NULL,'cl27p3jvs00md07284z45sdz8'),('cl1cvsd8p005a0749066zboqu','2022-03-30 01:20:14.088','2022-06-03 16:42:36.16','chinaman-gulch','Chinaman Gulch','<p><span style=\"color: rgb(64, 64, 64);\">Chinaman Gulch is a very popular, difficult rock crawling trail best suited for modified vehicles. Minimal snow to the area makes it an ideal location for winter wheeling. There are many obstacles and rocks to play on along this 4wd trail, many of which provide multiple lines from easy to hard. Although not very scenic, the occasional views of the Collegiate Peaks are astonishing. This trail is a great trail for groups as the main obstacles provide enough room for vehicles to pull out of the way and watch other vehicles attempt the obstacle.</span></p>','','',NULL,NULL,NULL,NULL,NULL,'cl1cvsd8s005b0749qz9m4wiv'),('ckomdpbgb001mb4b74vzzfaf8','2021-05-13 04:15:30.108','2022-04-20 15:11:20.904','switzerland-trail','Switzerland Trail','<p>40° 1\' 4.17\"N 105° 30\' 33.66\"W From Lyons go 15.5 miles on CO HWY 7 to CO HWY 72 a.k.a. Peak to Peak HWY and turn left onto HWY 72. Go 15.9 miles to CR 120J and turn left, this is the start of the Switzerland Trail. From Boulder go 16 miles on CO HWY 119 / Boulder Canyon Drive to the first roundabout in the Town of Nederland. Take the 2nd exit from the roundabout which is W 2nd street / CO HWY 72. Continue 5.8 miles to CR 120J and turn right onto the trailhead.</p>','',',Gold Hill,Colorado,',NULL,NULL,NULL,NULL,NULL,'cl27pq0fb00r50728xh4mstgl'),('cl1cvjc6i002o0749xu5c0f4b','2022-03-30 01:13:12.789','2022-04-20 15:13:47.236','pickle-gulch','Pickle Gulch','<p><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Expect to experience smooth tree-shaded portions, open meadows, bumpy dirt roads, steep climbs, collapsed log cabins, weathered mining structures, and views of Rocky Mountain peaks. The top of Pickle Gulch connects to the extensive network of trails around Oregon Hill and Dakota Hill offering even more mining history, spectacular views and offroad adventure.&nbsp;</span></p>','','',NULL,NULL,NULL,NULL,NULL,'cl1cvjc9w002p0749jivkwsnm'),('cl27qexyy01430728pd6pjel9','2022-04-20 15:30:41.145','2022-04-20 15:30:41.145','apex-valley','Apex Valley','<p>Apex Valley Road is an easy, pleasant drive up a beautiful mountain valley past quaint summer cottages and picturesque year-round residences. This road provides access to several more difficult trails and is one of the main entry points into the extensive network of 4x4 trails around Dakota Hill and Oregon Hill. Along the way it passes through the middle of the ghost town of Apex, giving you a glimpse into the rich mining history of the area. Above Apex the road becomes rougher and more rugged as it rises out of the valley up the side of Dakota Hill. The switchbacks along this portion of the trail offer spectacular views of the surrounding mountains to the south and west. This trail can be an easy, scenic outing or the beginning of a longer adventure on the many connecting trails.</p>','39.819606, -105.513080','Blackhawk, CO',NULL,NULL,NULL,NULL,NULL,'cl27qexz3014407280882ujb6'),('cl2s4exn400fw0715fu2pecil','2022-05-04 21:57:58.863','2022-05-04 21:57:58.863','boulder-county-rd-68j','Boulder County Rd 68J','<p>This 4.5-mile 4x4 road is a straight-through road that takes you from the east side of Gross Reservoir to the west side or vice versa. The first half-mile of this road on the east side makes its way through a neighborhood, passing many mountain homes and many signs hoping to discourage recreation in the area. You quickly come to the most difficult part of the road with some severe washouts and ruts that will require 4 wheel drive. The next half mile is a narrow, single-lane road with only a handful of places to bypass oncoming traffic. Once past the washouts, the road has one small rock obstacle easily navigated with proper tire placement. After passing the Twin Sisters Peak hiking trail, the road widens significantly and smooths out to an easy dirt road with occasional rocks poking through the roadbed.</p><p><br></p><p>This road is best suited for high clearance, 4 wheel drive vehicles with good ground clearance and articulation.</p>','39.9596348,-105.3707837',NULL,NULL,NULL,NULL,NULL,NULL,'cl2s4exn800fx0715tatl8o1x'),('cl2s4sjjr00nx0715kmo5iqkd','2022-05-04 22:08:33.783','2022-05-04 22:08:33.783','topaz-mountain-wallace-gulch','Topaz Mountain/Wallace Gulch','<p>Topaz Mountain (FSR 446) starts out smooth and very easy, gradually becoming more rutted and rocky as you gain elevation. As you traverse the sides of North Tarryall Peak and Topaz Mountain, you encounter several closed spurs. Please Stay the Trail and keep on the legal route. There are also connections to the Nate Schultz hiking trail and 4x4 trails Banana Peel and Bonis Creek. Along the upper sections the trail is less worn and it is common for grass and weeds to cover the trail. At the intersection with Bonis Creek the trail becomes Wallace Gulch (FSR 854) which takes you back down to Lost Park Road gradually getting smother again as you return to civilization.</p>','39.3244622368366,-105.590648436919',NULL,NULL,NULL,NULL,NULL,NULL,'cl2s4sjjt00ny0715cep20hhg'),('ckomdpbgb001db4b7bxn4gmdc','2021-05-13 04:15:30.107','2022-06-03 17:23:30.502','red-cone','Red Cone','<p><a href=\"https://www.trailsoffroad.com/trails/432-red-cone\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">More inf</a><a href=\"https://www.trailsoffroad.com/trails/432-red-cone\" rel=\"noopener noreferrer\" target=\"_blank\">o on Trails Offroad</a></p><p><br></p><p><br></p><p><strong>DO NOT USE YOUR CLUTCH WHEN GOING DOWN A STEEP OR ROCKY HILL</strong></p><p>Always use the vehicle’s compression. In a vehicle with a manual transmission, use the lowest gears and compression. <strong>Do not ride your clutch</strong>. Pump the brakes lightly if necessary.</p><p>With automatic transmissions, use low range in the lowest gear and feather your brakes lightly. If you start to slide, turn in the direction of the slide as on snow or ice. If you have ABS (anti lock braking system), <strong>do not pump the brakes</strong>.</p>','39.4839,-105.80438','',NULL,NULL,NULL,NULL,NULL,'ckrma6ef9003t0750xx2yoiuw'),('cl449qbs400mz0790xq492lo4','2022-06-07 14:39:44.931','2022-06-07 14:39:44.931','sports-car%20tour','Sports Car Tour','<p>Sports Car Tour - See Details in Event </p>','40.811580.-105.590210','TBD',NULL,NULL,NULL,NULL,NULL,'cl449qbs700n00790k7sbwgkj'),('ckomdpbga000bb4b736202unh','2021-05-13 04:15:30.106','2022-07-15 16:54:15.997','rampart-range-mt-herman','Rampart Range / Mt Herman','<p>Douglas County</p><p><br></p><p><br></p><p><br></p><p>N039 05.300 W104 54.660</p>','',',,,',NULL,NULL,NULL,NULL,NULL,'cl5motltm005v07447m1696do'),('cl6fkggtw00e50776mes19p1s','2022-08-04 21:44:53.299','2022-08-08 16:38:02.896','old-flowers-road','Old Flowers Road','<p><a href=\"https://www.trailsoffroad.com/trails/403-old-flowers-road\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p>','40.61924,105.35720','',NULL,NULL,NULL,NULL,NULL,'cl6fkggtx00e60776f36jpyg0'),('clf69pqlk004f0651n1pqkhuv','2023-03-13 03:31:35.528','2023-03-13 03:31:35.528','medicine-bow-national-forest','Medicine Bow National Forest','<p><a href=\"https://stateparks.com/medicine_bow_national_forest_in_wyoming.html\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'clf69pqln004g0651kaaovag0'),('clf6an3ih00j306510i81lrrl','2023-03-13 03:57:31.912','2023-03-13 03:57:31.912','saints-john','Saints John','<p><a href=\"https://www.trailsoffroad.com/trails/443-saints-john\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p>','39.5208672,-105.8689701',NULL,NULL,NULL,NULL,NULL,NULL,'clf6an3ij00j40651fik8665m'),('clf6az8dm00ow0651q4el1bq8','2023-03-13 04:06:58.09','2023-03-13 04:06:58.09','webster-pass','Webster Pass','<p><a href=\"https://www.trailsoffroad.com/trails/488-webster-pass\" rel=\"noopener noreferrer\" target=\"_blank\">More info</a></p>','39.56786,-105.86029',NULL,NULL,NULL,NULL,NULL,NULL,'clf6az8do00ox06511elha486');
